INSERT INTO `m_dilutiongroup` VALUES (1,'DILUTION TABLE','DILUTION TABLE:',NULL,NULL,5,'oz','gal','Appropriate dilution rates may be substituted as long as they are equivalent dilution rates.','This DILUTION TABLE is optional.',17),(3,'FOOD CONTACT SANITIZING DILUTION TABLE {FOR FOOD CONTACT SURFACES, PUBLIC EATING PLACES, DAIRY PROCESSING EQUIPMENT FOOD PROCESSING EQUIPMENT AND UTENSILS}:','To prepare a 150, 200, 300 or 400 ppm active solution use the following dilution table. Prepare the correct dilution rate based upon the appropriate use site.  ',NULL,NULL,7,'oz','gal','On the final printed label either the dilution table and/or one of the dilution rates (or equivalent use dilution) will be used. If the dilution table is used then the 150  400 ppm dilution instruction will be used.',NULL,17),(4,'DILUTION TABLE','DILUTION TABLE:',NULL,NULL,NULL,'oz','gal','Appropriate dilution rates may be substituted as long as they are equivalent dilution rates.','This DILUTION TABLE is optional.',36),(5,'FOOD CONTACT SANITIZING DILUTION TABLE {FOR FOOD CONTACT SURFACES, PUBLIC EATING PLACES, DAIRY PROCESSING EQUIPMENT FOOD PROCESSING EQUIPMENT AND UTENSILS}:',' To prepare a 150, 200, 300 or 400 ppm active solution use the following dilution table. Prepare the correct dilution rate based upon the appropriate use site.  ',NULL,NULL,NULL,'oz','gal','On the final printed label either the dilution table and/or one of the dilution rates (or equivalent use dilution) will be used. If the dilution table is used then the 150  400 ppm dilution instruction will be used.',NULL,36);
