INSERT INTO `m_directionsforusesection` VALUES (53,'MEAT/POULTRY',NULL,NULL,'{{BeforeUsing}} ',NULL,NULL,NULL,NULL,'The following statement is to be used if any food premise locations are listed on the final label.',NULL,NULL,NULL,1,6,NULL,NULL),(54,'MEDICAL',NULL,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. {This product can be used to pre-clean or decontaminate critical or semi-critical medical devices prior to sterilization or high-level disinfection.} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,6,56,NULL),(56,'NON-MEDICAL',NULL,'This product is not for use on medical device surfaces.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,6,54,NULL),(57,'DISINFECTANT CLEANER',NULL,'{{DISINFECTANT}}','',NULL,NULL,NULL,NULL,'This DILUTION TABLE is optional. ',NULL,NULL,NULL,1,1,NULL,NULL),(58,'HOSPITAL',NULL,'HOSPITAL/HEALTH CARE/MEDICAL/NON-MEDICAL DISINFECTION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,1,NULL,NULL),(59,'BLOODBORNE PATHOGEN INSTRUCTIONS',NULL,'BLOODBORNE PATHOGEN INSTRUCTIONS: ',NULL,NULL,NULL,NULL,NULL,'Note to Reviewer: Heading is optional. If instructions used, all indented text must be included.',NULL,NULL,NULL,3,1,NULL,NULL),(60,'SURGICAL INSTRUMENT PRESOAK',NULL,'SURGICAL INSTRUMENT PRESOAK: ',' {{AddMix}} 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} {{450PPM}}. Place pre-cleaned instruments in solution to presoak surgical instruments for a minimum of 10 minutes, then proceed with normal sterilization proc','Plastic instruments can remain immersed until sterilization. Metal instruments must be removed after 10 minutes, rinsed, dried, and kept in a clean non-contaminated receptacle until sterilization. Prolonged soaking will cause damage to metal instruments. Surgical instruments must be sterilized before use.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,1,NULL,NULL),(62,'ULTRASONIC BATH DISINFECTANT',NULL,'ULTRASONIC BATH DISINFECTANT DIRECTIONS: ','Pre-clean heavily soiled objects. Use this product to disinfect hard, non-porous non-critical objects compatible with Ultrasonic cleaning units. Pour a fresh solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} directly into bath chamber. Place objects into unit and operate {{ManufacturersDirections}} for a minimum of 10 minutes. Remove objects and rinse with sterile water. Allow to air dry. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,1,NULL,NULL),(63,'NON-POROUS BATH AND THERAPY EQUIPMENT',NULL,'FOR DISINFECTING HARD, NON-POROUS {{SealedFiberglass}} BATH AND THERAPY EQUIPMENT:','Drain the water from the unit. Pre-clean heavily soiled surfaces to {{RemoveBuildups}}. Prepare a use solution by adding {{3oz}} of this product per every 5 gal. of water {{EquivalentUse}} {{450PPM}}.  Refill the unit with the use solution to just cover the intake valve. Briefly start the pump to circulate the solution. Turn off pump. Wash down the unit sides, seat of the chair lift, and all related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 10 minutes for proper disinfection. After the unit has been thoroughly disinfected, drain solution from the unit and rinse all surfaces with fresh water. The unit is ready for reuse.    ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,1,NULL,NULL),(64,'CLEANING AND DISINFECTING PERSONAL PROTECTIVE EQUIPMENT',NULL,'CLEANING AND DISINFECTING HARD, NON-POROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT {{Respirators}}:','Pre-clean equipment, if heavily soiled, to ensure proper surface contact. Prepare a use solution by adding 0.6 oz. of this product per gal. of water {{EquivalentDilution}} {{450PPM}}. Gently mix for uniform use solution. Apply use solution to surfaces of the respirator with a sponge, brush, cloth, mop, {{Immersion}}, {{AutoScrubber}}, {{CleaningEquipment}} Rub with brush, cloth, or sponge. Treated surfaces must remain wet for 10 minutes. Remove excess solution from equipment prior to storage. The user must comply with all OSHA regulations for cleaning respiratory protection equipment (29 CFR § 1910.134).  Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,1,NULL,NULL),(65,'GENERAL DISINFECTION',NULL,'GENERAL DISINFECTION','FOR USE AS A CLEANER/GENERAL DISINFECTANT {{KILL}} ON HARD, NON-POROUS SURFACES: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,2,NULL,NULL),(66,'SANITIZING',NULL,'FOOD CONTACT {{TobaccoEquipment}} SANITIZING DIRECTIONS  ','Prior to application, remove gross food particles and soil by a pre-flush or pre-scrape and when necessary, presoak. Then thoroughly wash or flush objects with a good detergent or compatible cleaner, followed by a potable water rinse before applications of the sanitizing solution.  ',NULL,NULL,NULL,NULL,'This statement must appear with any of the Food Contact Sanitizing claims unless already included in the use instructions.',NULL,NULL,NULL,1,3,NULL,NULL),(67,'SANITIZING DILUTION',NULL,'FOOD CONTACT SANITIZING DILUTION TABLE {{FoodContactSurfaces}}:','To prepare a 150, 200, 300 or 400 ppm active solution use the following dilution table. Prepare the correct dilution rate based upon the appropriate use site.  ',NULL,NULL,NULL,NULL,'On the final printed label either the dilution table and/or one of the dilution rates (or equivalent use dilution) will be used. If the dilution table is used then the 150  400 ppm dilution instruction will be used.',NULL,NULL,NULL,2,3,NULL,NULL),(68,'SANITIZE FOOD CONTACT SURFACES',NULL,NULL,'{{FoodContactSurfaces}}',NULL,NULL,NULL,NULL,'One of the following two headers will be used.',NULL,NULL,NULL,3,3,NULL,NULL),(69,'U.S. PUBLIC HEALTH SERVICE FOOD SERVICE',NULL,'U.S. PUBLIC HEALTH SERVICE FOOD SERVICE SANITIZATION RECOMMENDATIONS CLEANING AND SANITIZING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,3,NULL,NULL),(70,'WISCONSIN STATE DIVISION OF HEALTH',NULL,'{{WisconsinHealth}} DIRECTIONS FOR EATING ESTABLISHMENTS ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,3,NULL,NULL),(71,'CLOSED LOOP SANITIZING',NULL,'CLOSED LOOP {{Circulation}} SANITIZING {{FoodProcessing}}: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,3,NULL,NULL),(72,'CLEAN-IN-PLACE METHOD ',NULL,'CLEAN-IN-PLACE (CIP) METHOD {{For}} {{Dairy}}, {{DairyFarm}} {{And}} {{FoodProcessing}}: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,3,NULL,NULL),(73,'SANITIZING FOOD PROCESSING EQUIPMENT',NULL,'SANITIZING OF {{Refrigerated}} FOOD PROCESSING EQUIPMENT AND OTHER HARD, NON-POROUS SURFACES IN FOOD CONTACT LOCATIONS: ','For sanitizing {{NonPorousSurfaces}} hard, non-porous food contact surfaces, surfaces must be thoroughly pre-flushed or pre-scraped and, when necessary, presoaked to remove gross food particles.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,3,NULL,NULL),(74,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES',NULL,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES OF {{InteriorNonPorousSurfaces}}','',NULL,NULL,NULL,NULL,' Must choose appropriate instructions below.','Y',NULL,NULL,9,3,NULL,NULL),(77,'BEVERAGE DISPENSING AND SANITARY FILLING EQUIPMENT',NULL,'BEVERAGE DISPENSING AND SANITARY FILLING EQUIPMENT SANITIZER DIRECTIONS:','For sanitizing hard, non-porous bottling or pre-mix dispensing equipment and bottles or cans in the final rinse application. This product is {{ProportionedExteriorApplication}}. Fill equipment with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product. Surfaces must remain wet for at least 1 minute or until operations resume at which time the sanitizing solution must be drained from the system. Allow sanitized surfaces to adequately drain {{AirDry}} before contact with liquid. Do not rinse.   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,3,NULL,NULL),(78,'BEER FERMENTATION',NULL,'{{BeerFermentation}} STORAGE TANK SANITIZER DIRECTIONS: ','For sanitizing hard, non-porous beer fermentation and holding tanks, wine, citrus and food processing storage and holding tanks. Prepare a solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product for mechanical or automated systems. {{ManufacturersDirections}} Surfaces must remain wet for at least 1 minute. Allow sanitized surfaces to adequately drain before contact with {{FoodLiquid}}. Do not rinse. For mechanical operations or automated systems, the used sanitizing solution must not be reused for sanitizing, but can be reused for other purposes such as cleaning.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,3,NULL,NULL),(80,'DILUTION TABLE',NULL,'{{#DILUTION TABLE}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,6,NULL,NULL),(81,'WATER SOFTENERS AND REVERSE OSMOSIS (RO) UNITS',NULL,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES OF WATER SOFTENERS AND REVERSE OSMOSIS (RO) UNITS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,3,NULL,NULL),(82,'SANITIZING EGG SHELLS',NULL,'SANITIZING EGG SHELLS INTENDED FOR FOOD DIRECTIONS: ','To sanitize previously cleaned food-grade eggs in shell egg and egg product processing plants, spray with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product. The solution must be warmer than the eggs, but not to exceed 130°F. Wet eggs thoroughly and allow solution to drain. Eggs sanitized with this product must be subjected to a potable water rinse only if they are to be broken immediately for use in the manufacture of egg products. Eggs must be reasonably dry before casing or breaking. The solution must not be re-used for sanitizing eggs. Note: Only clean, whole eggs can be sanitized. Dirty, cracked or punctured eggs cannot be sanitized. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,3,NULL,NULL),(83,'TREATMENT OF CONVEYOR BELTS',NULL,'FOR TREATMENT OF [{{MEAT}} {{And}} {{POULTRY}} {{Or}} {{FRUITVEGETABLE}}] {{CONVEYORS_BELTS}}: ','Remove gross food particles and excess soil by a pre-flush or pre-scrape. Wash with a good detergent or compatible cleaner. Rinse equipment thoroughly with potable water and then rinse equipment with a sanitizing solution. During processing apply {{#AppropriateDilution}} {{EquivalentDilution}} of this product to conveyors with suitable feeding equipment. Do not allow this solution to be sprayed directly on food. Controlled volumes of sanitizer are applied to return portion of conveyor through nozzles so located as to permit maximum drainage of sanitizer from equipment and to prevent puddles on top of belt. During interruptions in operation, apply solution using coarse spray equipment to peelers, collators, slicers and saws, and other non-porous conveyor equipment. Allow surfaces to remain wet for at least 1 minute. Conveyors and other equipment must be free of product when applying this coarse spray.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,14,3,NULL,NULL),(84,'GLOVE DIP',NULL,'GLOVE DIP SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animal areas and the packaging and storage areas of food plants, dip or soak pre-washed {{PlasticRubber}} non-porous gloved hands in a suitable clean container that contains enough freshly made sanitizing solution to cover the gloved hand area. Do not let sanitizing solution come into contact with exposed skin. Gloved hands must remain wet for at least 1 minute. Do Not Rinse. Prepare sanitizing solution by adding {{#AppropriateDilution}} {{EquivalentDilution}}. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,3,NULL,NULL),(85,'GLOVE SPRAY',NULL,'GLOVE SPRAY SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animals areas and the packaging and storage areas of food plants, spray pre-washed {{PlasticRubber}} gloves thoroughly to ensure sanitizing solution covers the exterior surfaces of the gloves prior to {{UsageWearing}} using a coarse spray device. Do not let sanitizing solution come into contact with exposed skin. After applying solution, allow gloves to remain wet for at least 1 minute. Let air dry thoroughly before wearing gloves. Do not rinse. Prepare sanitizing solution by adding (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}}. Prepare a fresh solution daily.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,3,NULL,NULL),(86,'GLOVE DIP/SPRAY',NULL,'GLOVE DIP/SPRAY SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animals areas and the packaging and storage areas of food plants, dip, soak or spray pre-washed {{PlasticSynthetic}} gloves thoroughly to ensure sanitizing solution covers the exterior surfaces of the gloves prior to {{UsageWearing}}.  For spray applications, use a coarse spray device. Do not let sanitizing solution come into contact with exposed skin. After applying solution, allow gloves to remain wet for at least 1 minute. Let air dry thoroughly before wearing gloves. Do not rinse. Prepare sanitizing solution by adding {{#AppropriateDilution}} {{EquivalentDilution}}. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,17,3,NULL,NULL),(87,'NON-FOOD CONTACT SANITIZING DIRECTIONS',NULL,'NON-FOOD CONTACT SANITIZING DIRECTIONS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,3,NULL,NULL),(89,'NON-FOOD CONTACT SANITIZING',NULL,'NON-FOOD CONTACT SANITIZING:','Pre-clean heavily soiled surfaces. Add {{OneOzPacket}} of this product per 5 gal. of water {{150PPM}} {{EquivalentDilution}}. Apply solution to hard, non-porous surfaces with a sponge, brush, cloth, mop, {{ByImmersion}}, {{AutoScrubber}}, {{SprayDevices}}. Treated surfaces must remain wet for 3 minutes. Prepare a fresh solution daily or when visibly dirty.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,3,NULL,NULL),(90,'ULTRASONIC BATH',NULL,'ULTRASONIC BATH SANITIZER DIRECTIONS: ','Pre-clean heavily soiled surfaces. Use this product to sanitize hard, non-porous, noncritical objects compatible with Ultrasonic cleaning units. Prepare a use solution of {{OneOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}} directly into bath chamber. Place objects into unit and operate for a minimum of 3 minutes, {{ManufacturersDirections}}. Remove objects and rinse with {{Sterile}} water. {{AirDry}} Prepare a fresh solution daily or when visibly dirty.  ','This product in its use solution is compatible with stainless steel, aluminum and most other hard, non-porous surfaces. Before product use, it is recommended that you apply product to a smaller test area to determine compatibility before proceeding with its use.',NULL,NULL,NULL,'',NULL,NULL,NULL,20,3,NULL,NULL),(92,'PERSONAL PROTECTIVE EQUIPMENT',NULL,'SANITIZATION OF HARD, NON-POROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT {{RESPIRATORS}}:','Add {{OneOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}}.  Gently mix for uniform solution. Apply solution to surfaces of the respirator with a sponge, brush, cloth, mop, {{ByImmersion}}, {{AutoScrubber}}, {{SprayDevices}} Thoroughly wet all surfaces to be sanitized. Treated surfaces must remain wet for 3 minutes. Remove excess solution from equipment prior to storage. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,3,NULL,NULL),(93,'SHOE/BOOT',NULL,'{{SHOE/BOOT}} {{BATH}} SANITIZER DIRECTIONS: ','To prevent cross contamination {{FromAreas}} shoe baths containing one inch of freshly made sanitizing solution must be placed at all entrances to buildings, hatcheries and at all the entrances to the production and packaging rooms. Scrape waterproof shoes and place in a 1 oz. of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}} use solution {{AllowToRemainWet}} for 3 minutes prior to entering area. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,23,3,NULL,NULL),(95,'FOOT DIP',NULL,'FOR FOOT DIP OF WATER PROOF FOOTWEAR: ','Use this product at 1 oz. per 5 gal. of water in foot dip tray. Shoe baths must contain at least 1 inch of freshly made solution and be placed at the entrances to buildings. Scrape shoes and place in diluted solution {{AllowToRemainWet}} for 3 minutes before entering building. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,24,3,NULL,NULL),(96,'SHOE FOAM',NULL,'SHOE FOAM DIRECTIONS:','To prevent cross contamination {{FromAreas}}apply a foam layer approximately 0.5 to 2 inches thick made from a solution of 1 to 1.5 oz. of this product per gal. of water {{EquivalentDilution}} {{800-1200PPM}} at all entrances to buildings, hatcheries, production and packaging rooms by using a foam generating machine or aerator to apply foam layer. Follow the foaming directions as specified by the manufacturer of the foam generator/aerator. Scrape waterproof shoes. Stand and/or walk through foamed area {{AllowToRemainWet}} for 3 minutes prior to entering area. Foam area must be washed and replaced daily or when it appears visibly soiled or dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,25,3,NULL,NULL),(97,'SHOE SPRAY',NULL,'SHOE SPRAY SANITIZING DIRECTIONS: ','For heavily soiled {{WorkWear}}, {{ScrapeWipe}} with brush, sponge or cloth or Neat Feet Clean Solution Welcome Mat to remove excess dirt.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,26,3,NULL,NULL),(98,'ENTRYWAY',NULL,'ENTRYWAY SANITIZING SYSTEMS: ','To prevent cross contamination from area to area, set the system to deliver 1.25  2.5 oz. of this product per 2.5 gal. of water {{EquivalentDilution}} {{400-800PPM}} of sanitizing solution. The {{SprayFoam}} must cover the entire path of the doorway. Set the system so that a continuous wet blanket of sanitizer solution is delivered to the floor.','Do not mix other foam additives with the sanitizing solution.',NULL,NULL,NULL,'(For food processing or other facilities that have installed entryway sanitizing systems.)',NULL,NULL,NULL,26,3,NULL,NULL),(99,'MOLD/MILDEW',NULL,'MOLD/MILDEW {{MILDEWSTATICACTIVITY}}: ','{{ControlMoldMildew}} {{ControlsPrevents}} {{AspergillusNiger}} {{ATCC6275}} {{OdorsCausedByApplication}} Prepare use solution by adding 3 oz. of this product per 5 gal. of water {{0.6OzProduct}} {{EquivalentDilution}}.  Apply use solution to hard, non-porous surfaces for 10 minutes which will effectively inhibit the growth of mold and mildew and their odors.  Repeat treatment every seven days, or more often if new growth appears.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL),(100,'ATHLETIC EQUIPMENT MOLD AND MILDEW',NULL,'TO CONTROL THE GROWTH OF MOLD AND MILDEW ON NON-POROUS ATHLETIC EQUIPMENT:  ','For use on wrestling and gymnastic mats, athletic mats, exercise equipment, athletic training tables, physical therapy tables, athletic helmets, wrestling/boxing headgear, athletic shoe soles, and other hard, non-porous surfaces. Saturate surfaces with a use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}.  Apply by sponge, brush, cloth, mop, {{Immersion}}, {{SprayDevices}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.  Allow surfaces to remain wet for a period of 10 minutes. Do not use equipment until treatment has been absorbed, set or dried.  Repeat treatment every seven days, or more often if new growth appears. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,4,NULL,NULL),(101,'PLASTIC AND RUBBER STRUCTURES',NULL,'TO CONTROL THE GROWTH OF MOLD AND MILDEW ON LARGE, INFLATABLE, NON-POROUS PLASTIC AND RUBBER STRUCTURES:','For use on nonporous plastic and rubber surfaces such as inflatable animals, promotional items, moonwalks, slides, obstacle course play and exercise equipment. Thoroughly clean all surfaces with soap or detergent and rinse with water. Apply a use solution of {{ThreeOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} by sponge, brush, cloth, mop, {{SprayDevices}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.  Allow surfaces to remain wet for a period of 10 minutes. Do not use equipment until treatment has dried. Repeat treatment every seven days, or more often if new growth appears. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,4,NULL,NULL),(102,'HUMIDIFIER BACTERIA/ALGAE',NULL,'HUMIDIFIER BACTERIA/ALGAE TREATMENT (Not for use in CA):','Formulated for use in portable {{Evaporative}} humidifiers. Thoroughly clean the hard, non-porous surfaces of the water tank and filters before each heating season, or sooner if necessary. For every gallon of water in the humidifier tank, add 0.2 ounce of this product (or equivalent use dilution). When you refill the tank, add 0.2 oz. of this product for every gallon of water added in the tank {{EquivalentDilution}}. {{RinseWipeAirDry}}.','Not for use in heat vaporizing or atomizing type vaporizer humidifiers. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,4,NULL,NULL),(103,'Prior To Use',NULL,NULL,'Prior to use of this product, remove all animals {{Poultry}} and feeds from {{{PremisesAreas}}, animal transportation vehicles {{Trucks,Cars}}, and enclosures {{Coops,Crates,Kennels,Stables}}. Remove all litter, droppings and manure from floors, walls and surfaces of barns, pens, stalls, chutes and other surfaces of facilities and fixtures occupied or traversed by animals. Empty all troughs, racks and other feeding and watering appliances. Thoroughly clean surfaces with soap or detergent and rinse with water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,5,NULL,NULL),(104,'ANIMAL PREMISE DISINFECTANT/VIRUCIDE*',NULL,'FOR USE AS AN ANIMAL PREMISE DISINFECTANT/VIRUCIDE*: ','Apply a use solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} to disinfect hard, non-porous surfaces with a sponge, brush, cloth, {by immersion}, {mechanical spray device,} {{hand pump} coarse pump or trigger spray device}. Immerse all halters and other types of equipment used in handling and restraining animals, as well as forks, shovels, and scrapers used for removing litter and manure in the use solution. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Treated surfaces must remain wet for 10 minutes. Ventilate buildings, coops and other closed spaces. Do not house [{animals} {poultry} {livestock}] or employ equipment until treatment has been absorbed, set or dried. Thoroughly scrub all treated feed racks, troughs, automatic feeders, fountains and waterers and other treated equipment which can contact food or water with soap or detergent, and rinse with potable water before reuse.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,5,NULL,NULL),(105,'HATCHERIES',NULL,'HATCHERIES:','Use to treat hatchers, setters, trays, racks, carts, sexing tables, delivery trucks and other hard surfaces. Use 3 oz. of this product per 5 gal. of water. Leave all treated surfaces wet for 10 minutes or more. Allow to air dry. VEHICLES: Clean all vehicles including mats, crates, cabs, and wheels with water and this product. Use 3 oz. of this product per 5 gal. of water. Apply use solution to treat all vehicles. Leave treated surfaces wet for 10 minutes or more. Allow to air dry.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,5,NULL,NULL),(106,'DRESSING/RENDERING PLANT',NULL,'DRESSING {/RENDERING} PLANT:','Disinfect equipment, utensils, walls and floors in poultry and animal dressing plants. Disinfect offal rooms, exterior walls and loading platforms of dressing plants. Cover or remove all food and packaging materials. Remove all heavy soils prior to application. Saturate all surfaces with a solution of [{3 oz. of this product per 5 gal. of water} {(or equivalent use dilution)} and scrub to loosen all soils. Surfaces must remain wet for 10 minutes, and then be thoroughly rinsed with potable water before operations are resumed. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,5,NULL,NULL),(107,'TERRARIUM AND SMALL ANIMAL CAGE',NULL,'TERRARIUM AND SMALL ANIMAL CAGE AND CAGE FURNITURE DISINFECTION:','{Animals frequently defecate on hot rocks and other hard, non-porous cage furniture items inside your terrarium. This can result in high bacteria and ammonia levels that can lead to possible infection/disease in your animals. When used regularly, this product can eliminate these high bacteria/ammonia levels in your cage and on your cage furniture items.} (Do not use on porous rocks, hot rocks, and driftwood.)  ','Note: Substrates for desert terrariums (i.e. gravel) must be completely dry before returning to terrarium to avoid high humidity levels. Always replace substrate if a foul odor persists. Do not apply this product directly onto the small animal. If this product comes into contact with the small animals skin, then immediately wash the material off of the animal with lukewarm water. If the small animal ingests this product, contact your veterinarian immediately. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,5,NULL,NULL),(109,'REPTILE TANK',NULL,'REPTILE TANK CLEANING AND DISINFECTION DIRECTIONS:  ','Remove all reptiles from the [{enclosure} {tank}] prior to cleaning and disinfecting. Remove all litter or drippings from surfaces. Empty all equipment used for feeding or watering reptiles. Thoroughly clean all surfaces with soap or detergent and rinse with water.  Apply disinfecting and virucidal* solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} {(450 ppm active)} {to hard, non-porous surfaces of the enclosure {tank}}. Apply by cloth, mop, brush, sponge, auto scrubber, mechanical spray device, {{hand pump} coarse pump or trigger spray device} or by immersion until thoroughly wet. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Allow surfaces to remain wet for 10 minutes. Wipe dry {with a paper towel}. Rinse all surfaces that come in contact with food with potable water before reuse. Allow the enclosure {tank} to ventilate for a minimum of 10-15 minutes before replacing the reptiles. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,'Do not apply this product directly onto the reptile. If this product comes into contact with the reptiles skin, then immediately wash the material off of the animal with lukewarm water. If the reptile ingests this product, contact your veterinarian immediately',NULL,NULL,NULL,7,5,NULL,NULL),(110,' NON-FOOD CONTACT SURFACES IN ANIMAL PREMISES',NULL,'SANITIZER DIRECTIONS FOR NON-FOOD CONTACT SURFACES IN ANIMAL PREMISES ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,5,NULL,NULL),(111,'HOOF TRIMMING EQUIPMENT',NULL,'TO SANITIZE HOOF TRIMMING EQUIPMENT:  ','Prior to application, pre-clean hoof trimming equipment before and after use on each animal with detergent and warm water or compatible cleaner to remove soil using a pre-scrape, pre-flush, or when necessary, pre-soak followed by a potable water rinse. To sanitize, add Add {{OneOzPacket}} of this product per 5 gal. of water {{150PPM}} {{EquivalentDilution}}. Treated surfaces must remain wet for 3 minutes. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,5,NULL,NULL),(112,'FOGGING FOOD PREMISES',NULL,'{{FoggingFoodPremises}} ','ALL SURFACES MUST BE CLEANED AND DISINFECTED IN ACCORDANCE WITH LABEL DIRECTIONS PRIOR TO FOGGING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,6,NULL,NULL),(113,'DAIRIES, BEVERAGE AND FOOD PROCESSING PLANTS',NULL,'DIRECTIONS FOR FOGGING IN DAIRIES, BEVERAGE AND FOOD PROCESSING PLANTS:','Prior to fogging, food products and packaging material must be removed from the room or carefully protected. After disinfecting, fog desired areas using 1 quart per 1000 cubic feet of room area with a solution containing 1.5 oz. of product per gal. of water {(1,200 ppm active)} {(or equivalent use dilution)}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Vacate the area of all personnel during fogging and for a minimum of 2 hours after fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. All food contact surfaces must be sanitized with an EPA approved food contact sanitizer solution prior to use.  All food contact surfaces must be thoroughly rinsed with potable water prior to sanitizing.','Note:  The fog generated is irritating to the eyes, skin and mucous membranes. Under no circumstances must a room or building be entered by anyone within two hours of the actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. If the building must be entered, then the individuals entering the building must wear a self-contained respirator approved by NIOSH/MSHA, goggles, long sleeves and long pants.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,6,NULL,NULL),(114,'FOGGING POULTRY HOUSES',NULL,'{{FoggingPoultryHouses}}','ALL SURFACES MUST BE CLEANED AND DISINFECTED IN ACCORDANCE WITH LABEL DIRECTIONS PRIOR TO FOGGING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,6,NULL,NULL),(115,' HATCHERY ROOMS',NULL,'TREATMENT OF HATCHERY ROOMS USING FOGGING DEVICES: ','Remove all animals and feed from premises, vehicles and enclosures. Remove all litter and manure from floors, walls and surfaces of the room to be treated. Empty all troughs, racks and other feeding and watering appliances. Thoroughly clean all surfaces with soap or detergent and rinse with water. Close room off so fog is confined to room to be treated. Mix 140 oz. of this product per 2.5 gal. of water {{EquivalentDilution}}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Insert the nozzle of the fogger through a suitable opening into the room. With the setting in maximum output, fog for one minute for each 4000 cubic feet of space in the room. Under no circumstances will a room be entered by anyone within 2 hours of actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. When fogging is completed ventilate buildings and other closed spaces. Do not house {{Livestock}} or employ equipment until treatment has been absorbed or dried. Thoroughly clean all treated surfaces with soap or detergent and rinse with water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,6,NULL,NULL),(116,'INCUBATORS AND HATCHERS',NULL,'TREATMENT OF INCUBATORS AND HATCHERS USING FOGGING DEVICES: ','Only for treatment of setters and hatchers after poultry/chicks/eggs have been removed. Not for treatment of hatchers which contain chicks/eggs. Mix 14.5 oz. of this product per gal. of water {(or equivalent use dilution)}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Fog 3-8 oz. of this into setters and hatchers immediately after transfer. Repeat daily in setters and every 12 hours in hatchers. Discontinue hatcher treatments at least 24 hours prior to pulling the hatch. Do not allow people to contact or breathe this fog. It is acceptable to fog setters and hatchers with a 1.1 oz. of this product per gal. of water solution {(or equivalent use dilution)} on an hourly or every other hour basis. If this is done, fog for 30-90 seconds once per hour or once every two hours. When fogging is complete, ventilate buildings, and other closed spaces. Do not house livestock or employ equipment until treatment has been absorbed or dried. Thoroughly scrub all treated feed racks, mangers, troughs, automatic feeders, fountains and waterers, and other treated equipment with soap or detergent, and rinse with potable water before reuse. Under no circumstances will a room be entered by anyone within two hours of the actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility.  ','Note:  The fog generated is irritating to the eyes, skin and mucous membranes. Under no circumstances must a room or building be entered by anyone within two hours of the actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. If the building must be entered, then the individuals entering the building must wear a self-contained respirator approved by NIOSH/MSHA, goggles, long sleeves and long pants.',NULL,NULL,NULL,'The following statement must be used with either of the previous two fogging directions for use.',NULL,NULL,NULL,5,6,NULL,NULL),(117,'GROOMING IMPLEMENTS',NULL,'FOR USE AS A DISINFECTANT, VIRUCIDE* OF GROOMING CLIPPERS, HAIR CLIPPERS, ELECTRIC SHEARS, BARBER/SALON SHEERS AND OTHER IMPLEMENTS {{InstrumentsTools}}:','{{RemoveParticles}} Immerse pre-cleaned barber/salon tools such as combs, brushes, {{PlasticRollers}} razors, {{ClipperTrimmerBlades}}, {{Tweezers}} manicure/pedicure tools, scissors, and other salon instruments and tools in a use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} for at least 10 minutes. Rinse thoroughly and dry before use. Prepare a fresh solution daily or when visibly dirty. ','Note: Plastic instruments can remain immersed until ready to use. Stainless steel shears and other metal instruments must be removed after 10 minutes, rinsed, dried and kept in a clean, non-contaminated receptacle. Prolonged soaking will cause damage to metal instruments.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,7,NULL,NULL),(118,'FOOTBATHS',NULL,'FOR USE AS A DISINFECTANT, VIRUCIDE* OF HARD, NON-POROUS SURFACES IN FOOTBATHS:','To remove body oils, dead tissue, soil and all other buildups or organic matter on surfaces after using the footbath, drain the water and thoroughly clean all surfaces with soap or detergent, then rinse with water. Apply a use solution of 3 oz. of this product per 5 gal. of water  {(or equivalent use dilution)} on all surfaces with a brush, cloth, mop, sponge, {{PumpSpray}}. Brush or swab thoroughly and allow solution to stand for 10 minutes. For spray applications, spray 6-8 inches from surface. Do not breathe spray. After the unit has been thoroughly disinfected, rinse all surfaces with fresh water. The unit is then ready for reuse.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,7,NULL,NULL),(119,'BARBER/SALON NON-FOOD CONTACT SURFACES',NULL,'SANITIZER DIRECTIONS FOR NON-FOOD CONTACT SURFACES IN BARBER/SALON FACILITIES  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,7,NULL,NULL),(120,'BARBER/SALON INSTRUMENTS AND TOOLS',NULL,'TO SANITIZE [{BARBER} {MANICURE} {NAIL} {SALON}] INSTRUMENTS AND TOOLS:','Immerse pre-cleaned barber/salon instruments and tools {{InstrumentsTools}} in a use-solution of 1 oz. of this product per 5 gal. of water {{EquivalentDilution}} for at least 3 minutes. Rinse thoroughly and dry before use. Prepare a fresh solution daily or when visibly dirty. ','Note: Plastic instruments can remain immersed until ready to use. Stainless steel shears and other metal instruments must be removed after 10 minutes, rinsed, dried, and kept in a clean non-contaminated receptacle. Prolonged soaking will cause damage to metal instruments.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,7,NULL,NULL),(121,'TOILET BOWL AND URINAL DISINFECTANT/CLEANING',NULL,'NON-ACID TOILET BOWL {{Urinal}} DISINFECTANT {{Cleaning}} DIRECTIONS ','Remove heavy soil prior to disinfection.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL),(122,'HEAVY DUTY CLEANING OF TOILET BOWLS AND URNINALS',NULL,'FOR HEAVY DUTY CLEANING OF TOILET BOWLS AND URNINALS: ','Pre-clean heavily soiled areas. Empty toilet bowl or urinal and apply 1.2 oz. of this product to exposed surfaces including under the rim with toilet {{BrushMop}}, cloth, or sponge, or mechanical spray device, {{SprayDevices}}. To aid in soil removal, allow to soak. For sprayer application, spray 6-8 inches from surface. Brush or swab thoroughly and allow solution to stand for 10 minutes and flush.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,8,NULL,NULL),(123,'DEEP CLEANING URINALS',NULL,'{{Deep}} CLEANING/DISINFECTING {{Waterless}} URINALS: ','Preliminary cleaning is required for heavily soiled surfaces. Remove and properly dispose of cartridge according to manufacturers directions. Deep clean or disinfect the entire urinal by applying 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} directly onto surface. {{BrushScrub}} surfaces and let solution stand for 10 minutes. Wipe surface to clean. Change cartridge as needed. The unit is ready for use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,8,NULL,NULL),(124,'CLEAN WATERLESS URINALS',NULL,'TO CLEAN WATERFREE {{Waterless}} URINALS: ','Remove any debris from the urinal. Spray 0.5 to 1 oz. of use solution onto urinal surface. To prepare use solution: add 0.6 oz. of this product per gal. of water {{EquivalentDilution}} {{450PPM}}. DO NOT spray product directly onto cartridge. Wipe surface to clean. Change cartridge as needed. The unit is ready for use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,8,NULL,NULL),(125,'CLEAN OPEN AREAS WITH FLOOR DRAINS',NULL,'FOR USE TO CLEAN AND DISINFECT SHOWER ROOMS, LOCKER ROOMS AND OTHER LARGE, OPEN AREAS WITH FLOOR DRAINS:  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,8,NULL,NULL),(126,'GENERAL CLEANER/DEODORIZER',NULL,'FOR USE AS A {GENERAL} CLEANER {AND/OR DEODORIZER}: ','Apply use solution of 1.75 oz. of this product per 5 gal. of water to hard, non-porous surfaces. {{RinseWipeAirDry}}. For heavy-duty use, {{AddMix}} 4 oz. of this product per 5 gal. to clean hard, non-porous surfaces. ','Not for use in heat vaporizing or atomizing type vaporizer humidifiers. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL),(127,'GENERAL DEODORIZER',NULL,'GENERAL DEODORIZATION','To deodorize, apply 1.75 oz. of this product per 5 gal. of water to hard, non-porous surfaces. {{RinseWipeAirDry}}. ','Not for use in heat vaporizing or atomizing type vaporizer humidifiers. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,9,NULL,NULL),(128,'SEPTIC STORAGE TANKS',NULL,'FOR DEODORIZING SEPTIC STORAGE TANKS: ','Pre-clean heavily soiled areas. When tanks are empty, pour 1.75 oz. of this product for every 5 gal. of water in tank on recreational vehicles, campers and boats to control odors. As tank fills with sewage and the vehicle is moving, this solution will mix and provide an adequate deodorizing solution for this use. This product is to be used on gray and black water tanks only. Check with local, state, or federal authorities before disposing of sewage in accordance to federal, state and local regulations for waste disposal. (Not for use in CA.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,9,NULL,NULL),(129,'RV HOLDING TANKS',NULL,'RV HOLDING TANKS/RECREATIONAL VEHICLES: ','For toilet waste and holding tanks, cover bottom of holding tank with water and add 1.75 to 3 oz. of this product per 5 gal. of water to deodorize. If odors return before time to empty, add another 1.75 to 3 oz. per 5 gal. of water to the tank. For kitchen waste, add 1.75 to 3 oz. per 5 gal. of water to gray water tank as needed to control malodors created by dirty dishwater. (Not for use in CA.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,9,NULL,NULL),(130,'AUTOMOTIVE',NULL,'AUTOMOTIVE USES: ','A solution of 1.75 oz. of this product per 5 gal. of water will effectively neutralize {{DampMusty}} odors. Spray or apply onto seats, carpets, headliner and ashtray or into trunk and all vents to eliminate odors from tobacco, food, beverage spills and musty carpet. For sprayer applications, use a coarse spray device. {{WipeAirDry}}.  (Not for use in CA.)','Not for use in heat vaporizing or atomizing type vaporizer humidifiers. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,9,NULL,NULL),(131,'AIR FRESHENER',NULL,'AIR FRESHENER: ','A solution of 1.75 oz. of this product per 5 gal. of water will effectively neutralize {{DampMusty}} odors caused by mildew in storage areas, basements, closets, bathrooms and A/C filters. Spray to eliminate odors from tobacco, food, beverage spills and musty carpet. For sprayer applications, use a coarse spray device. {{WipeAirDry}}.  (Not for use in CA.)','Not for use in heat vaporizing or atomizing type vaporizer humidifiers. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,9,NULL,NULL),(132,'WATERBED CONDITIONER',NULL,'WATERBED CONDITIONER (Not for use in CA.): ','When used as a waterbed conditioner, this product eliminates odor. If bed has not been treated properly, drain bed completely. Add 15 gal. of water, mix vigorously, drain bed again. Fill bed with water and follow dosage directions. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,9,NULL,NULL),(133,'GLASS CLEANING',NULL,'GLASS CLEANING {{Deodorizing}} DIRECTIONS:','Use a 1.75 oz. of this product per 5 gal. of water use solution to clean and deodorize windows, mirrors, and glass surfaces. Use a coarse spray device. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Rub with sponge or cloth. Change cloth, sponge or towels frequently to avoid re-deposition of soil. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,9,NULL,NULL),(134,'FINISHED FLOORS',NULL,'FOR USE AS A CLEANER ON FINISHED FLOORS:  ','To limit gloss reduction, use 1.75 oz. of this product per 5 gal. of water. Apply with a damp mop or auto scrubber. Allow surface to air dry. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,9,NULL,NULL),(135,'CARPET CLEANING',NULL,'CARPET CLEANING',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,9,NULL,NULL),(136,'SPECIAL CARPET CLEANING',NULL,'SPECIAL INSTRUCTIONS FOR CLEANING CARPETS: ','This product can be used to clean carpets in industrial, institutional, commercial and residential areas such as homes, motel & hotel chains, nursing homes, schools and hospitals. For use on wet, cleanable synthetic fibers. Do not use on wool. Vacuum carpet thoroughly prior to cleaning. Test fabric for color fastness. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,9,NULL,NULL),(137,'Portable Extraction Units',NULL,'For Portable Extraction Units: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}}.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,9,NULL,NULL),(138,'Truck Mounted Extraction Machines',NULL,'For Truck Mounted Extraction Machines: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}} and meter at 5 gal. per hour',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,9,NULL,NULL),(139,'Rotary Floor Machines',NULL,'For Rotary Floor Machines: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}} and apply at the rate of 300-500 sq. ft. per 1 gal. ','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,14,9,NULL,NULL),(140,'Do not mix',NULL,NULL,'Do not mix this product with other cleaning products. Follow the cleaning procedures specified by the manufacturer of the cleaning equipment. After using this product set the carpet pile and protect the carpet from furniture legs and bases while drying. Do not over wet. If applied to stain resistant nylon carpet, apply a fabric protector according to the carpet manufacturers directions.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,9,NULL,NULL),(141,'CARPET HOME',NULL,'CARPET {{Cleaning/Deodorizing}} FOR HOME, INSTITUTIONAL, INDUSTRIAL AND HOSPITAL USE: ','This product {{CleansDeodorizes}} the carpet. It can be used in industrial, institutional, commercial and residential areas such as homes, motels, hotel chains, nursing homes and hospitals. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,9,NULL,NULL),(142,'Vacuum carpet thoroughly',NULL,NULL,'Vacuum carpet thoroughly prior to application. Mix 1.1 oz. per gal. of water {{EquivalentDilution}}. Follow the injection and/or extraction procedures as specified for any conventional steam cleaning equipment you are using. For rotary floor machines, mix 1.1 oz. of this product per gal. of water and spray on carpet at a rate of 300-500 sq. ft. per 1 gal.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,17,9,NULL,NULL),(143,'Washable synthetic fibers',NULL,NULL,'{{Use}} on washable synthetic fibers. Do not use on wool. Test color fastness of carpet before use. Apply diluted product to a small concealed spot, then rub with a clean white cloth. If color changes or transfers to the cloth, a water-based product must not be used. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,9,NULL,NULL),(144,'After using',NULL,NULL,'After using the product, set carpet pile in one direction with a stiff brush. Place aluminum foil under the legs of furniture while carpet is drying. Over-wetting can cause carpet to shrink. Manufacturer assumes no responsibility for over-wetting misuse. ','Note: This product must not be mixed with other cleaning products',NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,9,NULL,NULL),(145,'SEWER BACKUP & RIVER FLOODING',NULL,'SEWER BACKUP & RIVER FLOODING: ','To use as a deodorizer, dilute 1.1 to 2.2 oz. of this product per gal. of water allowing for the diluting effect of absorbed water within saturated materials. Remove gross filth or heavy soil along with non-salvageable materials. Saturate all affected areas with a mechanical spray device, {{CoarsePumpTriggerSprayDevice}} before and after cleaning and extraction. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Use proper ventilation; open windows. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,10,NULL,NULL),(146,'POROUS MATERIALS',NULL,'CARPETS, CARPET CUSHIONS, UPHOLSTERY, DRAPES AND OTHER POROUS MATERIALS, SUB FLOORS, DRYWALL, TRIM AND FRAME LUMBER, TACKLESS STRIP AND PANELING: ','To use as a deodorizer against water damage, extract the excess water. Test hidden area for colorfastness. Dilute 1.1 to 2.2 oz. of this product per gal. of water, allowing for the diluting effect of absorbed water within saturated materials. Remove gross filth or heavy soil. Apply directly with a mechanical spray device {or coarse pump or trigger spray device} to fully saturate affected materials. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Roll, brush or agitate into materials. Follow with a thorough extraction. Dry rapidly and thoroughly. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,10,NULL,NULL),(147,'WATER/SMOKE DAMAGE',NULL,'{{WaterSmoke}} DAMAGE RESTORATION: ','Effective against odor caused by smoke and water damage for home, institutional, industrial and hospital use. This product is particularly suitable for use in water damage restoration. Dilute 1.1 to 2.2 oz. of this product per gal. of water, allowing for the diluting effect of absorbed water within saturated materials. Saturate affected materials with enough product to remain wet for at least 10 minutes. Use proper ventilation. (Not for use in CA.)   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,10,NULL,NULL),(149,'DROSOPHILA SPP. AND PHORIDAE FAMILY OF FLIES',NULL,'FOR CONTROL OF DROSOPHILA SPP. AND PHORIDAE FAMILY OF FLIES ON NON-FOOD CONTACT SURFACES: ','To control flies on hard, non-porous non-food contact surfaces such as floors, walls, countertops, metal surfaces, painted surfaces, glazed porcelain, glazed tile, glass, chrome, rubber, and plastic in restaurants, bars, kitchens, dishwashing areas, and bar and wait station areas and other food storage areas. After removing gross filth, apply a solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} to surfaces and locations where flies breed. Spray surfaces thoroughly or apply by pouring, mopping or sponging onto the surface. Allow surface to remain wet for 10 minutes. Repeat application 1-2 times per week or as needed. Do not contaminate food and food packaging.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL),(150,'SMALL FLIES IN DRAINS',NULL,'FOR CONTROL OF SMALL FLIES IN DRAINS:  ','For control of small flies: Drosophila spp. and the Phoridae family. Spray or pour solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} into the drain during time of lowest level of drain use. Add 14 oz. of use solution daily to each drain to maintain fly control. Apply product around the edge of the drain and thoroughly coat inside of drain. Repeat application 1-2 times per week or as needed. Do not contaminate food and food packaging.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,11,NULL,NULL),(151,'MUSHROOM FARM INDUSTRY',NULL,'MUSHROOM FARM INDUSTRY USE DIRECTIONS ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,11,NULL,NULL),(152,'CITRUS CANKER CONTROL',NULL,'CITRUS CANKER CONTROL (Not For Use in CA): ','For prevention of Citrus Canker Disease through treatment of pre-cleaned equipment. Effective against Xanthomonas axonopodis pv. citri {{CitrusCanker}} at 2000 ppm active. Treatment can be applied to trucks, attached trailers, field harvesting equipment, including cargo area, wheels, tires, undercarriage, hood, roof, fenders and any other hard, non-porous part of equipment that can be taken into infested areas. Thoroughly clean all surfaces with soap or detergent and rinse with water. Then saturate surfaces with a use dilution of 2.5 oz. of this product per gal. of water {{EquivalentDilution}} {{2000PPM}} for a period of 10 minutes. Allow to air dry. All surfaces that come in contact with food or crop must be rinsed with potable water before reuse. To prevent the spread of Citrus Canker Disease by this artificial means of transportation, treatments are made by trigger spraying, dipping or brushing. Clothing must be either thoroughly rinsed or laundered before reuse. Footwear must be rinsed before reuse. Prepare a fresh solution daily or when visibly dirty',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,11,NULL,NULL),(153,'WHIRLPOOL UNITS DISINFECTION/VIRUCIDE*',NULL,'DISINFECTION/VIRUCIDE* OF HARD, NON-POROUS SURFACES IN WHIRLPOOL UNITS: ','After using the whirlpool unit, drain unit. Prepare a use solution of 3 oz. of the product per 5 gal. of water {{EquivalentDilution}} and refill with use solution to just cover intake valves {{2InchesAboveHighestJet}}. Briefly start the pump to circulate the solution. Turn off the pump. Wash down the unit sides, seat of the chair lift and any other related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 10 minutes. After the unit has been thoroughly disinfected, drain the solution from the unit and rinse disinfected surfaces with fresh water. Wipe dry with a clean sponge or cloth or allow to air dry. Repeat for heavy soiled units. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,11,NULL,NULL),(154,'WHIRLPOOL UNITS SANITIZATION',NULL,'SANITIZATION OF HARD, NON-POROUS SURFACES IN WHIRLPOOL UNITS: ','To remove body oils, dead tissue, soil and all other buildups or organic matter on surfaces after using the whirlpool unit, drain unit. Prepare a use solution of 0.25 oz. of this product per gal. of water {{EquivalentDilution}} and refill with use solution to just cover the intake valves {{2InchesAboveHighestJet}}. Briefly start the pump to circulate the solution. Turn off the pump. Wash down the unit sides, seat of the chair lift and any other related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 3 minutes. After the unit has been thoroughly sanitized, drain the solution from the unit and rinse all with fresh water. Repeat for heavy soiled units. Then the unit is ready for reuse.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,11,NULL,NULL),(155,'BAGLESS VACUUM CLEANERS',NULL,'FOR DISINFECTING BAGLESS VACUUM CLEANERS: ','Add 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Turn off and unplug vacuum cleaner. Remove the hard, non-porous container that houses collected material from the vacuum cleaner. Empty contents into a waste receptacle. Rinse collection container with water and wipe clean to remove any additional collected material. Apply use solution to collection container with a brush, cloth, mop, sponge, mechanical spray device, {{{SprayDevices}} so as to wet all surfaces thoroughly. {{SprayerApplications}} Allow surfaces to remain wet for 10 minutes. Wipe up excess liquid with a clean cloth or sponge or allow to air dry. Reattach container to vacuum cleaner. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,11,NULL,NULL),(156,'VACUUM CLEANER BRUSHES',NULL,'FOR DISINFECTING NON-POROUS VACUUM CLEANER BRUSHES: ','Add 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Turn off and unplug vacuum cleaner. Remove the non-porous brushes from vacuum cleaner. Submerge brush in use solution so as to wet all surfaces thoroughly. Allow surfaces to remain wet for 10 minutes. Wipe up excess liquid with a clean cloth or sponge or allow to air dry. Reattach brushes to vacuum cleaner. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,11,NULL,NULL),(157,'COMMERCIAL FLORIST',NULL,'COMMERCIAL FLORIST USE DIRECTIONS: ','To clean, disinfect {{Deodorize}} hard, non-porous surfaces, prepare use solution of 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}}. For heavy-duty use, add 4 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Remove all leaves, petals, garbage and refuse. Pre-clean surfaces using pressurized water where possible. Apply use solution to hard, non-porous surfaces, thoroughly wetting surfaces as required, with a cloth, mop, brush, sponge, {{AutoScrubber,}} or mechanical spray device, {{SprayDevices}}. For sprayer applications, spray 6-8 inches from surface. Rub with brush, sponge, mop or cloth. Do not breathe spray. Treated surfaces must remain wet for 10 minutes. Wipe up excess or allow to air dry. Change cloth, sponge or towels frequently to avoid re-deposition of soil. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,11,NULL,NULL),(158,'WORK AREAS AND BENCHES',NULL,'WORK AREAS AND BENCHES, POTS, FLATS AND FLOWER BUCKETS, CUTTING TOOLS: ','Pre-clean surfaces. {{SpraySwabSoak}} with a solution of 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}} before each work period and again after each plant is completed {{ControlDiseaseTransfer}}. Allow surface to remain wet for 10 minutes. To apply solution as a sprayer application, use as a coarse spray only and spray 6-8 inches from surface. Wipe up excess liquid or allow to air dry. {{DryOilTools}} Prepare a fresh solution daily or when visibly dirty. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,11,NULL,NULL),(159,'CLEANSING OF EXTERIOR BODY SURFACES',NULL,'CLEANSING OF EXTERIOR BODY SURFACES OF {{HumanRemains}}: ','To cleanse away skin secretions and accompanying malodor, to ensure the removal of all soil and bloodstains, and to remove and reduce surface contamination, apply 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}} to the exterior surfaces of the body. Bathe the entire body using sponge or washcloth. A soft brush may be employed on surfaces other than the face. Allow a 10 minute contact time for optimal results. Prepare a fresh solution for each human remain. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,11,NULL,NULL),(160,'KITCHEN/BATHROOM/HOUSEHOLD',NULL,'CLEAN/DISINFECT/DEODORIZE {{KitchenBathroomHousehold}} SURFACES: ','Pre-clean surfaces. Apply a solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} with brush, cloth, mop, sponge, mechanical spray device, {{SprayDevices}}. For spray applications, hold container 6 to 8 inches from surface and spray until thoroughly wet. For disinfection, treated surfaces must remain wet for 10 minutes. Wipe up excess liquid or allow to air dry. Rinse with potable water after use on surfaces that come in contact with food. This product is not to be used to clean or disinfect dishware, glasses or eating utensils. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,12,NULL,NULL),(161,'EXTERIOR HOUSEHOLD SURFACES',NULL,'SANITIZATION OF EXTERIOR HOUSEHOLD SURFACES DIRECTIONS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,12,NULL,NULL),(162,'LAUNDRY',NULL,'COMMERCIAL AND INSTITUTIONAL LAUNDRY USE: ','For residual bacteriostatic activity against gram negative and/or gram positive odor-causing bacteria and/or residual self-sanitizing activity against Klebsiella pneumoniae and Staphylococcus aureus, use this product as directed. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,13,NULL,NULL),(163,'Initial Treatment',NULL,'Initial Treatment:','Use 10 oz. of this product per 100 pounds of fabric (dry weight) {{EquivalentDilution}}. Dilute the appropriate amount of this product in one to two gal. of water, and then add solution to the wash wheel at the beginning of the final rinse cycle. A minimum rinse cycle time of 5 minutes is required',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,13,NULL,NULL),(164,'Repeat Treatment',NULL,'Repeat Treatment: ','Repeat Treatment: Follow Initial Treatment directions and re-treat fabric after each washing {{IfOdorPersists}}. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,13,NULL,NULL),(165,'LAUNDRY BACTERIOSTAT',NULL,'LAUNDRY BACTERIOSTAT FOR COMMERCIAL, INDUSTRIAL, AND NON-MEDICAL INSTITUTIONAL LAUNDRY APPLICATIONS: ','This product provides the fabric with residual bacteriostatic activity against odor causing gram-negative and gram-positive bacteria when added to the final rinse at a rate of 10 oz. of this product per 100 lbs. of dry laundry. This product was evaluated against:  Corynebacterium ammoniagenes {{ATCC6872}} Klebsiella pneumoniae {{ATCC4352}} Staphylococcus aureus {{ATCC6538}} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,13,NULL,NULL),(166,'LAUNDRY DEODORIZER ',NULL,'LAUNDRY DEODORIZER {AGAINST ODOR CAUSING BACTERIA}: ','For activity against odor causing bacteria caused by conditions of high relative humidity or wet contamination, use 12 oz. of this product per 100 pounds of dry weight fabric. Dilute the appropriate amount of this product in one to two gal. of water, and then add to the wash wheel in the final rinse. Re-treat fabric after each washing. Laundered fabric may also be treated by soaking. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,13,NULL,NULL),(167,'PRESERVATION AGAINST MILDEW',NULL,'PRESERVATION AGAINST MILDEW BY SOAKING: ','Use 10 oz. of this product per 100 pounds of fabric (dry weight). A minimum soaking time of 5 minutes is required.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,13,NULL,NULL),(168,'LAUNDRY SANITIZER',NULL,'LAUNDRY SANITIZER: ','When added at the rate of 1 oz. of this product per gal. water {{Yield780PPM}} {{12Oz}} {{EquivalentDilution}} {{780PPM}}, this formulation provides sanitization against Staphylococcus aureus, Klebsiella pneumoniae, Pseudomonas aeruginosa, and Staphylococcus aureus Methicillin Resistant (MRSA) and is effective against HIV-1 in rinse water up to 200 ppm hard water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,13,NULL,NULL),(169,'KILLS HIV-1 ON LAUNDRY',NULL,'KILLS HIV-1 ON LAUNDRY IN COMMERCIAL, INDUSTRIAL AND INSTITUTIONAL APPLICATIONS. ','This product provides virucidal* activity against HIV-1 on fabrics when presoaked with a 4 minute contact time followed by normal washing in detergent and rinsing at a rate of 12 oz. of this product per 100 lbs. of dry laundry in water hardness up to 200 ppm.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,13,NULL,NULL),(170,'LAUNDRY SANITIZING',NULL,'LAUNDRY SANITIZING DIRECTIONS FOR USE: ','For sanitizing step, fill washer to low water level with minimum temperature water of 95°F. Using an appropriate {{#CompanyName}}} dispenser, inject this product into the sanitizing rinse step at the rate of 1 oz. of this product per gal. water {{Yield780PPM}} {{12Oz}} {{780PPM}} {{EquivalentDilution}}. Treat the laundry for a minimum of 5 minutes at a minimum temperature of 95°F. Other laundry additives, such as fabric softeners, laundry sours, starch and sizing must be used per manufacturers instructions in subsequent rinse cycles after the sanitizing rinse cycle.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,13,NULL,NULL),(171,'LAUNDRY FINAL CYCLE',NULL,'LAUNDRY SANITIZING DIRECTIONS FOR USE: ','This product is used in the final, warm rinse cycle at a low water level. Dilute at 1 oz. of this product per gal. of water {{12Oz}} {{780PPM}} {{EquivalentDilution}}, then add to the wash in the final rinse, or dispense directly through automatic dispensing equipment. Run for a minimum of 5 minutes. Retreat as necessary. This product will not harm fabrics. DO NOT USE IN THE PRESENCE OF, OR MIX WITH OTHER CHEMICALS.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,13,NULL,NULL),(172,'SMALL COMMERCIAL WASHING MACHINES',NULL,'FOR USE IN SMALL COMMERCIAL WASHING MACHINES: ','Use the chart below to determine the equivalent use dilution per wash load for use as a Laundry Sanitizer in small commercial washing machines. This is based on 12 oz. of this product per 100 lbs. of dry laundry. ','{{#SmallWasherCapacity}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,13,NULL,NULL),(173,'CONSUMER WASHING MACHINES',NULL,'FOR USE IN CONSUMER OR HOUSEHOLD TYPE WASHING MACHINES:',' Use the chart below to determine the equivalent use dilution per wash load for use as a Laundry Sanitizer in consumer or household type washing machines. This is based on 12 oz. of this product per 100 lbs. of dry laundry.','{{#ConsumerWasherCapacity}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,13,NULL,NULL),(174,'RECIRCULATING COOLING WATER TOWERS',NULL,'INDUSTRIAL {{AND/OR} COMMERCIAL} RECIRCULATING COOLING WATER TOWERS, RETORT WATER SYSTEMS (Not for use in CA.) ','Cooling tower waters that are inherently low in algae growth and bacteria count may be adequately controlled by the lower range of these dosages. Repeat every seven days or increase frequency if needed. Should slime develop again, repeat initial dosage.\r\n\r\nFor best results, clean heavily contaminated systems before treatment with this product. If soap or anionic detergent is used, rinse thoroughly before charging with this algaecide.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,14,NULL,NULL),(175,'ONCE THROUGH WATER COOLING SYSTEM',NULL,'ONCE THROUGH FRESH {{AndSea}} WATER COOLING SYSTEM (Not for use in CA.) ','Use of the product in either public/municipal or single or multiple family private/residential potable/drinking water systems is strictly prohibited. Use of the product in any cooling water system that discharges effluent within 0.25 mile of either a public/municipal or single or multiple family private/residential potable/drinking water intake is strictly prohibited.\r\n\r\nFor best results, slug feed. The frequency of addition of microbiocide needed depends on many factors. To optimize your use of water treatment microbiocide, follow this procedure.   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,14,NULL,NULL),(176,'DEACTIVATION',NULL,'DEACTIVATION: ','Use bentonite clay at the minimum ratio of 5 ppm clay to 1 ppm product. This product must be deactivated prior to discharge of the NPDES outfall. Do not apply this product more than 4 times a year. ',NULL,NULL,NULL,NULL,'Deactivation instructions must be used with the above Once Through directions for use.',NULL,NULL,NULL,3,14,NULL,NULL),(177,'OILFIELD INJECTION AND WASTE WATER',NULL,'OILFIELD INJECTION AND WASTE WATER (Not for use in CA.): ','This product must be added to the water handling system at a point of uniform mixing such as the area of addition of makeup water to the holding tank.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,14,NULL,NULL),(178,'GAS PRODUCTION AND TRANSMISSION PIPELINE AND SYSTEMS',NULL,'GAS PRODUCTION AND TRANSMISSION PIPELINE AND SYSTEMS: ','For the control of sulfate-reducing bacteria and slime forming bacteria, this product must be added to a gas production or transmission pipeline via direct injection at a point where uniform and maximum distribution will occur. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,15,NULL,NULL),(179,'GAS STORAGE WELLS AND SYSTEMS',NULL,'GAS STORAGE WELLS AND SYSTEMS: ','Treat individual injection wells with this product to produce an effective concentration of 651000 ppm active. Update treatment rate as needed. This product must be diluted by the water present in the formation. Injection takes place before gas is injected and may be repeated yearly or as needed to maintain control. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,15,NULL,NULL),(180,'PIPELINE PIGGING AND SCRAPING OPERATIONS',NULL,'PIPELINE PIGGING AND SCRAPING OPERATIONS: ','Add this product to slug of water immediately following the scraper {(keep the water volume to a minimum and contained between the scraper and the following pig)}. Add an effective concentration to produce 75-500 ppm depending on the length of the pipeline and the severity of the biofouling. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,15,NULL,NULL),(181,'DRILLING, COMPLETION AND WORKOVER FLUIDS SYSTEMS',NULL,'DRILLING, COMPLETION AND WORKOVER FLUIDS SYSTEMS:','Add to the fluid system at a point of uniform mixing such as circulating mud tank. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,15,NULL,NULL),(182,'PACKER FLUIDS',NULL,'PACKER FLUIDS: ','Add to a packer fluid at a point of uniform mixing such as a circulating holding tank at a rate of 65-1,000 ppm active per 100 barrels of fluid to a freshly prepared fluid depending on the severity of contamination. Seal the fresh packer fluid in the wall between the casing and the production tube. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,15,NULL,NULL),(183,'HYDROTESTING',NULL,'HYDROTESTING: ','Treat water used to hydrotest pipelines or vessels at 65-1,000 ppm active depending on the water quality and length of time the equipment will remain idle. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,15,NULL,NULL),(184,'AUTOMATED DILUTION SYSTEM',NULL,'AUTOMATED DILUTION SYSTEM {{DilutionSystemsTradeName}} INSTRUCTIONS:',NULL,NULL,NULL,NULL,NULL,NULL,'Y',NULL,NULL,NULL,16,NULL,NULL),(185,'BAG-IN BOX CONTAINERS',NULL,'BAG-IN BOX CONTAINERS: ','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,16,NULL,NULL),(186,'COARSE TRIGGER SPRAYERS',NULL,'{{Coarse}} TRIGGER SPRAYERS: Fill bottle from dispenser. {{ApplyAccordingToDirectionsAbove}} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,16,NULL,NULL),(187,'SPRAY USE INSTRUCTIONS',NULL,'SPRAY USE INSTRUCTIONS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,16,NULL,NULL),(188,'Spray Cap container language',NULL,'(Spray Cap container language) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,16,NULL,NULL),(189,'MOP BUCKETS',NULL,'MOP BUCKETS:','Fill bucket from dispenser. Set up Wet Floor signs. Mop floor surfaces as specified in directions above.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,16,NULL,NULL),(190,'PACKETS',NULL,'PACKETS: ','{{SimplyTearOpen}} pour contents into X gal. of water. Keep packets in box until ready to use. ',NULL,NULL,NULL,NULL,'For pre-measured tear open packets only',NULL,NULL,NULL,7,16,NULL,NULL),(191,'REFILLS',NULL,'REFILLS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,16,NULL,NULL),(192,'GENERAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,18,NULL,NULL),(193,'MedicalDevice',NULL,NULL,NULL,NULL,NULL,NULL,NULL,' For labels that list medical premises and metal and/or stainless steel surfaces, one of the following FDA/EPA Memorandum of Understanding statements must be used.','Y',NULL,NULL,2,18,NULL,NULL);
