INSERT INTO `m_directionsforusestatement` VALUES (305,NULL,NULL,NULL,'{Before using  this product {{FederallyInspected}}, food products and packaging materials must be removed from the room or carefully protected.} ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,53,NULL),(307,NULL,NULL,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. {This product can be used to pre-clean or decontaminate critical or semi-critical medical devices prior to sterilization or high-level disinfection.}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,54,NULL),(313,NULL,NULL,NULL,'This product is not for use on medical device surfaces.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,56,NULL),(314,NULL,NULL,'','1. Pre-clean heavily soiled areas. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,57,NULL),(315,NULL,NULL,NULL,'2. Apply use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} to disinfect hard, non-porous surfaces with a sponge, brush, cloth, mop {{Immersion}}, {{AutoScrubber}} {{CleaningEquipment}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,57,NULL),(316,NULL,NULL,NULL,'3. Treated surfaces must remain wet for 10 minutes.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,57,NULL),(317,NULL,NULL,NULL,'4. {{Dry}} {{Rinsing}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,57,NULL),(318,NULL,NULL,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,NULL,57,NULL),(319,NULL,NULL,'*KILLS HIV, HBV and HCV ON PRE-CLEANED HARD, NON-POROUS SURFACES/OBJECTS PREVIOUSLY SOILED WITH BLOOD/BODY FLUIDS ','in health care settings or other settings in which there is an expected likelihood of soiling of hard, non-porous surfaces/objects with blood or body fluids and in which the surfaces/objects likely to be soiled with blood or body fluids can be associated with the potential for transmission of Human Immunodeficiency Virus Type 1 {{HIV-1}} {{AIDS}}, Hepatitis B Virus {{HBV}} and Hepatitis C Virus {{HCV}}.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,59,NULL),(320,NULL,NULL,'SPECIAL INSTRUCTIONS FOR CLEANING AND DECONTAMINATION AGAINST HIV-1, HBV and HCV ON SURFACES/OBJECTS SOILED WITH BLOOD/BODY FLUIDS. ',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,59,NULL),(321,NULL,NULL,'Personal Protection:  ','{{ProtectiveWearOrBarrier}}.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,59,NULL),(322,NULL,NULL,'Cleaning Procedure:  ','Blood and other body fluids {{HIV-1}} must be thoroughly cleaned from hard, non-porous surfaces and objects before application of {{ThisDisinfectant}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,59,NULL),(323,NULL,NULL,'Disposal of Infectious Materials:  ','Blood and other body fluids, cleaning materials and clothing must be autoclaved and disposed of according to federal, state and local regulations for infectious waste disposal. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,NULL,59,NULL),(324,NULL,NULL,'Contact Time:  ','Allow hard, non-porous surfaces to remain wet for 2 minutes to kill HIV and for 10 minutes to kill all other viruses and bacteria listed on the label.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,6,NULL,59,NULL),(325,NULL,NULL,NULL,'1. Pre-clean surfaces.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,65,NULL),(326,NULL,NULL,NULL,'2. Apply use solution of 1.75 oz. of this product per 5 gal. of water {{260PPM}} {{EquivalentDilution}} to hard, nonporous surfaces with a sponge, brush, cloth, mop, {{Immersion}}, {{AutoScrubber}}, {{CleaningEquipment}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,65,NULL),(327,NULL,NULL,NULL,'3. Treated Surfaces must remain wet for 10 minutes.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,65,NULL),(328,NULL,NULL,NULL,'4. {{WipeOrAirDry}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,65,NULL),(329,NULL,NULL,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,NULL,65,NULL),(330,NULL,NULL,NULL,'1. Pre-clean heavily soiled areas.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,58,NULL),(331,NULL,NULL,NULL,'2. Apply use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} to disinfect hard, non-porous surfaces with a sponge, brush, cloth, mop {{Immersion}}, {{AutoScrubber}}, {{CleaningEquipment}}.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,58,NULL),(332,NULL,NULL,NULL,'3. Treated surfaces must remain wet for 10 minutes.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,58,NULL),(333,NULL,NULL,NULL,'4. {{WipeOrAirDry}}. {{Rinsing}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,58,NULL),(334,NULL,NULL,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,NULL,58,NULL),(335,NULL,NULL,'FOOD CONTACT SANITIZING DILUTION TABLE {{FoodContactSurfaces}}:','To prepare a 150, 200, 300 or 400 ppm active solution use the following dilution table. Prepare the correct dilution rate based upon the appropriate use site. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,66,NULL),(336,NULL,NULL,NULL,'0.75 oz. of this product per 4 gal. of water {{0.19OzPerGal}} {{150PPM}}{{EquivalentUseDilution}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,335,NULL,NULL),(337,NULL,NULL,'FOOD CONTACT SANITIZING DILUTION TABLE','{{#FOOD_CONTACT_SANITIZING_DILUTION_TABLE}}',NULL,'NA',NULL,'Y',NULL,NULL,NULL,NULL,NULL,67,NULL),(338,NULL,NULL,NULL,'0.75 oz. of this product per 4 gal. of water {{0.19OzPerGal}} {{150PPM}}{{EquivalentDilution}} ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,337,NULL,NULL),(339,NULL,NULL,NULL,'1 oz. of this product per 4 gal. of water {{0.25OzPerGal}} {{200PPM}} {{EquivalentDilution}} ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,337,NULL,NULL),(340,NULL,NULL,NULL,'1.5 oz. of this product per 4 gal. of water {{0.375OzPerGal}} {{300PPM}} {{EquivalentDilution}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,337,NULL,NULL),(341,NULL,NULL,NULL,'2 oz. of this product per 4 gal. of water {{0.5OzPerGal}} {{400PPM}} {{EquivalentDilution}} ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,337,NULL,NULL),(342,NULL,NULL,NULL,'0.75-1 oz. of this product per 4 gal. of water {{0.19-0.25OzPerGal}} {{150-200PPM}} {{EquivalentDilution}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,337,NULL,NULL),(343,NULL,NULL,NULL,'0.75-2 oz. of this product per 4 gal. of water {{0.19-0.5OzPerGal}} {{150-400PPM}} {{EquivalentDilution}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,337,NULL,NULL),(344,NULL,NULL,NULL,'1-2 oz. of this product per 4 gal. of water {{0.25-0.5OzPerGal}} {{200-400PPM}} {{EquivalentDilution}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,337,NULL,NULL),(345,NULL,NULL,NULL,'Immerse pre-cleaned glassware, dishes, silverware, cooking utensils and other similar size food processing equipment in a solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} for at least 1 minute. Allow sanitized surfaces to adequately drain {{AirDry}} before contact with food {{NoResidueRemains}}. Do not rinse. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,68,NULL),(346,NULL,NULL,NULL,'For articles too large for immersing, apply a use solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} to sanitize hard, non-porous food contact surfaces with a brush, cloth, mop, sponge, auto scrubber, {{CleaningEquipment}}. Surfaces must remain wet for at least 1 minute. Allow sanitized surfaces to adequately drain {{AirDry}} before contact with food {{NoResidueRemains}}. Do not rinse.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,68,NULL),(347,NULL,NULL,NULL,'1. Thoroughly wash equipment and utensils in a hot detergent solution.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,69,NULL),(348,NULL,NULL,NULL,'Prepare a fresh solution daily or when visibly dirty. For mechanical application, use solution must not be reused for sanitizing applications {{OtherPurposes}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,68,NULL),(349,NULL,NULL,NULL,'2. Rinse utensils and equipment thoroughly with potable water.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,69,NULL),(350,NULL,NULL,NULL,'3a. Sanitize equipment and utensils by immersion in {{#AppropriateDilution}} {{EquivalentDilution}} of this product for at least 1 minute at a temperature of 75&#176;F. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,69,NULL),(351,NULL,NULL,NULL,'4. For equipment and utensils too large to sanitize by immersion, apply use solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product by rinsing, spraying or swabbing until thoroughly wetted for 1 minute. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,69,NULL),(352,NULL,NULL,NULL,'5. {{AdequatelyDrain}} Do not rinse. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,NULL,69,NULL),(353,NULL,NULL,NULL,'6. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,6,NULL,69,NULL),(354,NULL,NULL,NULL,'1. Scrape and pre-wash hard, non-porous utensils and glasses whenever possible.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,70,NULL),(355,NULL,NULL,NULL,'2. Wash with a good detergent or compatible cleaner.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,70,NULL),(356,NULL,NULL,NULL,'3. Rinse with potable water.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,70,NULL),(357,NULL,NULL,NULL,'4. Sanitize in a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product. Immerse all utensils for at least 1 minute or for contact time specified by governing sanitary code',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,70,NULL),(358,NULL,NULL,NULL,'5. Place sanitized utensils on a rack or drain board to air-dry.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,NULL,70,NULL),(359,NULL,NULL,NULL,'6. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,6,NULL,70,NULL),(360,NULL,NULL,NULL,'{{PotableWaterRinse}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,7,NULL,70,NULL),(361,NULL,NULL,NULL,'1. Disassemble equipment and thoroughly clean after use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,71,NULL),(362,NULL,NULL,NULL,'2. Assemble equipment into operational position prior to sanitizing. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,71,NULL),(363,NULL,NULL,NULL,'3. Prepare a sanitizing solution equal to 110% of the volume capacity of the equipment by diluting (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product {{150400PPM}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,71,NULL),(364,NULL,NULL,NULL,'4. Pump the solution through the system until full flow is obtained at all extremities and the system is completely filled with sanitizer and all air is removed. Surfaces must remain wet for at least 1 minute. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,71,NULL),(365,NULL,NULL,NULL,'1. Turn off refrigeration. (Note: Use this direction only if applicable.)',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,73,NULL),(366,NULL,NULL,NULL,'2. Unit must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.)',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,73,NULL),(367,NULL,NULL,NULL,'3. Apply a solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product by {{CoarsePumpTriggerSprayDevice}} direct pouring or by recirculating through the system. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Surfaces must remain wet for at least 1 minute',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,73,NULL),(368,NULL,NULL,NULL,'4. {{Drain}} before contact with food/liquid. Do not rinse. Return machine to service. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,73,NULL),(369,NULL,NULL,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,NULL,73,NULL),(370,NULL,NULL,NULL,'1. Shut off incoming water line to machine and turn off refrigeration.  2',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,385,NULL,NULL),(371,NULL,NULL,NULL,'2. Wash with a compatible detergent and rinse with potable water before sanitizing. (Note: Use this direction only if applicable.) ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,385,NULL,NULL),(372,NULL,NULL,NULL,'3. Apply a solution of (Insert appropriate food contact dilution from table or list)  {{EquivalentDilution}} of this product by mechanical spray, direct pouring, or by recirculating through the system. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,385,NULL,NULL),(373,NULL,NULL,NULL,'4. Allow surfaces to remain wet or solution to remain in equipment for at least 1 minute. Drain thoroughly before reuse and allow sanitized surfaces to adequately drain {{AirDry}} before contact with liquid. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,385,NULL,NULL),(374,NULL,NULL,NULL,'5. Return machine to normal operation. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,385,NULL,NULL),(375,NULL,NULL,NULL,'1. Unit must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.)',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,386,NULL,NULL),(376,NULL,NULL,NULL,'2. Backwash the softener and add a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product to the brine tank well. {{BrineTank}} {{Note}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,386,NULL,NULL),(377,NULL,NULL,NULL,'3. Proceed with the normal regeneration or interrupt the cycle after the brining step and let the softener soak for a minimum of 1 minute. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,386,NULL,NULL),(378,NULL,NULL,NULL,'4. Backwash the softener with potable water to make sure all sanitizing solution is thoroughly rinsed from the unit before returning the system to service. Return system to service. Follow the manufacturers directions for re-installation of new pre-filters, membrane element and post filter.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,386,NULL,NULL),(385,NULL,NULL,'Ice Machines  ','Sanitization must occur after initial installation, after the machine is serviced and periodically during its use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,74,NULL),(386,NULL,NULL,'{{Tanks}}  Sanitization must occur after initial installation, after the system is serviced and periodically during its use. ',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,74,NULL),(387,NULL,NULL,NULL,'1. Thoroughly flush, clean and potable water rinse the system',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,72,NULL),(388,NULL,NULL,NULL,'2. Prepare required volume of sanitizer solution needed by diluting (Insert appropriate food contact dilution from table or list)  {{EquivalentDilution}} of this product {{150-400PPM}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,72,NULL),(389,NULL,NULL,NULL,'3. To sanitize entire system by circulation methods, run pumps for at least 2 minutes to thoroughly wet and sanitize all parts of the system.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,72,NULL),(390,NULL,NULL,'Water Softeners ','Sanitization must occur after initial installation, after the system is serviced and periodically during its use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,81,NULL),(391,NULL,NULL,NULL,'1. Unit must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.) ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,390,NULL,NULL),(392,NULL,NULL,NULL,'2. Backwash the softener and add a solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product to the brine tank well. {{BrineTank}} {{Note}} ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,390,NULL,NULL),(393,NULL,NULL,NULL,'3. Proceed with the normal regeneration or interrupt the cycle after the brining step and let the softener soak for a minimum of 1 minute.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,390,NULL,NULL),(394,NULL,NULL,NULL,'4. Backwash the softener with potable water to make sure all sanitizing solution is thoroughly rinsed from the unit before returning the system to service. Return system to service. Follow the manufacturers directions for re-installation of new pre-filters, membrane element and post filter.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,390,NULL,NULL),(395,NULL,NULL,'Reverse Osmosis (RO) Units  ','Sanitization must occur after initial installation, after the system is serviced and periodically during its use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,81,NULL),(396,NULL,NULL,NULL,'1. Turn off RO system, drain storage tank and remove membrane element and pre-filters. Put membrane element in a plastic bag so it remains wet. Do not use this product to sanitize the membrane element. Membrane element must be sterilized separately. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,395,NULL,NULL),(397,NULL,NULL,NULL,'2. Tank must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.) ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,395,NULL,NULL),(398,NULL,NULL,NULL,'3. Fill empty pre-filter housing with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product and turn on raw water. {{Note}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,395,NULL,NULL),(399,NULL,NULL,NULL,'4. After holding tank is full, let system stand idle for a minimum of 1 minute. Turn off water. Drain holding tank. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,395,NULL,NULL),(400,NULL,NULL,NULL,'5. Before the system is put back into service, flush system with potable water to assure sanitizing solution is rinsed thoroughly from system. Return unit{{s}} to normal operation. Follow the manufacturers directions for re-installation of new pre-filters, membrane element and post filter.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,395,NULL,NULL),(401,NULL,NULL,NULL,'1. Hold pre-mixed sanitizer solution of 1 ounce of this product per 5 gal. 4-6 inches away from sole of {{Waterproof}} {{WorkWear}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,97,NULL),(402,NULL,NULL,NULL,'2. Lightly spray sole to thoroughly wet entire surface',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,97,NULL),(403,NULL,NULL,NULL,'3. Repeat procedure on other sole',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,97,NULL),(404,NULL,NULL,NULL,'4. Treated surfaces must remain wet for 3 minutes',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,97,NULL),(405,NULL,NULL,NULL,'5. [{{AllowToAirDry}} {{{WipeUp}} {{Absorb}} excess product {{WithCleanCloth}} {{BySteppingOnNeatFeetCleanShoeSolutionWelcomeMat}}].',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,NULL,97,NULL),(406,NULL,NULL,NULL,'1. Remove all animals. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,107,NULL),(407,NULL,NULL,NULL,'2. Thoroughly clean all surfaces and objects {caves, cage furniture, feeding and watering dishes, and appliances} including the substrate in the terrarium or cage with soap or detergent and rinse with water. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,107,NULL),(408,NULL,NULL,NULL,'3. Saturate all hard, non-porous surfaces {such as floors, walls, cages and other washable hard, non-porous surfaces} with the disinfecting and virucidal* solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} {(450 ppm active)} so as to wet thoroughly.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,107,NULL),(409,NULL,NULL,NULL,'4. Apply by cloth, mop, brush, sponge, auto scrubber or mechanical spray device {{hand pump} coarse pump or trigger spray device} or by immersion. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Rub with brush, cloth, or sponge. For smaller surfaces, use a trigger spray bottle to spray all surfaces with solution.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,107,NULL),(410,NULL,NULL,NULL,'5. Allow surfaces to remain wet for a period of 10 minutes.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,NULL,107,NULL),(411,NULL,NULL,NULL,'6. Saturate gravel as above and let stand for 10 minutes. Place in bucket of clean water and swirl for 15-30 seconds. Thoroughly air dry before returning to terrarium.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,6,NULL,107,NULL),(412,NULL,NULL,NULL,'7. Thoroughly scrub all treated surfaces (except gravel) with soap or detergent and rinse with potable water before reuse.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,7,NULL,107,NULL),(413,NULL,NULL,NULL,'8. Do not return animals to the habitat until it is dry and ventilated.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,8,NULL,107,NULL),(414,NULL,NULL,NULL,'9. Clean terrarium at least once weekly or more as needed. Change cloth, sponge or towels frequently to avoid redeposition of soil. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,9,NULL,107,NULL),(415,NULL,NULL,NULL,'10. Prepare a fresh solution daily or more often if use solution becomes visibly soiled or dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,10,NULL,107,NULL),(416,NULL,NULL,'From a Concentrate: ','Add 0.6 oz. of this product directly into the water in the toilet bowl. Brush thoroughly over exposed surfaces and under the rim with a toilet {{BrushMop}}, cloth, or sponge. Allow solution to stand for 10 minutes and flush. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,121,NULL),(417,NULL,NULL,'From a Use Solution: ','Empty water out of toilet bowl or urinal and apply 0.5 to 1 oz. use solution to exposed surfaces, including under the rim with a toilet {{BrushMop}}, cloth, or sponge, {{SprayDevices}}.  {{SprayApplications}} Brush or swab thoroughly, then allow solution to stand for 10 minutes and flush. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,121,NULL),(418,NULL,NULL,NULL,'1. Pre-clean heavily soiled areas. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,125,NULL),(419,NULL,NULL,NULL,'2. Apply use solution of 3 oz. of this product per 5 gal. of water {{450PPM}} {{EquivalentDilution}} to floors, walls and ceilings making sure not to over spray. To disinfect, all hard, non-porous surfaces must remain wet for 10 minutes.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,125,NULL),(420,NULL,NULL,NULL,'3. Scrub using a deck brush or other coarse material as necessary.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,125,NULL),(421,NULL,NULL,NULL,'4. Rinse surfaces thoroughly and let air dry.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,125,NULL),(422,NULL,NULL,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,5,NULL,125,NULL),(423,NULL,NULL,'Dosage: ','To eliminate odor, add 4  8 oz. of this product in a {{WavelessFree}} waterbed of 90 to 180 gal. capacity. Repeat application every 4 to 6 months. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,132,NULL),(424,NULL,NULL,'Site Preparation: ','The first step in any ongoing sanitation program must be the removal of gross contamination and debris. This may be accomplished by using a shovel, broom, or vacuum, depending on the area to be disinfected.  ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,151,NULL),(425,NULL,NULL,'Disinfection: ','For heavily soiled areas, pre-clean first. Use {{3Oz}} of this product per 5 gal. of water {{EquivalentDilution}} use solution. Wet all hard, non-porous surfaces thoroughly. Treated surfaces must remain wet for 10 minutes. Let air-dry. Prepare a fresh solution for each use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,151,NULL),(426,NULL,NULL,'For Heavy Duty Cleaning: ','When heavy duty cleaning is desired, use 6 oz. of this product per 5 gal. of water {{1.25Oz}} {{EquivalentDilution}}. Heavily soiled areas will require repeated cleaning before treatment. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,151,NULL),(427,NULL,NULL,'DO NOT APPLY TO THE MUSHROOM CROP, COMPOST OR CASING. ','Rinse treated surfaces with potable water before they contact the crop, compost or casing.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,151,NULL),(428,NULL,NULL,'Preparation of Use Solution:','Apply a use solution of 0.25 oz. of this product per gal. of water {{200PPM}} {{EquivalentDilution}} to sanitize hard, non-porous exterior surfaces such as vinyl, plastic, sealed concrete, painted or sealed woodwork, and sealed stucco. Surfaces to be treated include house siding, decks, patios, walkways and driveways.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,161,NULL),(429,NULL,NULL,'Application: ','Pre-clean heavily soiled areas. Apply solution with a brush, mop, cloth, sponge, {{AutoScrubber,}} mechanical spray device, {{SprayDevices}}, or with a low-pressure {{LessThan60PSI}} airless sprayer so as to wet all surfaces thoroughly. For sprayer applications, spray 6 inches to 8 inches from surface. Treated surfaces must remain wet for 3 minutes. Wearing suitable respiratory protective equipment and protective eyewear to control exposure to spray, pressure wash surfaces to thoroughly sanitize all treated areas using a high-pressure spray. Do not breathe spray. One-half gal. of diluted product will treat 200-300 sq. ft. of surface. Prepare a fresh solution daily or when visibly dirty. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,161,NULL),(430,NULL,NULL,'1. Dosing Location: ','This product is to be applied at a point in the system where it will be uniformly mixed, such as at the sump.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,174,NULL),(431,NULL,NULL,'2. Dosing Conditions: ','This product must be applied when the system is in jeopardy of being affected or after cleaning systems where efficiency is already impaired. Tower bleed off valves must be closed to permit a retention time of 4 hours. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,174,NULL),(432,NULL,NULL,'3. Method of Application: ',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,174,NULL),(433,NULL,NULL,'a. INTERMITTENT OR SLUG METHOD','Initial Dose: When the system is noticeably fouled, apply 26.25 fl. oz. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system.\r\n\r\nSubsequent Dose: When microbial control is evident, add 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water in the system weekly or as needed to maintain control. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,432,NULL,NULL),(434,NULL,NULL,'b. MODIFIED INTERMITTENT METHOD','Initial Dose: When the system is noticeably fouled, apply 26.25 fl. oz. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system. Apply half of this initial dose when half of the water in the system has been lost by blowdown.\r\n\r\nSubsequent Dose: When control of microbial growth is evident, apply 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water in the system. Apply half of this subsequent dose when half of the water in the system has been lost by blowdown.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,432,NULL,NULL),(435,NULL,NULL,'c. CONTINUOUS FEED METHOD ','Initial Dose: When the system is noticeably fouled, apply 26.25. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system.\r\n\r\nSubsequent Dose: Maintain this treatment by starting a continuous feed of 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water lost by blowdown. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,432,NULL,NULL),(436,NULL,NULL,'1. Dosing Location:  ','This product is to be applied at a point in the system where it will be uniformly mixed, such as at the sump. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,175,NULL),(437,NULL,NULL,'2. Dosing Conditions:  ','This product must be applied when the system is in jeopardy of being affected or after cleaning systems where efficiency is already impaired.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,175,NULL),(438,NULL,NULL,'3. Method Of Applications:',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,175,NULL),(439,NULL,NULL,'a. ','Wear safety glasses, rubber gloves and impervious apron',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,438,NULL,NULL),(440,NULL,NULL,'b. ','To reduce foaming, mix 10 parts of water to 1 part of this product',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,438,NULL,NULL),(441,NULL,NULL,'c. ','{{UseAdd}} 0.75 to 7 fl. oz. of this product {{0.6-6PPM}} per 1,000 gal.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,438,NULL,NULL),(442,NULL,NULL,'d. ','Do not discharge without performing proper deactivation. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,438,NULL,NULL),(443,NULL,NULL,'e. ','Treatment time cannot exceed 120 hours/application nor exceed 4 times per year.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,438,NULL,NULL),(444,NULL,NULL,'f. ','Avoid oxidizers and reducing agents. Product is cationic and must not be mixed with soap or anionic surfactants',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,438,NULL,NULL),(445,NULL,NULL,'3. Method Of Application: ','INTERMITTENT OR SLUG METHOD',NULL,'NA','Alternate Method of Application language can be used in place of Item #3 directly above.',NULL,'Y',NULL,NULL,4,NULL,175,NULL),(446,NULL,NULL,'Initial Dose:  ','When the system is noticeably fouled, apply 0.75 to 7 fl. oz. of this product {(0.6 to 6 ppm on an active basis)} per 1,000 gal. of water based on system flow rates. The minimum treatment is 6 to 24 hours. Repeat until control is achieved. Deactivation must be conducted prior to discharge from the system by using bentonite clay at a minimum ratio of 5 ppm clay to 1 ppm product. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,445,NULL,NULL),(447,NULL,NULL,'Subsequent Dose:  ','When microbial control is evident, add 0.375 to 3.75 fl. oz. of this product {(0.3 to 3 ppm on an active basis)} per 1,000 gal. of water based upon system flow rates on an as needed basis to maintain control. Frequency of feed must be tied to an in-plant monitoring program for macro cowling growth. Deactivation must be conducted prior to discharge from the system by using bentonite clay at a minimum ratio of 5 ppm clay to 1 ppm product.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,445,NULL,NULL),(448,NULL,NULL,'OILFIELD INJECTION AND WASTE WATER',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,177,NULL),(449,NULL,NULL,'1. ','Continuous Injection: Add this product at 30 ppm {(22.5 fl. oz. of this product per 1,000 gal. of water)} when system is noticeably fouled. When microbial control is evident, add this product at 15 ppm (30 fl. oz. of this product per 1,000 gal. of water) to maintain control.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,448,NULL,NULL),(450,NULL,NULL,'2. ','Batch Treatment: Add this product at 180 ppm {(230 fl. oz. of this product per 1,000 gal. of water)} over a period of 4-6 hours one or more times per week when the system is noticeably fouled. When microbial control is evident, add this product at 90 ppm (115 fl. oz. of this product per 1,000 gal. of water) over a period of 4-6 hours one or more time per week.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,448,NULL,NULL),(451,NULL,NULL,'Initial treatment: ','65-1,000 ppm active added to a freshly prepared fluid.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,181,NULL),(452,NULL,NULL,'Maintenance dosage: ','65-1,000 ppm active so as to maintain control.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,181,NULL),(453,NULL,NULL,NULL,'Remove {{CapSprayNozzle}} from empty container. Fill empty container with a freshly prepared use-solution. Replace {{CapSprayNozzle}}. Place correct use-dilution label on newly filled container. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,184,NULL),(454,NULL,NULL,NULL,'{{RemoveCap}} Insert cartridge into dispenser. {{SeeDispenserInstructionsForProperPlacementOfCartridge}} {{PressButtonOrTurnKnob}} to dispense {{#InsertAppropriateDilution}} of this product into a {{BucketBottleContainer}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,184,NULL),(455,NULL,NULL,NULL,'Turn off water to connect {{UnitCartridge}}. Attach water source. Rotate control knob to fill a {{BottleBucket}}. Squeeze handle to dispense {{#AppropriateDilution}}. {{SeeDeviceInstructionManualForMoreInformation.}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,184,NULL),(456,NULL,NULL,NULL,'Attach sprayer unit to hose. Secure tightly, Check that the sprayer is in the off position. Turn on water. Turn sprayer to on position to dispense {{#AppropriateDilution}}. Spray evenly over surface. When finished turn sprayer to off position and then turn water off. Separate mixing of the concentrate or other application equipment is not required. First ensure the hose faucet is turned off',NULL,'NA',NULL,NULL,NULL,NULL,NULL,4,NULL,184,NULL),(457,NULL,NULL,'{{HowToUsePackage}}',' This package is designed to be used with dilution control systems only. Open package and connect to {{HoseSystem}} to dispense according to directions on the box. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,185,NULL),(458,NULL,NULL,'How to Assemble Extendable Trigger',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,1,NULL,187,NULL),(459,NULL,NULL,NULL,'1. Remove cap from bottle.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,458,NULL,NULL),(460,NULL,NULL,NULL,'2. Insert end of tube into bottle until new cap meets bottle.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,458,NULL,NULL),(461,NULL,NULL,NULL,'3. Twist cap onto bottle until secure.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,458,NULL,NULL),(462,NULL,NULL,'How to Spray',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,2,NULL,187,NULL),(463,NULL,NULL,NULL,'1. Adjust nozzle to ON {{#OnSymbol}} position as indicated on nozzle.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,462,NULL,NULL),(464,NULL,NULL,NULL,'2. {{PrimeSprayer}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,462,NULL,NULL),(465,NULL,NULL,'After Use','1. Turn nozzle to OFF {{#OffSymbol}} position',NULL,'NA',NULL,NULL,NULL,NULL,NULL,3,NULL,187,NULL),(466,NULL,NULL,'Shake Well. ','Remove sticker. Open flip cap. Firmly insert red hose tip. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,188,NULL),(467,NULL,NULL,'To Refill Concentrate From Large Containers Into Smaller Containers: ','This product may be used to fill and refill clean, properly labeled containers for dilution elsewhere within your facility. Make sure the small container has been cleaned, dried and properly labeled according to state and local regulations. Also make sure other items (funnels or hand pumps) are properly cleaned and dried. To refill, [{simply pour} {pump product}] from the larger container directly into the smaller one being careful not to spill any product. Keep both containers sealed when not in use.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,191,NULL),(468,NULL,NULL,NULL,'{{BeforeUsing}} ',NULL,NULL,'The following statement is to be used if any food premise locations are listed on the final label.',NULL,NULL,NULL,NULL,NULL,NULL,192,NULL),(469,NULL,NULL,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. {{DecontaminateCriticalMedicalDevices}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,193,NULL),(470,NULL,NULL,NULL,'This product is not for use on medical device surfaces.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,193,NULL);
