INSERT INTO `m_generalsection` VALUES (26,NULL,'PRECAUTIONARY STATEMENTS',NULL,'HAZARDS TO HUMANS AND DOMESTIC ANIMALS',NULL,NULL,'P',NULL,NULL,NULL,NULL,NULL,1,10,23,NULL),(27,NULL,'',NULL,NULL,NULL,NULL,'F',NULL,'Call a poison control center or doctor for treatment advice.\r\nHave the product container or label with you when calling a poison control center or doctor or going for treatment.','<p><strong>NOTE TO PHYSICIAN: </strong>Probable mucosal damage may contraindicate the use of gastric lavage. Measures against circulatory shock, respiratory depression and convulsion may be needed.</p>',NULL,NULL,2,10,24,NULL),(28,NULL,'ENVIRONMENTAL HAZARDS',NULL,NULL,NULL,NULL,'E','(Note to reviewer: If container size is 5 gallons or greater, the following Environmental Hazards statements will be used:)',NULL,NULL,NULL,NULL,3,10,25,NULL),(29,NULL,'FIRST AID',NULL,NULL,NULL,NULL,'F',NULL,NULL,NULL,NULL,NULL,1,11,NULL,NULL),(30,NULL,'PRECAUTIONARY STATEMENTS',NULL,'HAZARDS TO HUMANS AND DOMESTIC ANIMALS',NULL,NULL,'P',NULL,NULL,NULL,NULL,NULL,2,11,NULL,NULL),(31,NULL,'PHYSICAL OR CHEMICAL OR ENVIRONMENTAL HAZARDS',NULL,NULL,NULL,NULL,'E',NULL,NULL,NULL,NULL,NULL,3,11,NULL,NULL),(41,NULL,'FIRST AID',NULL,NULL,NULL,NULL,'F',NULL,NULL,NULL,NULL,NULL,1,16,NULL,NULL),(42,NULL,'PRECAUTIONARY STATEMENTS',NULL,'HAZARDS TO HUMANS AND DOMESTIC ANIMALS',NULL,NULL,'P',NULL,NULL,NULL,NULL,NULL,2,16,NULL,NULL),(43,NULL,NULL,NULL,NULL,NULL,NULL,'E',NULL,NULL,NULL,NULL,NULL,3,16,NULL,NULL),(44,NULL,NULL,NULL,NULL,NULL,NULL,'C',NULL,NULL,NULL,NULL,NULL,4,16,NULL,NULL),(45,NULL,'FIRST AID','Y',NULL,NULL,'Y','F','First Aid may only appear on different area of the container label if the Front Panel is less than 12 square inches in total.',NULL,NULL,NULL,NULL,1,17,NULL,NULL),(46,NULL,'PRECAUTIONARY STATEMENTS','Y','HAZARDS TO HUMANS AND DOMESTIC ANIMALS',NULL,'Y','P',NULL,NULL,NULL,NULL,NULL,2,17,NULL,NULL),(47,NULL,NULL,NULL,NULL,NULL,NULL,'E',NULL,NULL,NULL,NULL,NULL,3,17,NULL,NULL),(48,NULL,'ph