INSERT INTO `m_marketingstatement` VALUES (101,NULL,'For use in: {{Area Of Use}}. Disinfects, cleans, and deodorizes the following hard nonporous\r\ninanimate surfaces: {{Surface}}, etc.).',NULL,NULL,NULL,NULL,33,94),(102,NULL,'Federally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.',NULL,NULL,NULL,NULL,34,95),(103,NULL,'Germicidal Detergent and Deordorant',NULL,NULL,NULL,NULL,35,100),(104,NULL,'For use in {{Area Of Use}}.',NULL,NULL,NULL,NULL,37,NULL),(105,NULL,'Bactericidal against the following pathogenic bacteria according to the AOAC Use-Dilution Test method, current edition, modified in the presence of 400 ppm synthetic hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum:',NULL,NULL,NULL,NULL,36,NULL),(106,NULL,'A multi-purpose germicidal detergent and deodorant effective in hard waters up to 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5 % organic serum. Disinfects, cleans, and deodorizes in one labor saving step.',NULL,NULL,NULL,NULL,38,NULL),(107,NULL,'Fungicidal against {{Claims}} albicans according to the AOAC fungicidal test, modified in the presense of 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum.',NULL,NULL,NULL,NULL,39,NULL),(108,NULL,'Virucidal against {{Claims}} according to the virucidal qualification, modified in the presence of 400 ppm hard water (calculated as CaCO3) plus 5 % organic serum.',NULL,NULL,NULL,NULL,40,NULL),(109,'optional marketing language','Concentrate (Concentrated)\r\nNeutral (Neutral pH)\r\nDisinfects (Disinfectant)\r\nCleans (Cleaner)\r\nDeodorizes (Deodorizer)\r\n\r\nA multi-purpose, neutral pH, germicidal detergent and deodorant effective in hard water up to 400 ppm (calculated as CaCO3) in the presence of a moderate amount of soil (5% organic serum) according to the AOAC Use-dilution Test.  Disinfects, cleans, and deodorizes in one labor-saving step.\r\n\r\nRecommended for use in hospitals, nursing homes, schools, colleges, commercial and industrial institutions, office buildings, veterinary clinics, animal life science laboratories, zoos, federally inspected meat and poultry plants, equine farms, tack shops, pet shops, airports, kennels, hotels, motels, poultry farms, turkey farms, dairy farms, hog farms, breeding establishments, grooming establishments, funeral homes, and households.  Use to clean and disinfect non-medical (i.e. industrial and fire-fighting) respirators in industrial, commercial and institutional premises.\r\n\r\nDisinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: floors, walls, (non-medical) metal surfaces, (non-medical) stainless steel surfaces, glazed porcelain, plastic surfaces (such as polypropylene, polystyrene, etc.).\r\n\r\nUse [on] [to clean and disinfect] nonporous athletic mats, wrestling mats, gymnastic mats, exercise equipment and training tables.\r\nUse [on] [to clean and disinfect] nonporous personal protective safety equipment, wrestling headgear, boxing headgear, protective headgear, athletic helmets, hard hats, half mask respirators, full face breathing apparatus, gas masks, goggles, spectacles, face shields, hearing protectors, and ear muffs.  Rinse all equipment that comes in prolonged contact with skin with warm water and allow to air dry before reuse.  [Caution: Cleaning at the recommended 120ºF. temperature will avoid overheating and distortion of the personal safety equipment that would necessitate replacement.]',NULL,NULL,NULL,NULL,41,NULL),(113,'DISINFECTION PERFORMANCE IN INSTITUTIONS ({{Institutions}}) AND NON-MEDICAL FACILITIES ({{Non-Medical Facilities}}):','This product kills the following bacteria in 10 minutes at 2 oz. per gal. of water {{660PPM}} and 5% soil on hard, non-porous surfaces:',NULL,NULL,NULL,1,43,NULL),(114