back and forth several times. Turn the container over onto its other end and tip back and forth several times. Follow Pesticide Disposal instructions for rinsate disposal. Repeat this procedure two more times. Then offer for recycling if available or puncture and dispose of in a sanitary landfill, or by incineration.','>5','Non-refillable',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,53,NULL),(160,NULL,NULL,'Non-Refillable Container. Do not reuse or refill this container. Wrap empty container and put in trash or offer for recycling.',NULL,'Sealed',NULL,'NA',NULL,NULL,NULL,NULL,'Sealed containers are designed to reduce worker exposure to the concentrate. None of these types of containers can be triple rinsed because they are closed, welded, sealed containers.',NULL,4,NULL,53,NULL),(161,NULL,NULL,'Refillable Container. Refill this container with this product only. Do not reuse this container for any other purpose. Cleaning the container before final disposal is the responsibility of the person disposing of the container. Cleaning before refilling is the responsibility of the refiller. To clean the container before final disposal empty the remaining contents from this container into application equipment or a mix tank. Fill container about 10 percent full with water. Agitate vigorously or recirculate water with the pump for 2 minutes. Pour or pump rinsate into application equipment or rinsate collection system. Repeat this rinsing procedure two more times.',NULL,'Refillable',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,53,NULL);
