INSERT INTO `masterlabelcontent` VALUES (10,'Version 1','2015-04-16 10:38:10',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'W','2015-04-16 10:38:10',NULL,NULL,NULL,1,NULL,9,3),(11,'2.1','2015-05-27 18:56:22',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'W','2015-05-27 18:56:22',NULL,NULL,NULL,NULL,NULL,NULL,6),(16,'1.1','2015-09-30 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'W','2015-09-30 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,8),(17,'1','2017-05-15 00:00:00','Strength Title','Strength Text','Cleaner &bull; Disinfectant &bull; [{Food Contact} {Non-Food Contact}] Sanitizer &bull; Deodorizer &bull; Mildewstat &bull; Virucide*','Marketing claims may be used on the front panel.','MARKETING CLAIMS',NULL,'Marketing text is considered optional. Commas and the words and or can be added to phrases to make text grammatically correct.','TABLE OF CONTENTS',NULL,'The Table of Contents will not be on any label. This is for our customers reference only.','DIRECTIONS FOR USE','It is a violation of Federal law to use this product in a manner inconsistent with its labeling.','(General Considerations):  Numbered instructions will be used if label space permits, otherwise may appear in paragraph format. The list of organisms can be formatted into paragraph form using a comma to separate organisms. Unit abbreviations can be spelled out. When choosing optional text, appropriate punctuation can be inserted or deleted.)','STORAGE AND DISPOSAL','Do not contaminate water, food, or feed by storage and disposal.',NULL,NULL,'W','2016-01-13 00:00:00','2017-05-15 13:20:56',NULL,NULL,NULL,NULL,NULL,10),(34,'Version 2','2016-01-27 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'W','2016-01-27 00:00:00','2016-01-27 00:00:00',NULL,NULL,NULL,NULL,10,3),(36,'1','2016-06-14 00:00:00',NULL,NULL,'Cleaner &middot; Disinfectant &middot; {Food Contact} {Non-Food Contact} Sanitizer<br>\r\n<ul>\r\n<li>Deodorizer &middot; Mildewstat &middot; Virucide*</li>\r\n</ul>','(Note to Reviewer: Marketing claims may be used on the front panel.)','MARKETING CLAIMS',NULL,'Marketing text is considered optional. Commas and the words and or can be added to phrases to make text grammatically correct.',NULL,NULL,NULL,'DIRECTIONS FOR USE','It is a violation of Federal law to use this product in a manner inconsistent with its labeling.','Numbered instructions will be used if label space permits, otherwise may appear in paragraph format. The list of organisms can be formatted into paragraph form using a comma to separate organisms. Unit abbreviations can be spelled out. When choosing optional text, appropriate punctuation can be inserted or deleted. The following statement is to be used if any food premise locations are listed on the final label.) {Before using this product {in federally inspected meat and poultry food processing plants and dairies}, food products and packaging materials must be removed from the room or carefully protected.} For labels that list medical premises and metal and/or stainless steel surfaces, one of the following FDA/EPA Memorandum of Understanding statements must be used.','STORAGE AND DISPOSAL','Do not contaminate water, food, or feed by storage and disposal.','Sealed containers are designed to reduce worker exposure to the concentrate. None of these types of containers can be triple rinsed because they are closed, welded, sealed containers.',NULL,'W','2016-06-14 00:00:00',NULL,NULL,NULL,NULL,NULL,NULL,12);
/*!40000 ALTER TABLE `masterlabelcontent` ENABLE KEYS */;
