h, clean and potable water rinse the system',NULL,'NA',NULL,NULL,NULL,NULL,NULL,387,1,NULL,NULL,4209),(5150,NULL,NULL,NULL,'2. Prepare required volume of sanitizer solution needed by diluting (Insert appropriate food contact dilution from table or list)  {{EquivalentDilution}} of this product {{150-400PPM}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,388,2,NULL,NULL,4209),(5151,NULL,NULL,NULL,'3. To sanitize entire system by circulation methods, run pumps for at least 2 minutes to thoroughly wet and sanitize all parts of the system.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,389,3,NULL,NULL,4209),(5152,NULL,NULL,NULL,'1. Turn off refrigeration. (Note: Use this direction only if applicable.)',NULL,'NA',NULL,NULL,NULL,NULL,NULL,365,1,NULL,NULL,4210),(5153,NULL,NULL,NULL,'2. Unit must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.)',NULL,'NA',NULL,NULL,NULL,NULL,NULL,366,2,NULL,NULL,4210),(5154,NULL,NULL,NULL,'3. Apply a solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product by {{CoarsePumpTriggerSprayDevice}} direct pouring or by recirculating through the system. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Surfaces must remain wet for at least 1 minute',NULL,'NA',NULL,NULL,NULL,NULL,NULL,367,3,NULL,NULL,4210),(5155,NULL,NULL,NULL,'4. {{Drain}} before contact with food/liquid. Do not rinse. Return machine to service. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,368,4,NULL,NULL,4210),(5156,NULL,NULL,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,369,5,NULL,NULL,4210),(5157,NULL,NULL,'Ice Machines  ','Sanitization must occur after initial installation, after the machine is serviced and periodically during its use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,385,1,NULL,NULL,4211),(5158,NULL,NULL,NULL,'1. Shut off incoming water line to machine and turn off refrigeration.  2',NULL,'NA',NULL,NULL,NULL,NULL,NULL,370,NULL,5157,NULL,NULL),(5159,NULL,NULL,NULL,'2. Wash with a compatible detergent and rinse with potable water before sanitizing. (Note: Use this direction only if applicable.) ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,371,NULL,5157,NULL,NULL),(5160,NULL,NULL,NULL,'3. Apply a solution of (Insert appropriate food contact dilution from table or list)  {{EquivalentDilution}} of this product by mechanical spray, direct pouring, or by recirculating through the system. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,372,NULL,5157,NULL,NULL),(5161,NULL,NULL,NULL,'4. Allow surfaces to remain wet or solution to remain in equipment for at least 1 minute. Drain thoroughly before reuse and allow sanitized surfaces to adequately drain {{AirDry}} before contact with liquid. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,373,NULL,5157,NULL,NULL),(5162,NULL,NULL,NULL,'5. Return machine to normal operation. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,374,NULL,5157,NULL,NULL),(5163,NULL,NULL,'{{Tanks}}  Sanitization must occur after initial installation, after the system is serviced and periodically during its use. ',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,386,2,NULL,NULL,4211),(5164,NULL,NULL,NULL,'1. Unit must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.)',NULL,'NA',NULL,NULL,NULL,NULL,NULL,375,NULL,5163,NULL,NULL),(5165,NULL,NULL,NULL,'2. Backwash the softener and add a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product to the brine tank well. {{BrineTank}} {{Note}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,376,NULL,5163,NULL,NULL),(5166,NULL,NULL,NULL,'3. Proceed with the normal regeneration or interrupt the cycle after the brining step and let the softener soak for a minimum of 1 minute. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,377,NULL,5163,NULL,NULL),(5167,NULL,NULL,NULL,'4. Backwash the softener with potable water to make sure all sanitizing solution is thoroughly rinsed from the unit before returning the system to service. Return system to service. Follow the manufacturers directions for re-installation of new pre-filters, membrane element and post filter.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,378,NULL,5163,NULL,NULL),(5168,NULL,NULL,'Water Softeners ','Sanitization must occur after initial installation, after the system is serviced and periodically during its use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,390,1,NULL,NULL,4212),(5169,NULL,NULL,NULL,'1. Unit must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.) ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,391,NULL,5168,NULL,NULL),(5170,NULL,NULL,NULL,'2. Backwash the softener and add a solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product to the brine tank well. {{BrineTank}} {{Note}} ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,392,NULL,5168,NULL,NULL),(5171,NULL,NULL,NULL,'3. Proceed with the normal regeneration or interrupt the cycle after the brining step and let the softener soak for a minimum of 1 minute.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,393,NULL,5168,NULL,NULL),(5172,NULL,NULL,NULL,'4. Backwash the softener with potable water to make sure all sanitizing solution is thoroughly rinsed from the unit before returning the system to service. Return system to service. Follow the manufacturers directions for re-installation of new pre-filters, membrane element and post filter.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,394,NULL,5168,NULL,NULL),(5173,NULL,NULL,'Reverse Osmosis (RO) Units  ','Sanitization must occur after initial installation, after the system is serviced and periodically during its use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,395,2,NULL,NULL,4212),(5174,NULL,NULL,NULL,'1. Turn off RO system, drain storage tank and remove membrane element and pre-filters. Put membrane element in a plastic bag so it remains wet. Do not use this product to sanitize the membrane element. Membrane element must be sterilized separately. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,396,NULL,5173,NULL,NULL),(5175,NULL,NULL,NULL,'2. Tank must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.) ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,397,NULL,5173,NULL,NULL),(5176,NULL,NULL,NULL,'3. Fill empty pre-filter housing with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product and turn on raw water. {{Note}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,398,NULL,5173,NULL,NULL),(5177,NULL,NULL,NULL,'4. After holding tank is full, let system stand idle for a minimum of 1 minute. Turn off water. Drain holding tank. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,399,NULL,5173,NULL,NULL),(5178,NULL,NULL,NULL,'5. Before the system is put back into service, flush system with potable water to assure sanitizing solution is rinsed thoroughly from system. Return unit{{s}} to normal operation. Follow the manufacturers directions for re-installation of new pre-filters, membrane element and post filter.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,400,NULL,5173,NULL,NULL),(5179,NULL,NULL,NULL,'1. Hold pre-mixed sanitizer solution of 1 ounce of this product per 5 gal. 4-6 inches away from sole of {{Waterproof}} {{WorkWear}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,401,1,NULL,NULL,4227),(5180,NULL,NULL,NULL,'2. Lightly spray sole to thoroughly wet entire surface',NULL,'NA',NULL,NULL,NULL,NULL,NULL,402,2,NULL,NULL,4227),(5181,NULL,NULL,NULL,'3. Repeat procedure on other sole',NULL,'NA',NULL,NULL,NULL,NULL,NULL,403,3,NULL,NULL,4227),(5182,NULL,NULL,NULL,'4. Treated surfaces must remain wet for 3 minutes',NULL,'NA',NULL,NULL,NULL,NULL,NULL,404,4,NULL,NULL,4227),(5183,NULL,NULL,NULL,'5. [{{AllowToAirDry}} {{{WipeUp}} {{Absorb}} excess product {{WithCleanCloth}} {{BySteppingOnNeatFeetCleanShoeSolutionWelcomeMat}}].',NULL,'NA',NULL,NULL,NULL,NULL,NULL,405,5,NULL,NULL,4227),(5184,NULL,NULL,NULL,'1. Remove all animals. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,406,1,NULL,NULL,4237),(5185,NULL,NULL,NULL,'2. Thoroughly clean all surfaces and objects {caves, cage furniture, feeding and watering dishes, and appliances} including the substrate in the terrarium or cage with soap or detergent and rinse with water. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,407,2,NULL,NULL,4237),(5186,NULL,NULL,NULL,'3. Saturate all hard, non-porous surfaces {such as floors, walls, cages and other washable hard, non-porous surfaces} with the disinfecting and virucidal* solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} {(450 ppm active)} so as to wet thoroughly.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,408,3,NULL,NULL,4237),(5187,NULL,NULL,NULL,'4. Apply by cloth, mop, brush, sponge, auto scrubber or mechanical spray device {{hand pump} coarse pump or trigger spray device} or by immersion. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Rub with brush, cloth, or sponge. For smaller surfaces, use a trigger spray bottle to spray all surfaces with solution.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,409,4,NULL,NULL,4237),(5188,NULL,NULL,NULL,'5. Allow surfaces to remain wet for a period of 10 minutes.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,410,5,NULL,NULL,4237),(5189,NULL,NULL,NULL,'6. Saturate gravel as above and let stand for 10 minutes. Place in bucket of clean water and swirl for 15-30 seconds. Thoroughly air dry before returning to terrarium.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,411,6,NULL,NULL,4237),(5190,NULL,NULL,NULL,'7. Thoroughly scrub all treated surfaces (except gravel) with soap or detergent and rinse with potable water before reuse.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,412,7,NULL,NULL,4237),(5191,NULL,NULL,NULL,'8. Do not return animals to the habitat until it is dry and ventilated.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,413,8,NULL,NULL,4237),(5192,NULL,NULL,NULL,'9. Clean terrarium at least once weekly or more as needed. Change cloth, sponge or towels frequently to avoid redeposition of soil. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,414,9,NULL,NULL,4237),(5193,NULL,NULL,NULL,'10. Prepare a fresh solution daily or more often if use solution becomes visibly soiled or dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,415,10,NULL,NULL,4237),(5194,NULL,NULL,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. {This product can be used to pre-clean or decontaminate critical or semi-critical medical devices prior to sterilization or high-level disinfection.}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,307,NULL,NULL,NULL,4241),(5195,NULL,NULL,NULL,'This product is not for use on medical device surfaces.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,313,NULL,NULL,NULL,4242),(5196,NULL,NULL,'From a Concentrate: ','Add 0.6 oz. of this product directly into the water in the toilet bowl. Brush thoroughly over exposed surfaces and under the rim with a toilet {{BrushMop}}, cloth, or sponge. Allow solution to stand for 10 minutes and flush. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,416,1,NULL,NULL,4253),(5197,NULL,NULL,'From a Use Solution: ','Empty water out of toilet bowl or urinal and apply 0.5 to 1 oz. use solution to exposed surfaces, including under the rim with a toilet {{BrushMop}}, cloth, or sponge, {{SprayDevices}}.  {{SprayApplications}} Brush or swab thoroughly, then allow solution to stand for 10 minutes and flush. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,417,2,NULL,NULL,4253),(5198,NULL,NULL,NULL,'1. Pre-clean heavily soiled areas. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,418,1,NULL,NULL,4257),(5199,NULL,NULL,NULL,'2. Apply use solution of 3 oz. of this product per 5 gal. of water {{450PPM}} {{EquivalentDilution}} to floors, walls and ceilings making sure not to over spray. To disinfect, all hard, non-porous surfaces must remain wet for 10 minutes.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,419,2,NULL,NULL,4257),(5200,NULL,NULL,NULL,'3. Scrub using a deck brush or other coarse material as necessary.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,420,3,NULL,NULL,4257),(5201,NULL,NULL,NULL,'4. Rinse surfaces thoroughly and let air dry.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,421,4,NULL,NULL,4257),(5202,NULL,NULL,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,422,5,NULL,NULL,4257),(5203,NULL,NULL,'Dosage: ','To eliminate odor, add 4  8 oz. of this product in a {{WavelessFree}} waterbed of 90 to 180 gal. capacity. Repeat application every 4 to 6 months. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,423,NULL,NULL,NULL,4264),(5204,NULL,NULL,'Site Preparation: ','The first step in any ongoing sanitation program must be the removal of gross contamination and debris. This may be accomplished by using a shovel, broom, or vacuum, depending on the area to be disinfected.  ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,424,1,NULL,NULL,4282),(5205,NULL,NULL,'Disinfection: ','For heavily soiled areas, pre-clean first. Use {{3Oz}} of this product per 5 gal. of water {{EquivalentDilution}} use solution. Wet all hard, non-porous surfaces thoroughly. Treated surfaces must remain wet for 10 minutes. Let air-dry. Prepare a fresh solution for each use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,425,2,NULL,NULL,4282),(5206,NULL,NULL,'For Heavy Duty Cleaning: ','When heavy duty cleaning is desired, use 6 oz. of this product per 5 gal. of water {{1.25Oz}} {{EquivalentDilution}}. Heavily soiled areas will require repeated cleaning before treatment. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,426,3,NULL,NULL,4282),(5207,NULL,NULL,'DO NOT APPLY TO THE MUSHROOM CROP, COMPOST OR CASING. ','Rinse treated surfaces with potable water before they contact the crop, compost or casing.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,427,4,NULL,NULL,4282),(5208,NULL,NULL,'Preparation of Use Solution:','Apply a use solution of 0.25 oz. of this product per gal. of water {{200PPM}} {{EquivalentDilution}} to sanitize hard, non-porous exterior surfaces such as vinyl, plastic, sealed concrete, painted or sealed woodwork, and sealed stucco. Surfaces to be treated include house siding, decks, patios, walkways and driveways.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,428,1,NULL,NULL,4292),(5209,NULL,NULL,'Application: ','Pre-clean heavily soiled areas. Apply solution with a brush, mop, cloth, sponge, {{AutoScrubber,}} mechanical spray device, {{SprayDevices}}, or with a low-pressure {{LessThan60PSI}} airless sprayer so as to wet all surfaces thoroughly. For sprayer applications, spray 6 inches to 8 inches from surface. Treated surfaces must remain wet for 3 minutes. Wearing suitable respiratory protective equipment and protective eyewear to control exposure to spray, pressure wash surfaces to thoroughly sanitize all treated areas using a high-pressure spray. Do not breathe spray. One-half gal. of diluted product will treat 200-300 sq. ft. of surface. Prepare a fresh solution daily or when visibly dirty. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,429,2,NULL,NULL,4292),(5210,NULL,NULL,'1. Dosing Location: ','This product is to be applied at a point in the system where it will be uniformly mixed, such as at the sump.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,430,1,NULL,NULL,4305),(5211,NULL,NULL,'2. Dosing Conditions: ','This product must be applied when the system is in jeopardy of being affected or after cleaning systems where efficiency is already impaired. Tower bleed off valves must be closed to permit a retention time of 4 hours. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,431,2,NULL,NULL,4305),(5212,NULL,NULL,'3. Method of Application: ',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,432,3,NULL,NULL,4305),(5213,NULL,NULL,'a. INTERMITTENT OR SLUG METHOD','Initial Dose: When the system is noticeably fouled, apply 26.25 fl. oz. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system.\r\n\r\nSubsequent Dose: When microbial control is evident, add 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water in the system weekly or as needed to maintain control. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,433,NULL,5212,NULL,NULL),(5214,NULL,NULL,'b. MODIFIED INTERMITTENT METHOD','Initial Dose: When the system is noticeably fouled, apply 26.25 fl. oz. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system. Apply half of this initial dose when half of the water in the system has been lost by blowdown.\r\n\r\nSubsequent Dose: When control of microbial growth is evident, apply 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water in the system. Apply half of this subsequent dose when half of the water in the system has been lost by blowdown.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,434,NULL,5212,NULL,NULL),(5215,NULL,NULL,'c. CONTINUOUS FEED METHOD ','Initial Dose: When the system is noticeably fouled, apply 26.25. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system.\r\n\r\nSubsequent Dose: Maintain this treatment by starting a continuous feed of 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water lost by blowdown. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,435,NULL,5212,NULL,NULL),(5216,NULL,NULL,'1. Dosing Location:  ','This product is to be applied at a point in the system where it will be uniformly mixed, such as at the sump. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,436,1,NULL,NULL,4306),(5217,NULL,NULL,'2. Dosing Conditions:  ','This product must be applied when the system is in jeopardy of being affected or after cleaning systems where efficiency is already impaired.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,437,2,NULL,NULL,4306),(5218,NULL,NULL,'3. Method Of Applications:',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,438,3,NULL,NULL,4306),(5219,NULL,NULL,'a. ','Wear safety glasses, rubber gloves and impervious apron',NULL,'NA',NULL,NULL,NULL,NULL,NULL,439,NULL,5218,NULL,NULL),(5220,NULL,NULL,'b. ','To reduce foaming, mix 10 parts of water to 1 part of this product',NULL,'NA',NULL,NULL,NULL,NULL,NULL,440,NULL,5218,NULL,NULL),(5221,NULL,NULL,'c. ','{{UseAdd}} 0.75 to 7 fl. oz. of this product {{0.6-6PPM}} per 1,000 gal.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,441,NULL,5218,NULL,NULL),(5222,NULL,NULL,'d. ','Do not discharge without performing proper deactivation. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,442,NULL,5218,NULL,NULL),(5223,NULL,NULL,'e. ','Treatment time cannot exceed 120 hours/application nor exceed 4 times per year.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,443,NULL,5218,NULL,NULL),(5224,NULL,NULL,'f. ','Avoid oxidizers and reducing agents. Product is cationic and must not be mixed with soap or anionic surfactants',NULL,'NA',NULL,NULL,NULL,NULL,NULL,444,NULL,5218,NULL,NULL),(5225,NULL,NULL,'3. Method Of Application: ','INTERMITTENT OR SLUG METHOD',NULL,'NA','Alternate Method of Application language can be used in place of Item #3 directly above.',NULL,'Y',NULL,NULL,445,4,NULL,NULL,4306),(5226,NULL,NULL,'Initial Dose:  ','When the system is noticeably fouled, apply 0.75 to 7 fl. oz. of this product {(0.6 to 6 ppm on an active basis)} per 1,000 gal. of water based on system flow rates. The minimum treatment is 6 to 24 hours. Repeat until control is achieved. Deactivation must be conducted prior to discharge from the system by using bentonite clay at a minimum ratio of 5 ppm clay to 1 ppm product. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,446,NULL,5225,NULL,NULL),(5227,NULL,NULL,'Subsequent Dose:  ','When microbial control is evident, add 0.375 to 3.75 fl. oz. of this product {(0.3 to 3 ppm on an active basis)} per 1,000 gal. of water based upon system flow rates on an as needed basis to maintain control. Frequency of feed must be tied to an in-plant monitoring program for macro cowling growth. Deactivation must be conducted prior to discharge from the system by using bentonite clay at a minimum ratio of 5 ppm clay to 1 ppm product.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,447,NULL,5225,NULL,NULL),(5228,NULL,NULL,'OILFIELD INJECTION AND WASTE WATER',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,448,NULL,NULL,NULL,4308),(5229,NULL,NULL,'1. ','Continuous Injection: Add this product at 30 ppm {(22.5 fl. oz. of this product per 1,000 gal. of water)} when system is noticeably fouled. When microbial control is evident, add this product at 15 ppm (30 fl. oz. of this product per 1,000 gal. of water) to maintain control.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,449,NULL,5228,NULL,NULL),(5230,NULL,NULL,'2. ','Batch Treatment: Add this product at 180 ppm {(230 fl. oz. of this product per 1,000 gal. of water)} over a period of 4-6 hours one or more times per week when the system is noticeably fouled. When microbial control is evident, add this product at 90 ppm (115 fl. oz. of this product per 1,000 gal. of water) over a period of 4-6 hours one or more time per week.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,450,NULL,5228,NULL,NULL),(5231,NULL,NULL,'Initial treatment: ','65-1,000 ppm active added to a freshly prepared fluid.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,451,1,NULL,NULL,4312),(5232,NULL,NULL,'Maintenance dosage: ','65-1,000 ppm active so as to maintain control.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,452,2,NULL,NULL,4312),(5233,NULL,NULL,NULL,'Remove {{CapSprayNozzle}} from empty container. Fill empty container with a freshly prepared use-solution. Replace {{CapSprayNozzle}}. Place correct use-dilution label on newly filled container. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,453,1,NULL,NULL,4315),(5234,NULL,NULL,NULL,'{{RemoveCap}} Insert cartridge into dispenser. {{SeeDispenserInstructionsForProperPlacementOfCartridge}} {{PressButtonOrTurnKnob}} to dispense {{#InsertAppropriateDilution}} of this product into a {{BucketBottleContainer}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,454,2,NULL,NULL,4315),(5235,NULL,NULL,NULL,'Turn off water to connect {{UnitCartridge}}. Attach water source. Rotate control knob to fill a {{BottleBucket}}. Squeeze handle to dispense {{#AppropriateDilution}}. {{SeeDeviceInstructionManualForMoreInformation.}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,455,3,NULL,NULL,4315),(5236,NULL,NULL,NULL,'Attach sprayer unit to hose. Secure tightly, Check that the sprayer is in the off position. Turn on water. Turn sprayer to on position to dispense {{#AppropriateDilution}}. Spray evenly over surface. When finished turn sprayer to off position and then turn water off. Separate mixing of the concentrate or other application equipment is not required. First ensure the hose faucet is turned off',NULL,'NA',NULL,NULL,NULL,NULL,NULL,456,4,NULL,NULL,4315),(5237,NULL,NULL,'{{HowToUsePackage}}',' This package is designed to be used with dilution control systems only. Open package and connect to {{HoseSystem}} to dispense according to directions on the box. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,457,NULL,NULL,NULL,4316),(5238,NULL,NULL,'How to Assemble Extendable Trigger',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,458,1,NULL,NULL,4318),(5239,NULL,NULL,NULL,'1. Remove cap from bottle.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,459,NULL,5238,NULL,NULL),(5240,NULL,NULL,NULL,'2. Insert end of tube into bottle until new cap meets bottle.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,460,NULL,5238,NULL,NULL),(5241,NULL,NULL,NULL,'3. Twist cap onto bottle until secure.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,461,NULL,5238,NULL,NULL),(5242,NULL,NULL,'How to Spray',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,462,2,NULL,NULL,4318),(5243,NULL,NULL,NULL,'1. Adjust nozzle to ON {{#OnSymbol}} position as indicated on nozzle.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,463,NULL,5242,NULL,NULL),(5244,NULL,NULL,NULL,'2. {{PrimeSprayer}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,464,NULL,5242,NULL,NULL),(5245,NULL,NULL,'After Use','1. Turn nozzle to OFF {{#OffSymbol}} position',NULL,'NA',NULL,NULL,NULL,NULL,NULL,465,3,NULL,NULL,4318),(5246,NULL,NULL,'Shake Well. ','Remove sticker. Open flip cap. Firmly insert red hose tip. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,466,NULL,NULL,NULL,4319),(5247,NULL,NULL,'To Refill Concentrate From Large Containers Into Smaller Containers: ','This product may be used to fill and refill clean, properly labeled containers for dilution elsewhere within your facility. Make sure the small container has been cleaned, dried and properly labeled according to state and local regulations. Also make sure other items (funnels or hand pumps) are properly cleaned and dried. To refill, [{simply pour} {pump product}] from the larger container directly into the smaller one being careful not to spill any product. Keep both containers sealed when not in use.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,467,NULL,NULL,NULL,4322);
