INSERT INTO `s_storagedisposalstatement` VALUES (16,NULL,NULL,'Store in original container in areas inaccessible to children. Do not reuse empty container. (Wrap and) Discard in trash or recycle.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,31,NULL,31,NULL,7),(17,NULL,NULL,'Do not contaminate water, food, or feed by storage or disposal.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,32,1,32,NULL,8),(18,NULL,'Pesticide Storage','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,33,2,33,NULL,8),(19,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture, or rinsate is a violation of Federal law. If these wastes cannot be disposed of by use according to label instructions, contact your State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,34,3,34,NULL,8),(20,NULL,'Container Disposal','(Plastic containers:) Triple rinse (or equivalent). Then offer for recycling or reconditioning, or puncture and dispose of in a sanitary landfill, or incinerate, or if allowed by state and local authorities, burn. If burned, stay out of smoke.\r\n(Fiber Drums With Liner:) Completely empty liner by shaking and tapping sides and bottom to loosen clinging particles. Empty residue into application equipment. Then dispose of liner in a sanitary landfill or by incineration if allowed by state and local authorities. If drum is contaminated and cannot by reused, dispose of in the same manner.\r\n(Metal Container:) Triple rinse (or equivalent). Then offer for recycling or reconditioning or puncture and dispose of in a sanitary landfill, or dispose of by other procedures approved by state and local authorities.\r\n(For Bag-in-Box Containers:) Completely empty bag into application equipment. Dispose of empty bag in a sanitary landfill or by incineration, or if allowed by state and local authorities by burning or dispose of by other procedures approved by state and local authorities. If burned, stay out of smoke.\r\n',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,35,4,35,NULL,8),(71,NULL,'Storage and Disposal','(containers for household/residential use) Store in original container in areas inaccessible to children. Nonrefillable container. Do not reuse or refill this container. Offer for recycling if available.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,42,1,42,NULL,24),(72,NULL,'Storage and Disposal','(containers for commercial, industrial, and institutional use) Do not contaminate water, food, or feed by storage or disposal.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,43,2,43,NULL,24),(73,NULL,'Pesticide Disposal','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,44,3,44,NULL,24),(74,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instruction, contact your local State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,45,4,45,NULL,24),(75,NULL,'Container Handling','(Plastic containers:) Nonrefillable container. Do not reuse or refill this container. Triple rinse container (or equivalent) promptly after emptying. Triple rinse as follows: Fill container 1/4 full with water. Tip container on side and roll it back and forth, ensuring at least one complete revolution for 30 seconds. Stand container on its end and tip it back and forth several times. Turn the container over its other end and tip it back and forth several times. Follow Pesticide Disposal instructions for rinsate disposal. Repeat two more times.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,46,5,46,NULL,24),(242,NULL,'Storage and Disposal','(containers for household/residential use) Store in original container in areas inaccessible to children. Nonrefillable container. Do not reuse or refill this container. Offer for recycling if available.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,62),(243,NULL,'Storage and Disposal','(containers for commercial, industrial, and institutional use) Do not contaminate water, food, or feed by storage or disposal.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,62),(244,NULL,'Pesticide Disposal','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,62),(245,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instruction, contact your local State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,62),(246,NULL,'Container Handling','(Plastic containers:) Nonrefillable container. Do not reuse or refill this container. Triple rinse container (or equivalent) promptly after emptying. Triple rinse as follows: Fill container 1/4 full with water. Tip container on side and roll it back and forth, ensuring at least one complete revolution for 30 seconds. Stand container on its end and tip it back and forth several times. Turn the container over its other end and tip it back and forth several times. Follow Pesticide Disposal instructions for rinsate disposal. Repeat two more times.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,62),(247,NULL,'Storage and Disposal','(containers for household/residential use) Store in original container in areas inaccessible to children. Nonrefillable container. Do not reuse or refill this container. Offer for recycling if available.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,145,1,145,NULL,63),(248,NULL,'Storage and Disposal','(containers for commercial, industrial, and institutional use) Do not contaminate water, food, or feed by storage or disposal.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,146,2,146,NULL,63),(249,NULL,'Pesticide Disposal','Store in original container in areas inaccessible to children. Open dumping is prohibited. Do not reuse empty container.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,147,3,147,NULL,63),(250,NULL,'Pesticide Disposal','Pesticide wastes are acutely hazardous. Improper disposal of excess pesticide, spray mixture or rinsate is a violation of Federal Law. If these wastes cannot be disposed of by use according to label instruction, contact your local State Pesticide or Environmental Control Agency, or the Hazardous Waste representative at the nearest EPA Regional Office for guidance.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,148,4,148,NULL,63),(251,NULL,'Container Handling','(Plastic containers:) Nonrefillable container. Do not reuse or refill this container. Triple rinse container (or equivalent) promptly after emptying. Triple rinse as follows: Fill container 1/4 full with water. Tip container on side and roll it back and forth, ensuring at least one complete revolution for 30 seconds. Stand container on its end and tip it back and forth several times. Turn the container over its other end and tip it back and forth several times. Follow Pesticide Disposal instructions for rinsate disposal. Repeat two more times.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,149,5,149,NULL,63),(255,NULL,'{{ResidentialUse}}','Non-refillable container. Do not reuse or refill this container. Offer for recycling if available or place in trash. ',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,69),(256,NULL,'{{CommercialUse}} ',NULL,NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,69),(257,NULL,'{{Non-refillableContainer}}','Non-Refillable Container. Do not reuse or refill this container. Triple rinse container {{EquivalentUse}} promptly after emptying. Triple rinse as follows: Fill the container ¼ full with water and recap. Shake for 10 seconds. Drain for 10 seconds after the flow begins to drip. Follow Pesticide Disposal instructions for rinsate disposal. Repeat this procedure two more times. Then offer for recycling if available or puncture and dispose of in a sanitary landfill, or by incineration.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,256,NULL,NULL),(273,NULL,'{{ResidentialUse}}','Non-refillable container. Do not reuse or refill this container. Offer for recycling if available or place in trash. ','<=5','Sealed',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,87),(274,NULL,'{{CommercialUse}} ',NULL,'<=5','Non-refillable',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,87),(275,NULL,'{{Non-refillableContainer}}','Non-Refillable Container. Do not reuse or refill this container. Triple rinse container {{EquivalentUse}} promptly after emptying. Triple rinse as follows: Fill the container ¼ full with water and recap. Shake for 10 seconds. Drain for 10 seconds after the flow begins to drip. Follow Pesticide Disposal instructions for rinsate disposal. Repeat this procedure two more times. Then offer for recycling if available or puncture and dispose of in a sanitary landfill, or by incineration.',NULL,NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,274,NULL,NULL),(344,NULL,'{{ResidentialUse}}','Non-refillable container. Do not reuse or refill this container. Offer for recycling if available or place in trash. ','<=5','Seal