INSERT INTO `spld_directionsforusesection` VALUES (441,'Five Gallon Directions of Use',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,0,NULL,26),(444,'One Gallon Directions of Use',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,25),(449,'One Gallon Directions of Use',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,32),(455,'First Line',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,0,NULL,3),(456,'Disinfecting',NULL,'DIRECTIONS FOR DISINFECTlNG: (Bactericidal, Fungicidal, Virucidal)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,0,NULL,4),(457,'Fungicidal',NULL,'FUNGICIDAL DIRECTIONS:',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,0,NULL,5),(458,'Mildewstatic',NULL,'MILDEWSTATIC INSTRUCTIONS:',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,0,NULL,6),(459,'Disinfecting Areas',NULL,'VETERINARY CLINICS / ANIMAL CARE / ANIMAL LIFE SCIENCE LABORATORIES / ZOOS / PET SHOP / KENNELS / BREEDING AND GROOMING ESTABLISHMENTS / EQUINE FARMS DISINFECTION DIRECTIONS:',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,0,NULL,7),(460,'Canine Activity',NULL,'FOR CANINE PARVOVIRUS (AND PORCINE PARVOVIRUS) ACTIVITY:',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,0,NULL,8),(461,'Influenza',NULL,'SPECIAL INSTRUCTIONS FOR INACTIVATING AVIAN INFLUENZA:',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,0,NULL,9),(463,'One Gallon Directions of Use',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,0,NULL,25),(473,'Five Gallon Directions of Use',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,26),(490,'Five Gallon Directions of Use',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,26),(491,'Five Gallon Directions of Use',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,62),(3436,'GENERAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,341,NULL,3283),(3437,'MedicalDevice',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Y',NULL,NULL,2,NULL,NULL,341,NULL,3284),(3438,'DISINFECTANT CLEANER',NULL,'{{DISINFECTANT}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,342,NULL,3285),(3439,'HOSPITAL',NULL,'HOSPITAL/HEALTH CARE/MEDICAL/NON-MEDICAL DISINFECTION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,342,NULL,3286),(3440,'BLOODBORNE PATHOGEN INSTRUCTIONS',NULL,'BLOODBORNE PATHOGEN INSTRUCTIONS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,342,NULL,3287),(3441,'SURGICAL INSTRUMENT PRESOAK',NULL,'SURGICAL INSTRUMENT PRESOAK: ',' {{AddMix}} 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} {{450PPM}}. Place pre-cleaned instruments in solution to presoak surgical instruments for a minimum of 10 minutes, then proceed with normal sterilization proc',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,342,NULL,3288),(3442,'ULTRASONIC BATH DISINFECTANT',NULL,'ULTRASONIC BATH DISINFECTANT DIRECTIONS: ','Pre-clean heavily soiled objects. Use this product to disinfect hard, non-porous non-critical objects compatible with Ultrasonic cleaning units. Pour a fresh solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} directly into bath chamber. Place objects into unit and operate {{ManufacturersDirections}} for a minimum of 10 minutes. Remove objects and rinse with sterile water. Allow to air dry. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,342,NULL,3289),(3443,'NON-POROUS BATH AND THERAPY EQUIPMENT',NULL,'FOR DISINFECTING HARD, NON-POROUS {{SealedFiberglass}} BATH AND THERAPY EQUIPMENT:','Drain the water from the unit. Pre-clean heavily soiled surfaces to {{RemoveBuildups}}. Prepare a use solution by adding {{3oz}} of this product per every 5 gal. of water {{EquivalentUse}} {{450PPM}}.  Refill the unit with the use solution to just cover the intake valve. Briefly start the pump to circulate the solution. Turn off pump. Wash down the unit sides, seat of the chair lift, and all related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 10 minutes for proper disinfection. After the unit has been thoroughly disinfected, drain solution from the unit and rinse all surfaces with fresh water. The unit is ready for reuse.    ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,342,NULL,3290),(3444,'CLEANING AND DISINFECTING PERSONAL PROTECTIVE EQUIPMENT',NULL,'CLEANING AND DISINFECTING HARD, NON-POROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT {{Respirators}}:','Pre-clean equipment, if heavily soiled, to ensure proper surface contact. Prepare a use solution by adding 0.6 oz. of this product per gal. of water {{EquivalentDilution}} {{450PPM}}. Gently mix for uniform use solution. Apply use solution to surfaces of the respirator with a sponge, brush, cloth, mop, {{Immersion}}, {{AutoScrubber}}, {{CleaningEquipment}} Rub with brush, cloth, or sponge. Treated surfaces must remain wet for 10 minutes. Remove excess solution from equipment prior to storage. The user must comply with all OSHA regulations for cleaning respiratory protection equipment (29 CFR § 1910.134).  Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,342,NULL,3291),(3445,'GENERAL DISINFECTION',NULL,'GENERAL DISINFECTION','FOR USE AS A CLEANER/GENERAL DISINFECTANT {{KILL}} ON HARD, NON-POROUS SURFACES: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,343,NULL,3292),(3446,'SANITIZING',NULL,'FOOD CONTACT {{TobaccoEquipment}} SANITIZING DIRECTIONS  ','Prior to application, remove gross food particles and soil by a pre-flush or pre-scrape and when necessary, presoak. Then thoroughly wash or flush objects with a good detergent or compatible cleaner, followed by a potable water rinse before applications of the sanitizing solution.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,344,NULL,3293),(3447,'SANITIZING DILUTION',NULL,'FOOD CONTACT SANITIZING DILUTION TABLE {{FoodContactSurfaces}}:','To prepare a 150, 200, 300 or 400 ppm active solution use the following dilution table. Prepare the correct dilution rate based upon the appropriate use site.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,344,NULL,3294),(3448,'SANITIZE FOOD CONTACT SURFACES',NULL,NULL,'{{FoodContactSurfaces}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,344,NULL,3295),(3449,'U.S. PUBLIC HEALTH SERVICE FOOD SERVICE',NULL,'U.S. PUBLIC HEALTH SERVICE FOOD SERVICE SANITIZATION RECOMMENDATIONS CLEANING AND SANITIZING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,344,NULL,3296),(3450,'WISCONSIN STATE DIVISION OF HEALTH',NULL,'{{WisconsinHealth}} DIRECTIONS FOR EATING ESTABLISHMENTS ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,344,NULL,3297),(3451,'CLOSED LOOP SANITIZING',NULL,'CLOSED LOOP {{Circulation}} SANITIZING {{FoodProcessing}}: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,344,NULL,3298),(3452,'CLEAN-IN-PLACE METHOD ',NULL,'CLEAN-IN-PLACE (CIP) METHOD {{For}} {{Dairy}}, {{DairyFarm}} {{And}} {{FoodProcessing}}: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,344,NULL,3299),(3453,'SANITIZING FOOD PROCESSING EQUIPMENT',NULL,'SANITIZING OF {{Refrigerated}} FOOD PROCESSING EQUIPMENT AND OTHER HARD, NON-POROUS SURFACES IN FOOD CONTACT LOCATIONS: ','For sanitizing {{NonPorousSurfaces}} hard, non-porous food contact surfaces, surfaces must be thoroughly pre-flushed or pre-scraped and, when necessary, presoaked to remove gross food particles.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,344,NULL,3300),(3454,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES',NULL,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES OF {{InteriorNonPorousSurfaces}}',NULL,NULL,NULL,NULL,NULL,NULL,'Y',NULL,NULL,9,NULL,NULL,344,NULL,3301),(3455,'WATER SOFTENERS AND REVERSE OSMOSIS (RO) UNITS',NULL,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES OF WATER SOFTENERS AND REVERSE OSMOSIS (RO) UNITS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,344,NULL,3302),(3456,'BEVERAGE DISPENSING AND SANITARY FILLING EQUIPMENT',NULL,'BEVERAGE DISPENSING AND SANITARY FILLING EQUIPMENT SANITIZER DIRECTIONS:','For sanitizing hard, non-porous bottling or pre-mix dispensing equipment and bottles or cans in the final rinse application. This product is {{ProportionedExteriorApplication}}. Fill equipment with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product. Surfaces must remain wet for at least 1 minute or until operations resume at which time the sanitizing solution must be drained from the system. Allow sanitized surfaces to adequately drain {{AirDry}} before contact with liquid. Do not rinse.   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,344,NULL,3303),(3457,'BEER FERMENTATION',NULL,'{{BeerFermentation}} STORAGE TANK SANITIZER DIRECTIONS: ','For sanitizing hard, non-porous beer fermentation and holding tanks, wine, citrus and food processing storage and holding tanks. Prepare a solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product for mechanical or automated systems. {{ManufacturersDirections}} Surfaces must remain wet for at least 1 minute. Allow sanitized surfaces to adequately drain before contact with {{FoodLiquid}}. Do not rinse. For mechanical operations or automated systems, the used sanitizing solution must not be reused for sanitizing, but can be reused for other purposes such as cleaning.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,344,NULL,3304),(3458,'SANITIZING EGG SHELLS',NULL,'SANITIZING EGG SHELLS INTENDED FOR FOOD DIRECTIONS: ','To sanitize previously cleaned food-grade eggs in shell egg and egg product processing plants, spray with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product. The solution must be warmer than the eggs, but not to exceed 130°F. Wet eggs thoroughly and allow solution to drain. Eggs sanitized with this product must be subjected to a potable water rinse only if they are to be broken immediately for use in the manufacture of egg products. Eggs must be reasonably dry before casing or breaking. The solution must not be re-used for sanitizing eggs. Note: Only clean, whole eggs can be sanitized. Dirty, cracked or punctured eggs cannot be sanitized. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,NULL,NULL,344,NULL,3305),(3459,'TREATMENT OF CONVEYOR BELTS',NULL,'FOR TREATMENT OF [{{MEAT}} {{And}} {{POULTRY}} {{Or}} {{FRUITVEGETABLE}}] {{CONVEYORS_BELTS}}: ','Remove gross food particles and excess soil by a pre-flush or pre-scrape. Wash with a good detergent or compatible cleaner. Rinse equipment thoroughly with potable water and then rinse equipment with a sanitizing solution. During processing apply {{#AppropriateDilution}} {{EquivalentDilution}} of this product to conveyors with suitable feeding equipment. Do not allow this solution to be sprayed directly on food. Controlled volumes of sanitizer are applied to return portion of conveyor through nozzles so located as to permit maximum drainage of sanitizer from equipment and to prevent puddles on top of belt. During interruptions in operation, apply solution using coarse spray equipment to peelers, collators, slicers and saws, and other non-porous conveyor equipment. Allow surfaces to remain wet for at least 1 minute. Conveyors and other equipment must be free of product when applying this coarse spray.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,14,NULL,NULL,344,NULL,3306),(3460,'GLOVE DIP',NULL,'GLOVE DIP SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animal areas and the packaging and storage areas of food plants, dip or soak pre-washed {{PlasticRubber}} non-porous gloved hands in a suitable clean container that contains enough freshly made sanitizing solution to cover the gloved hand area. Do not let sanitizing solution come into contact with exposed skin. Gloved hands must remain wet for at least 1 minute. Do Not Rinse. Prepare sanitizing solution by adding {{#AppropriateDilution}} {{EquivalentDilution}}. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,NULL,NULL,344,NULL,3307),(3461,'GLOVE SPRAY',NULL,'GLOVE SPRAY SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animals areas and the packaging and storage areas of food plants, spray pre-washed {{PlasticRubber}} gloves thoroughly to ensure sanitizing solution covers the exterior surfaces of the gloves prior to {{UsageWearing}} using a coarse spray device. Do not let sanitizing solution come into contact with exposed skin. After applying solution, allow gloves to remain wet for at least 1 minute. Let air dry thoroughly before wearing gloves. Do not rinse. Prepare sanitizing solution by adding (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}}. Prepare a fresh solution daily.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,NULL,NULL,344,NULL,3308),(3462,'GLOVE DIP/SPRAY',NULL,'GLOVE DIP/SPRAY SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animals areas and the packaging and storage areas of food plants, dip, soak or spray pre-washed {{PlasticSynthetic}} gloves thoroughly to ensure sanitizing solution covers the exterior surfaces of the gloves prior to {{UsageWearing}}.  For spray applications, use a coarse spray device. Do not let sanitizing solution come into contact with exposed skin. After applying solution, allow gloves to remain wet for at least 1 minute. Let air dry thoroughly before wearing gloves. Do not rinse. Prepare sanitizing solution by adding {{#AppropriateDilution}} {{EquivalentDilution}}. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,17,NULL,NULL,344,NULL,3309),(3463,'NON-FOOD CONTACT SANITIZING DIRECTIONS',NULL,'NON-FOOD CONTACT SANITIZING DIRECTIONS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,NULL,NULL,344,NULL,3310),(3464,'NON-FOOD CONTACT SANITIZING',NULL,'NON-FOOD CONTACT SANITIZING:','Pre-clean heavily soiled surfaces. Add {{OneOzPacket}} of this product per 5 gal. of water {{150PPM}} {{EquivalentDilution}}. Apply solution to hard, non-porous surfaces with a sponge, brush, cloth, mop, {{ByImmersion}}, {{AutoScrubber}}, {{SprayDevices}}. Treated surfaces must remain wet for 3 minutes. Prepare a fresh solution daily or when visibly dirty.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,NULL,NULL,344,NULL,3311),(3465,'ULTRASONIC BATH',NULL,'ULTRASONIC BATH SANITIZER DIRECTIONS: ','Pre-clean heavily soiled surfaces. Use this product to sanitize hard, non-porous, noncritical objects compatible with Ultrasonic cleaning units. Prepare a use solution of {{OneOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}} directly into bath chamber. Place objects into unit and operate for a minimum of 3 minutes, {{ManufacturersDirections}}. Remove objects and rinse with {{Sterile}} water. {{AirDry}} Prepare a fresh solution daily or when visibly dirty.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,20,NULL,NULL,344,NULL,3312),(3466,'PERSONAL PROTECTIVE EQUIPMENT',NULL,'SANITIZATION OF HARD, NON-POROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT {{RESPIRATORS}}:','Add {{OneOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}}.  Gently mix for uniform solution. Apply solution to surfaces of the respirator with a sponge, brush, cloth, mop, {{ByImmersion}}, {{AutoScrubber}}, {{SprayDevices}} Thoroughly wet all surfaces to be sanitized. Treated surfaces must remain wet for 3 minutes. Remove excess solution from equipment prior to storage. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,21,NULL,NULL,344,NULL,3313),(3467,'SHOE/BOOT',NULL,'{{SHOE/BOOT}} {{BATH}} SANITIZER DIRECTIONS: ','To prevent cross contamination {{FromAreas}} shoe baths containing one inch of freshly made sanitizing solution must be placed at all entrances to buildings, hatcheries and at all the entrances to the production and packaging rooms. Scrape waterproof shoes and place in a 1 oz. of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}} use solution {{AllowToRemainWet}} for 3 minutes prior to entering area. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,NULL,NULL,344,NULL,3314),(3468,'FOOT DIP',NULL,'FOR FOOT DIP OF WATER PROOF FOOTWEAR: ','Use this product at 1 oz. per 5 gal. of water in foot dip tray. Shoe baths must contain at least 1 inch of freshly made solution and be placed at the entrances to buildings. Scrape shoes and place in diluted solution {{AllowToRemainWet}} for 3 minutes before entering building. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,23,NULL,NULL,344,NULL,3315),(3469,'SHOE FOAM',NULL,'SHOE FOAM DIRECTIONS:','To prevent cross contamination {{FromAreas}}apply a foam layer approximately 0.5 to 2 inches thick made from a solution of 1 to 1.5 oz. of this product per gal. of water {{EquivalentDilution}} {{800-1200PPM}} at all entrances to buildings, hatcheries, production and packaging rooms by using a foam generating machine or aerator to apply foam layer. Follow the foaming directions as specified by the manufacturer of the foam generator/aerator. Scrape waterproof shoes. Stand and/or walk through foamed area {{AllowToRemainWet}} for 3 minutes prior to entering area. Foam area must be washed and replaced daily or when it appears visibly soiled or dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,24,NULL,NULL,344,NULL,3316),(3470,'SHOE SPRAY',NULL,'SHOE SPRAY SANITIZING DIRECTIONS: ','For heavily soiled {{WorkWear}}, {{ScrapeWipe}} with brush, sponge or cloth or Neat Feet Clean Solution Welcome Mat to remove excess dirt.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,25,NULL,NULL,344,NULL,3317),(3471,'ENTRYWAY',NULL,'ENTRYWAY SANITIZING SYSTEMS: ','To prevent cross contamination from area to area, set the system to deliver 1.25  2.5 oz. of this product per 2.5 gal. of water {{EquivalentDilution}} {{400-800PPM}} of sanitizing solution. The {{SprayFoam}} must cover the entire path of the doorway. Set the system so that a continuous wet blanket of sanitizer solution is delivered to the floor.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,26,NULL,NULL,344,NULL,3318),(3472,'MOLD/MILDEW',NULL,'MOLD/MILDEW {{MILDEWSTATICACTIVITY}}: ','{{ControlMoldMildew}} {{ControlsPrevents}} {{AspergillusNiger}} {{ATCC6275}} {{OdorsCausedByApplication}} Prepare use solution by adding 3 oz. of this product per 5 gal. of water {{0.6OzProduct}} {{EquivalentDilution}}.  Apply use solution to hard, non-porous surfaces for 10 minutes which will effectively inhibit the growth of mold and mildew and their odors.  Repeat treatment every seven days, or more often if new growth appears.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,345,NULL,3319),(3473,'ATHLETIC EQUIPMENT MOLD AND MILDEW',NULL,'TO CONTROL THE GROWTH OF MOLD AND MILDEW ON NON-POROUS ATHLETIC EQUIPMENT:  ','For use on wrestling and gymnastic mats, athletic mats, exercise equipment, athletic training tables, physical therapy tables, athletic helmets, wrestling/boxing headgear, athletic shoe soles, and other hard, non-porous surfaces. Saturate surfaces with a use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}.  Apply by sponge, brush, cloth, mop, {{Immersion}}, {{SprayDevices}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.  Allow surfaces to remain wet for a period of 10 minutes. Do not use equipment until treatment has been absorbed, set or dried.  Repeat treatment every seven days, or more often if new growth appears. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,345,NULL,3320),(3474,'PLASTIC AND RUBBER STRUCTURES',NULL,'TO CONTROL THE GROWTH OF MOLD AND MILDEW ON LARGE, INFLATABLE, NON-POROUS PLASTIC AND RUBBER STRUCTURES:','For use on nonporous plastic and rubber surfaces such as inflatable animals, promotional items, moonwalks, slides, obstacle course play and exercise equipment. Thoroughly clean all surfaces with soap or detergent and rinse with water. Apply a use solution of {{ThreeOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} by sponge, brush, cloth, mop, {{SprayDevices}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.  Allow surfaces to remain wet for a period of 10 minutes. Do not use equipment until treatment has dried. Repeat treatment every seven days, or more often if new growth appears. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,345,NULL,3321),(3475,'HUMIDIFIER BACTERIA/ALGAE',NULL,'HUMIDIFIER BACTERIA/ALGAE TREATMENT (Not for use in CA):','Formulated for use in portable {{Evaporative}} humidifiers. Thoroughly clean the hard, non-porous surfaces of the water tank and filters before each heating season, or sooner if necessary. For every gallon of water in the humidifier tank, add 0.2 ounce of this product (or equivalent use dilution). When you refill the tank, add 0.2 oz. of this product for every gallon of water added in the tank {{EquivalentDilution}}. {{RinseWipeAirDry}}.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,345,NULL,3322),(3476,'Prior To Use',NULL,NULL,'Prior to use of this product, remove all animals {{Poultry}} and feeds from {{{PremisesAreas}}, animal transportation vehicles {{Trucks,Cars}}, and enclosures {{Coops,Crates,Kennels,Stables}}. Remove all litter, droppings and manure from floors, walls and surfaces of barns, pens, stalls, chutes and other surfaces of facilities and fixtures occupied or traversed by animals. Empty all troughs, racks and other feeding and watering appliances. Thoroughly clean surfaces with soap or detergent and rinse with water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,346,NULL,3323),(3477,'ANIMAL PREMISE DISINFECTANT/VIRUCIDE*',NULL,'FOR USE AS AN ANIMAL PREMISE DISINFECTANT/VIRUCIDE*: ','Apply a use solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} to disinfect hard, non-porous surfaces with a sponge, brush, cloth, {by immersion}, {mechanical spray device,} {{hand pump} coarse pump or trigger spray device}. Immerse all halters and other types of equipment used in handling and restraining animals, as well as forks, shovels, and scrapers used for removing litter and manure in the use solution. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Treated surfaces must remain wet for 10 minutes. Ventilate buildings, coops and other closed spaces. Do not house [{animals} {poultry} {livestock}] or employ equipment until treatment has been absorbed, set or dried. Thoroughly scrub all treated feed racks, troughs, automatic feeders, fountains and waterers and other treated equipment which can contact food or water with soap or detergent, and rinse with potable water before reuse.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,346,NULL,3324),(3478,'HATCHERIES',NULL,'HATCHERIES:','Use to treat hatchers, setters, trays, racks, carts, sexing tables, delivery trucks and other hard surfaces. Use 3 oz. of this product per 5 gal. of water. Leave all treated surfaces wet for 10 minutes or more. Allow to air dry. VEHICLES: Clean all vehicles including mats, crates, cabs, and wheels with water and this product. Use 3 oz. of this product per 5 gal. of water. Apply use solution to treat all vehicles. Leave treated surfaces wet for 10 minutes or more. Allow to air dry.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,346,NULL,3325),(3479,'DRESSING/RENDERING PLANT',NULL,'DRESSING {/RENDERING} PLANT:','Disinfect equipment, utensils, walls and floors in poultry and animal dressing plants. Disinfect offal rooms, exterior walls and loading platforms of dressing plants. Cover or remove all food and packaging materials. Remove all heavy soils prior to application. Saturate all surfaces with a solution of [{3 oz. of this product per 5 gal. of water} {(or equivalent use dilution)} and scrub to loosen all soils. Surfaces must remain wet for 10 minutes, and then be thoroughly rinsed with potable water before operations are resumed. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,346,NULL,3326),(3480,'TERRARIUM AND SMALL ANIMAL CAGE',NULL,'TERRARIUM AND SMALL ANIMAL CAGE AND CAGE FURNITURE DISINFECTION:','{Animals frequently defecate on hot rocks and other hard, non-porous cage furniture items inside your terrarium. This can result in high bacteria and ammonia levels that can lead to possible infection/disease in your animals. When used regularly, this product can eliminate these high bacteria/ammonia levels in your cage and on your cage furniture items.} (Do not use on porous rocks, hot rocks, and driftwood.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,346,NULL,3327),(3481,'REPTILE TANK',NULL,'REPTILE TANK CLEANING AND DISINFECTION DIRECTIONS:  ','Remove all reptiles from the [{enclosure} {tank}] prior to cleaning and disinfecting. Remove all litter or drippings from surfaces. Empty all equipment used for feeding or watering reptiles. Thoroughly clean all surfaces with soap or detergent and rinse with water.  Apply disinfecting and virucidal* solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} {(450 ppm active)} {to hard, non-porous surfaces of the enclosure {tank}}. Apply by cloth, mop, brush, sponge, auto scrubber, mechanical spray device, {{hand pump} coarse pump or trigger spray device} or by immersion until thoroughly wet. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Allow surfaces to remain wet for 10 minutes. Wipe dry {with a paper towel}. Rinse all surfaces that come in contact with food with potable water before reuse. Allow the enclosure {tank} to ventilate for a minimum of 10-15 minutes before replacing the reptiles. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,346,NULL,3328),(3482,' NON-FOOD CONTACT SURFACES IN ANIMAL PREMISES',NULL,'SANITIZER DIRECTIONS FOR NON-FOOD CONTACT SURFACES IN ANIMAL PREMISES ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,346,NULL,3329),(3483,'HOOF TRIMMING EQUIPMENT',NULL,'TO SANITIZE HOOF TRIMMING EQUIPMENT:  ','Prior to application, pre-clean hoof trimming equipment before and after use on each animal with detergent and warm water or compatible cleaner to remove soil using a pre-scrape, pre-flush, or when necessary, pre-soak followed by a potable water rinse. To sanitize, add Add {{OneOzPacket}} of this product per 5 gal. of water {{150PPM}} {{EquivalentDilution}}. Treated surfaces must remain wet for 3 minutes. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,346,NULL,3330),(3484,'MEDICAL',NULL,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. {This product can be used to pre-clean or decontaminate critical or semi-critical medical devices prior to sterilization or high-level disinfection.} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,347,NULL,3331),(3485,'NON-MEDICAL',NULL,'This product is not for use on medical device surfaces.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,347,NULL,3332),(3486,'DILUTION TABLE',NULL,'{{#DILUTION TABLE}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,347,NULL,3333),(3487,'FOGGING FOOD PREMISES',NULL,'{{FoggingFoodPremises}} ','ALL SURFACES MUST BE CLEANED AND DISINFECTED IN ACCORDANCE WITH LABEL DIRECTIONS PRIOR TO FOGGING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,347,NULL,3334),(3488,'DAIRIES, BEVERAGE AND FOOD PROCESSING PLANTS',NULL,'DIRECTIONS FOR FOGGING IN DAIRIES, BEVERAGE AND FOOD PROCESSING PLANTS:','Prior to fogging, food products and packaging material must be removed from the room or carefully protected. After disinfecting, fog desired areas using 1 quart per 1000 cubic feet of room area with a solution containing 1.5 oz. of product per gal. of water {(1,200 ppm active)} {(or equivalent use dilution)}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Vacate the area of all personnel during fogging and for a minimum of 2 hours after fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. All food contact surfaces must be sanitized with an EPA approved food contact sanitizer solution prior to use.  All food contact surfaces must be thoroughly rinsed with potable water prior to sanitizing.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,347,NULL,3335),(3489,'FOGGING POULTRY HOUSES',NULL,'{{FoggingPoultryHouses}}','ALL SURFACES MUST BE CLEANED AND DISINFECTED IN ACCORDANCE WITH LABEL DIRECTIONS PRIOR TO FOGGING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,347,NULL,3336),(3490,' HATCHERY ROOMS',NULL,'TREATMENT OF HATCHERY ROOMS USING FOGGING DEVICES: ','Remove all animals and feed from premises, vehicles and enclosures. Remove all litter and manure from floors, walls and surfaces of the room to be treated. Empty all troughs, racks and other feeding and watering appliances. Thoroughly clean all surfaces with soap or detergent and rinse with water. Close room off so fog is confined to room to be treated. Mix 140 oz. of this product per 2.5 gal. of water {{EquivalentDilution}}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Insert the nozzle of the fogger through a suitable opening into the room. With the setting in maximum output, fog for one minute for each 4000 cubic feet of space in the room. Under no circumstances will a room be entered by anyone within 2 hours of actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. When fogging is completed ventilate buildings and other closed spaces. Do not house {{Livestock}} or employ equipment until treatment has been absorbed or dried. Thoroughly clean all treated surfaces with soap or detergent and rinse with water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,347,NULL,3337),(3491,'INCUBATORS AND HATCHERS',NULL,'TREATMENT OF INCUBATORS AND HATCHERS USING FOGGING DEVICES: ','Only for treatment of setters and hatchers after poultry/chicks/eggs have been removed. Not for treatment of hatchers which contain chicks/eggs. Mix 14.5 oz. of this product per gal. of water {(or equivalent use dilution)}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Fog 3-8 oz. of this into setters and hatchers immediately after transfer. Repeat daily in setters and every 12 hours in hatchers. Discontinue hatcher treatments at least 24 hours prior to pulling the hatch. Do not allow people to contact or breathe this fog. It is acceptable to fog setters and hatchers with a 1.1 oz. of this product per gal. of water solution {(or equivalent use dilution)} on an hourly or every other hour basis. If this is done, fog for 30-90 seconds once per hour or once every two hours. When fogging is complete, ventilate buildings, and other closed spaces. Do not house livestock or employ equipment until treatment has been absorbed or dried. Thoroughly scrub all treated feed racks, mangers, troughs, automatic feeders, fountains and waterers, and other treated equipment with soap or detergent, and rinse with potable water before reuse. Under no circumstances will a room be entered by anyone within two hours of the actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,347,NULL,3338),(3492,'GROOMING IMPLEMENTS',NULL,'FOR USE AS A DISINFECTANT, VIRUCIDE* OF GROOMING CLIPPERS, HAIR CLIPPERS, ELECTRIC SHEARS, BARBER/SALON SHEERS AND OTHER IMPLEMENTS {{InstrumentsTools}}:','{{RemoveParticles}} Immerse pre-cleaned barber/salon tools such as combs, brushes, {{PlasticRollers}} razors, {{ClipperTrimmerBlades}}, {{Tweezers}} manicure/pedicure tools, scissors, and other salon instruments and tools in a use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} for at least 10 minutes. Rinse thoroughly and dry before use. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,348,NULL,3339),(3493,'FOOTBATHS',NULL,'FOR USE AS A DISINFECTANT, VIRUCIDE* OF HARD, NON-POROUS SURFACES IN FOOTBATHS:','To remove body oils, dead tissue, soil and all other buildups or organic matter on surfaces after using the footbath, drain the water and thoroughly clean all surfaces with soap or detergent, then rinse with water. Apply a use solution of 3 oz. of this product per 5 gal. of water  {(or equivalent use dilution)} on all surfaces with a brush, cloth, mop, sponge, {{PumpSpray}}. Brush or swab thoroughly and allow solution to stand for 10 minutes. For spray applications, spray 6-8 inches from surface. Do not breathe spray. After the unit has been thoroughly disinfected, rinse all surfaces with fresh water. The unit is then ready for reuse.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,348,NULL,3340),(3494,'BARBER/SALON NON-FOOD CONTACT SURFACES',NULL,'SANITIZER DIRECTIONS FOR NON-FOOD CONTACT SURFACES IN BARBER/SALON FACILITIES  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,348,NULL,3341),(3495,'BARBER/SALON INSTRUMENTS AND TOOLS',NULL,'TO SANITIZE [{BARBER} {MANICURE} {NAIL} {SALON}] INSTRUMENTS AND TOOLS:','Immerse pre-cleaned barber/salon instruments and tools {{InstrumentsTools}} in a use-solution of 1 oz. of this product per 5 gal. of water {{EquivalentDilution}} for at least 3 minutes. Rinse thoroughly and dry before use. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,348,NULL,3342),(3496,'TOILET BOWL AND URINAL DISINFECTANT/CLEANING',NULL,'NON-ACID TOILET BOWL {{Urinal}} DISINFECTANT {{Cleaning}} DIRECTIONS ','Remove heavy soil prior to disinfection.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,349,NULL,3343),(3497,'HEAVY DUTY CLEANING OF TOILET BOWLS AND URNINALS',NULL,'FOR HEAVY DUTY CLEANING OF TOILET BOWLS AND URNINALS: ','Pre-clean heavily soiled areas. Empty toilet bowl or urinal and apply 1.2 oz. of this product to exposed surfaces including under the rim with toilet {{BrushMop}}, cloth, or sponge, or mechanical spray device, {{SprayDevices}}. To aid in soil removal, allow to soak. For sprayer application, spray 6-8 inches from surface. Brush or swab thoroughly and allow solution to stand for 10 minutes and flush.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,349,NULL,3344),(3498,'DEEP CLEANING URINALS',NULL,'{{Deep}} CLEANING/DISINFECTING {{Waterless}} URINALS: ','Preliminary cleaning is required for heavily soiled surfaces. Remove and properly dispose of cartridge according to manufacturers directions. Deep clean or disinfect the entire urinal by applying 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} directly onto surface. {{BrushScrub}} surfaces and let solution stand for 10 minutes. Wipe surface to clean. Change cartridge as needed. The unit is ready for use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,349,NULL,3345),(3499,'CLEAN WATERLESS URINALS',NULL,'TO CLEAN WATERFREE {{Waterless}} URINALS: ','Remove any debris from the urinal. Spray 0.5 to 1 oz. of use solution onto urinal surface. To prepare use solution: add 0.6 oz. of this product per gal. of water {{EquivalentDilution}} {{450PPM}}. DO NOT spray product directly onto cartridge. Wipe surface to clean. Change cartridge as needed. The unit is ready for use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,349,NULL,3346),(3500,'CLEAN OPEN AREAS WITH FLOOR DRAINS',NULL,'FOR USE TO CLEAN AND DISINFECT SHOWER ROOMS, LOCKER ROOMS AND OTHER LARGE, OPEN AREAS WITH FLOOR DRAINS:  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,349,NULL,3347),(3501,'GENERAL CLEANER/DEODORIZER',NULL,'FOR USE AS A {GENERAL} CLEANER {AND/OR DEODORIZER}: ','Apply use solution of 1.75 oz. of this product per 5 gal. of water to hard, non-porous surfaces. {{RinseWipeAirDry}}. For heavy-duty use, {{AddMix}} 4 oz. of this product per 5 gal. to clean hard, non-porous surfaces. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,350,NULL,3348),(3502,'GENERAL DEODORIZER',NULL,'GENERAL DEODORIZATION','To deodorize, apply 1.75 oz. of this product per 5 gal. of water to hard, non-porous surfaces. {{RinseWipeAirDry}}. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,350,NULL,3349),(3503,'SEPTIC STORAGE TANKS',NULL,'FOR DEODORIZING SEPTIC STORAGE TANKS: ','Pre-clean heavily soiled areas. When tanks are empty, pour 1.75 oz. of this product for every 5 gal. of water in tank on recreational vehicles, campers and boats to control odors. As tank fills with sewage and the vehicle is moving, this solution will mix and provide an adequate deodorizing solution for this use. This product is to be used on gray and black water tanks only. Check with local, state, or federal authorities before disposing of sewage in accordance to federal, state and local regulations for waste disposal. (Not for use in CA.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,350,NULL,3350),(3504,'RV HOLDING TANKS',NULL,'RV HOLDING TANKS/RECREATIONAL VEHICLES: ','For toilet waste and holding tanks, cover bottom of holding tank with water and add 1.75 to 3 oz. of this product per 5 gal. of water to deodorize. If odors return before time to empty, add another 1.75 to 3 oz. per 5 gal. of water to the tank. For kitchen waste, add 1.75 to 3 oz. per 5 gal. of water to gray water tank as needed to control malodors created by dirty dishwater. (Not for use in CA.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,350,NULL,3351),(3505,'AUTOMOTIVE',NULL,'AUTOMOTIVE USES: ','A solution of 1.75 oz. of this product per 5 gal. of water will effectively neutralize {{DampMusty}} odors. Spray or apply onto seats, carpets, headliner and ashtray or into trunk and all vents to eliminate odors from tobacco, food, beverage spills and musty carpet. For sprayer applications, use a coarse spray device. {{WipeAirDry}}.  (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,350,NULL,3352),(3506,'AIR FRESHENER',NULL,'AIR FRESHENER: ','A solution of 1.75 oz. of this product per 5 gal. of water will effectively neutralize {{DampMusty}} odors caused by mildew in storage areas, basements, closets, bathrooms and A/C filters. Spray to eliminate odors from tobacco, food, beverage spills and musty carpet. For sprayer applications, use a coarse spray device. {{WipeAirDry}}.  (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,350,NULL,3353),(3507,'WATERBED CONDITIONER',NULL,'WATERBED CONDITIONER (Not for use in CA.): ','When used as a waterbed conditioner, this product eliminates odor. If bed has not been treated properly, drain bed completely. Add 15 gal. of water, mix vigorously, drain bed again. Fill bed with water and follow dosage directions. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,350,NULL,3354),(3508,'GLASS CLEANING',NULL,'GLASS CLEANING {{Deodorizing}} DIRECTIONS:','Use a 1.75 oz. of this product per 5 gal. of water use solution to clean and deodorize windows, mirrors, and glass surfaces. Use a coarse spray device. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Rub with sponge or cloth. Change cloth, sponge or towels frequently to avoid re-deposition of soil. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,350,NULL,3355),(3509,'FINISHED FLOORS',NULL,'FOR USE AS A CLEANER ON FINISHED FLOORS:  ','To limit gloss reduction, use 1.75 oz. of this product per 5 gal. of water. Apply with a damp mop or auto scrubber. Allow surface to air dry. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,350,NULL,3356),(3510,'CARPET CLEANING',NULL,'CARPET CLEANING',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,350,NULL,3357),(3511,'SPECIAL CARPET CLEANING',NULL,'SPECIAL INSTRUCTIONS FOR CLEANING CARPETS: ','This product can be used to clean carpets in industrial, institutional, commercial and residential areas such as homes, motel & hotel chains, nursing homes, schools and hospitals. For use on wet, cleanable synthetic fibers. Do not use on wool. Vacuum carpet thoroughly prior to cleaning. Test fabric for color fastness. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,350,NULL,3358),(3512,'Portable Extraction Units',NULL,'For Portable Extraction Units: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}}.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,350,NULL,3359),(3513,'Truck Mounted Extraction Machines',NULL,'For Truck Mounted Extraction Machines: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}} and meter at 5 gal. per hour',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,NULL,NULL,350,NULL,3360),(3514,'Rotary Floor Machines',NULL,'For Rotary Floor Machines: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}} and apply at the rate of 300-500 sq. ft. per 1 gal. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,14,NULL,NULL,350,NULL,3361),(3515,'Do not mix',NULL,NULL,'Do not mix this product with other cleaning products. Follow the cleaning procedures specified by the manufacturer of the cleaning equipment. After using this product set the carpet pile and protect the carpet from furniture legs and bases while drying. Do not over wet. If applied to stain resistant nylon carpet, apply a fabric protector according to the carpet manufacturers directions.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,NULL,NULL,350,NULL,3362),(3516,'CARPET HOME',NULL,'CARPET {{Cleaning/Deodorizing}} FOR HOME, INSTITUTIONAL, INDUSTRIAL AND HOSPITAL USE: ','This product {{CleansDeodorizes}} the carpet. It can be used in industrial, institutional, commercial and residential areas such as homes, motels, hotel chains, nursing homes and hospitals. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,NULL,NULL,350,NULL,3363),(3517,'Vacuum carpet thoroughly',NULL,NULL,'Vacuum carpet thoroughly prior to application. Mix 1.1 oz. per gal. of water {{EquivalentDilution}}. Follow the injection and/or extraction procedures as specified for any conventional steam cleaning equipment you are using. For rotary floor machines, mix 1.1 oz. of this product per gal. of water and spray on carpet at a rate of 300-500 sq. ft. per 1 gal.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,17,NULL,NULL,350,NULL,3364),(3518,'Washable synthetic fibers',NULL,NULL,'{{Use}} on washable synthetic fibers. Do not use on wool. Test color fastness of carpet before use. Apply diluted product to a small concealed spot, then rub with a clean white cloth. If color changes or transfers to the cloth, a water-based product must not be used. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,NULL,NULL,350,NULL,3365),(3519,'After using',NULL,NULL,'After using the product, set carpet pile in one direction with a stiff brush. Place aluminum foil under the legs of furniture while carpet is drying. Over-wetting can cause carpet to shrink. Manufacturer assumes no responsibility for over-wetting misuse. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,NULL,NULL,350,NULL,3366),(3520,'SEWER BACKUP & RIVER FLOODING',NULL,'SEWER BACKUP & RIVER FLOODING: ','To use as a deodorizer, dilute 1.1 to 2.2 oz. of this product per gal. of water allowing for the diluting effect of absorbed water within saturated materials. Remove gross filth or heavy soil along with non-salvageable materials. Saturate all affected areas with a mechanical spray device, {{CoarsePumpTriggerSprayDevice}} before and after cleaning and extraction. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Use proper ventilation; open windows. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,351,NULL,3367),(3521,'POROUS MATERIALS',NULL,'CARPETS, CARPET CUSHIONS, UPHOLSTERY, DRAPES AND OTHER POROUS MATERIALS, SUB FLOORS, DRYWALL, TRIM AND FRAME LUMBER, TACKLESS STRIP AND PANELING: ','To use as a deodorizer against water damage, extract the excess water. Test hidden area for colorfastness. Dilute 1.1 to 2.2 oz. of this product per gal. of water, allowing for the diluting effect of absorbed water within saturated materials. Remove gross filth or heavy soil. Apply directly with a mechanical spray device {or coarse pump or trigger spray device} to fully saturate affected materials. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Roll, brush or agitate into materials. Follow with a thorough extraction. Dry rapidly and thoroughly. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,351,NULL,3368),(3522,'WATER/SMOKE DAMAGE',NULL,'{{WaterSmoke}} DAMAGE RESTORATION: ','Effective against odor caused by smoke and water damage for home, institutional, industrial and hospital use. This product is particularly suitable for use in water damage restoration. Dilute 1.1 to 2.2 oz. of this product per gal. of water, allowing for the diluting effect of absorbed water within saturated materials. Saturate affected materials with enough product to remain wet for at least 10 minutes. Use proper ventilation. (Not for use in CA.)   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,351,NULL,3369),(3523,'DROSOPHILA SPP. AND PHORIDAE FAMILY OF FLIES',NULL,'FOR CONTROL OF DROSOPHILA SPP. AND PHORIDAE FAMILY OF FLIES ON NON-FOOD CONTACT SURFACES: ','To control flies on hard, non-porous non-food contact surfaces such as floors, walls, countertops, metal surfaces, painted surfaces, glazed porcelain, glazed tile, glass, chrome, rubber, and plastic in restaurants, bars, kitchens, dishwashing areas, and bar and wait station areas and other food storage areas. After removing gross filth, apply a solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} to surfaces and locations where flies breed. Spray surfaces thoroughly or apply by pouring, mopping or sponging onto the surface. Allow surface to remain wet for 10 minutes. Repeat application 1-2 times per week or as needed. Do not contaminate food and food packaging.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,352,NULL,3370),(3524,'SMALL FLIES IN DRAINS',NULL,'FOR CONTROL OF SMALL FLIES IN DRAINS:  ','For control of small flies: Drosophila spp. and the Phoridae family. Spray or pour solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} into the drain during time of lowest level of drain use. Add 14 oz. of use solution daily to each drain to maintain fly control. Apply product around the edge of the drain and thoroughly coat inside of drain. Repeat application 1-2 times per week or as needed. Do not contaminate food and food packaging.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,352,NULL,3371),(3525,'MUSHROOM FARM INDUSTRY',NULL,'MUSHROOM FARM INDUSTRY USE DIRECTIONS ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,352,NULL,3372),(3526,'CITRUS CANKER CONTROL',NULL,'CITRUS CANKER CONTROL (Not For Use in CA): ','For prevention of Citrus Canker Disease through treatment of pre-cleaned equipment. Effective against Xanthomonas axonopodis pv. citri {{CitrusCanker}} at 2000 ppm active. Treatment can be applied to trucks, attached trailers, field harvesting equipment, including cargo area, wheels, tires, undercarriage, hood, roof, fenders and any other hard, non-porous part of equipment that can be taken into infested areas. Thoroughly clean all surfaces with soap or detergent and rinse with water. Then saturate surfaces with a use dilution of 2.5 oz. of this product per gal. of water {{EquivalentDilution}} {{2000PPM}} for a period of 10 minutes. Allow to air dry. All surfaces that come in contact with food or crop must be rinsed with potable water before reuse. To prevent the spread of Citrus Canker Disease by this artificial means of transportation, treatments are made by trigger spraying, dipping or brushing. Clothing must be either thoroughly rinsed or laundered before reuse. Footwear must be rinsed before reuse. Prepare a fresh solution daily or when visibly dirty',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,352,NULL,3373),(3527,'WHIRLPOOL UNITS DISINFECTION/VIRUCIDE*',NULL,'DISINFECTION/VIRUCIDE* OF HARD, NON-POROUS SURFACES IN WHIRLPOOL UNITS: ','After using the whirlpool unit, drain unit. Prepare a use solution of 3 oz. of the product per 5 gal. of water {{EquivalentDilution}} and refill with use solution to just cover intake valves {{2InchesAboveHighestJet}}. Briefly start the pump to circulate the solution. Turn off the pump. Wash down the unit sides, seat of the chair lift and any other related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 10 minutes. After the unit has been thoroughly disinfected, drain the solution from the unit and rinse disinfected surfaces with fresh water. Wipe dry with a clean sponge or cloth or allow to air dry. Repeat for heavy soiled units. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,352,NULL,3374),(3528,'WHIRLPOOL UNITS SANITIZATION',NULL,'SANITIZATION OF HARD, NON-POROUS SURFACES IN WHIRLPOOL UNITS: ','To remove body oils, dead tissue, soil and all other buildups or organic matter on surfaces after using the whirlpool unit, drain unit. Prepare a use solution of 0.25 oz. of this product per gal. of water {{EquivalentDilution}} and refill with use solution to just cover the intake valves {{2InchesAboveHighestJet}}. Briefly start the pump to circulate the solution. Turn off the pump. Wash down the unit sides, seat of the chair lift and any other related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 3 minutes. After the unit has been thoroughly sanitized, drain the solution from the unit and rinse all with fresh water. Repeat for heavy soiled units. Then the unit is ready for reuse.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,352,NULL,3375),(3529,'BAGLESS VACUUM CLEANERS',NULL,'FOR DISINFECTING BAGLESS VACUUM CLEANERS: ','Add 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Turn off and unplug vacuum cleaner. Remove the hard, non-porous container that houses collected material from the vacuum cleaner. Empty contents into a waste receptacle. Rinse collection container with water and wipe clean to remove any additional collected material. Apply use solution to collection container with a brush, cloth, mop, sponge, mechanical spray device, {{{SprayDevices}} so as to wet all surfaces thoroughly. {{SprayerApplications}} Allow surfaces to remain wet for 10 minutes. Wipe up excess liquid with a clean cloth or sponge or allow to air dry. Reattach container to vacuum cleaner. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,352,NULL,3376),(3530,'VACUUM CLEANER BRUSHES',NULL,'FOR DISINFECTING NON-POROUS VACUUM CLEANER BRUSHES: ','Add 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Turn off and unplug vacuum cleaner. Remove the non-porous brushes from vacuum cleaner. Submerge brush in use solution so as to wet all surfaces thoroughly. Allow surfaces to remain wet for 10 minutes. Wipe up excess liquid with a clean cloth or sponge or allow to air dry. Reattach brushes to vacuum cleaner. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,352,NULL,3377),(3531,'COMMERCIAL FLORIST',NULL,'COMMERCIAL FLORIST USE DIRECTIONS: ','To clean, disinfect {{Deodorize}} hard, non-porous surfaces, prepare use solution of 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}}. For heavy-duty use, add 4 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Remove all leaves, petals, garbage and refuse. Pre-clean surfaces using pressurized water where possible. Apply use solution to hard, non-porous surfaces, thoroughly wetting surfaces as required, with a cloth, mop, brush, sponge, {{AutoScrubber,}} or mechanical spray device, {{SprayDevices}}. For sprayer applications, spray 6-8 inches from surface. Rub with brush, sponge, mop or cloth. Do not breathe spray. Treated surfaces must remain wet for 10 minutes. Wipe up excess or allow to air dry. Change cloth, sponge or towels frequently to avoid re-deposition of soil. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,352,NULL,3378),(3532,'WORK AREAS AND BENCHES',NULL,'WORK AREAS AND BENCHES, POTS, FLATS AND FLOWER BUCKETS, CUTTING TOOLS: ','Pre-clean surfaces. {{SpraySwabSoak}} with a solution of 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}} before each work period and again after each plant is completed {{ControlDiseaseTransfer}}. Allow surface to remain wet for 10 minutes. To apply solution as a sprayer application, use as a coarse spray only and spray 6-8 inches from surface. Wipe up excess liquid or allow to air dry. {{DryOilTools}} Prepare a fresh solution daily or when visibly dirty. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,352,NULL,3379),(3533,'CLEANSING OF EXTERIOR BODY SURFACES',NULL,'CLEANSING OF EXTERIOR BODY SURFACES OF {{HumanRemains}}: ','To cleanse away skin secretions and accompanying malodor, to ensure the removal of all soil and bloodstains, and to remove and reduce surface contamination, apply 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}} to the exterior surfaces of the body. Bathe the entire body using sponge or washcloth. A soft brush may be employed on surfaces other than the face. Allow a 10 minute contact time for optimal results. Prepare a fresh solution for each human remain. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,352,NULL,3380),(3534,'KITCHEN/BATHROOM/HOUSEHOLD',NULL,'CLEAN/DISINFECT/DEODORIZE {{KitchenBathroomHousehold}} SURFACES: ','Pre-clean surfaces. Apply a solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} with brush, cloth, mop, sponge, mechanical spray device, {{SprayDevices}}. For spray applications, hold container 6 to 8 inches from surface and spray until thoroughly wet. For disinfection, treated surfaces must remain wet for 10 minutes. Wipe up excess liquid or allow to air dry. Rinse with potable water after use on surfaces that come in contact with food. This product is not to be used to clean or disinfect dishware, glasses or eating utensils. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,353,NULL,3381),(3535,'EXTERIOR HOUSEHOLD SURFACES',NULL,'SANITIZATION OF EXTERIOR HOUSEHOLD SURFACES DIRECTIONS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,353,NULL,3382),(3536,'LAUNDRY',NULL,'COMMERCIAL AND INSTITUTIONAL LAUNDRY USE: ','For residual bacteriostatic activity against gram negative and/or gram positive odor-causing bacteria and/or residual self-sanitizing activity against Klebsiella pneumoniae and Staphylococcus aureus, use this product as directed. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,354,NULL,3383),(3537,'Initial Treatment',NULL,'Initial Treatment:','Use 10 oz. of this product per 100 pounds of fabric (dry weight) {{EquivalentDilution}}. Dilute the appropriate amount of this product in one to two gal. of water, and then add solution to the wash wheel at the beginning of the final rinse cycle. A minimum rinse cycle time of 5 minutes is required',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,354,NULL,3384),(3538,'Repeat Treatment',NULL,'Repeat Treatment: ','Repeat Treatment: Follow Initial Treatment directions and re-treat fabric after each washing {{IfOdorPersists}}. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,354,NULL,3385),(3539,'LAUNDRY BACTERIOSTAT',NULL,'LAUNDRY BACTERIOSTAT FOR COMMERCIAL, INDUSTRIAL, AND NON-MEDICAL INSTITUTIONAL LAUNDRY APPLICATIONS: ','This product provides the fabric with residual bacteriostatic activity against odor causing gram-negative and gram-positive bacteria when added to the final rinse at a rate of 10 oz. of this product per 100 lbs. of dry laundry. This product was evaluated against:  Corynebacterium ammoniagenes {{ATCC6872}} Klebsiella pneumoniae {{ATCC4352}} Staphylococcus aureus {{ATCC6538}} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,354,NULL,3386),(3540,'LAUNDRY DEODORIZER ',NULL,'LAUNDRY DEODORIZER {AGAINST ODOR CAUSING BACTERIA}: ','For activity against odor causing bacteria caused by conditions of high relative humidity or wet contamination, use 12 oz. of this product per 100 pounds of dry weight fabric. Dilute the appropriate amount of this product in one to two gal. of water, and then add to the wash wheel in the final rinse. Re-treat fabric after each washing. Laundered fabric may also be treated by soaking. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,354,NULL,3387),(3541,'PRESERVATION AGAINST MILDEW',NULL,'PRESERVATION AGAINST MILDEW BY SOAKING: ','Use 10 oz. of this product per 100 pounds of fabric (dry weight). A minimum soaking time of 5 minutes is required.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,354,NULL,3388),(3542,'LAUNDRY SANITIZER',NULL,'LAUNDRY SANITIZER: ','When added at the rate of 1 oz. of this product per gal. water {{Yield780PPM}} {{12Oz}} {{EquivalentDilution}} {{780PPM}}, this formulation provides sanitization against Staphylococcus aureus, Klebsiella pneumoniae, Pseudomonas aeruginosa, and Staphylococcus aureus Methicillin Resistant (MRSA) and is effective against HIV-1 in rinse water up to 200 ppm hard water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,354,NULL,3389),(3543,'KILLS HIV-1 ON LAUNDRY',NULL,'KILLS HIV-1 ON LAUNDRY IN COMMERCIAL, INDUSTRIAL AND INSTITUTIONAL APPLICATIONS. ','This product provides virucidal* activity against HIV-1 on fabrics when presoaked with a 4 minute contact time followed by normal washing in detergent and rinsing at a rate of 12 oz. of this product per 100 lbs. of dry laundry in water hardness up to 200 ppm.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,354,NULL,3390),(3544,'LAUNDRY SANITIZING',NULL,'LAUNDRY SANITIZING DIRECTIONS FOR USE: ','For sanitizing step, fill washer to low water level with minimum temperature water of 95°F. Using an appropriate {{#CompanyName}}} dispenser, inject this product into the sanitizing rinse step at the rate of 1 oz. of this product per gal. water {{Yield780PPM}} {{12Oz}} {{780PPM}} {{EquivalentDilution}}. Treat the laundry for a minimum of 5 minutes at a minimum temperature of 95°F. Other laundry additives, such as fabric softeners, laundry sours, starch and sizing must be used per manufacturers instructions in subsequent rinse cycles after the sanitizing rinse cycle.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,354,NULL,3391),(3545,'LAUNDRY FINAL CYCLE',NULL,'LAUNDRY SANITIZING DIRECTIONS FOR USE: ','This product is used in the final, warm rinse cycle at a low water level. Dilute at 1 oz. of this product per gal. of water {{12Oz}} {{780PPM}} {{EquivalentDilution}}, then add to the wash in the final rinse, or dispense directly through automatic dispensing equipment. Run for a minimum of 5 minutes. Retreat as necessary. This product will not harm fabrics. DO NOT USE IN THE PRESENCE OF, OR MIX WITH OTHER CHEMICALS.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,354,NULL,3392),(3546,'SMALL COMMERCIAL WASHING MACHINES',NULL,'FOR USE IN SMALL COMMERCIAL WASHING MACHINES: ','Use the chart below to determine the equivalent use dilution per wash load for use as a Laundry Sanitizer in small commercial washing machines. This is based on 12 oz. of this product per 100 lbs. of dry laundry. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,354,NULL,3393),(3547,'CONSUMER WASHING MACHINES',NULL,'FOR USE IN CONSUMER OR HOUSEHOLD TYPE WASHING MACHINES:',' Use the chart below to determine the equivalent use dilution per wash load for use as a Laundry Sanitizer in consumer or household type washing machines. This is based on 12 oz. of this product per 100 lbs. of dry laundry.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,354,NULL,3394),(3548,'RECIRCULATING COOLING WATER TOWERS',NULL,'INDUSTRIAL {{AND/OR} COMMERCIAL} RECIRCULATING COOLING WATER TOWERS, RETORT WATER SYSTEMS (Not for use in CA.) ','Cooling tower waters that are inherently low in algae growth and bacteria count may be adequately controlled by the lower range of these dosages. Repeat every seven days or increase frequency if needed. Should slime develop again, repeat initial dosage.\r\n\r\nFor best results, clean heavily contaminated systems before treatment with this product. If soap or anionic detergent is used, rinse thoroughly before charging with this algaecide.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,355,NULL,3395),(3549,'ONCE THROUGH WATER COOLING SYSTEM',NULL,'ONCE THROUGH FRESH {{AndSea}} WATER COOLING SYSTEM (Not for use in CA.) ','Use of the product in either public/municipal or single or multiple family private/residential potable/drinking water systems is strictly prohibited. Use of the product in any cooling water system that discharges effluent within 0.25 mile of either a public/municipal or single or multiple family private/residential potable/drinking water intake is strictly prohibited.\r\n\r\nFor best results, slug feed. The frequency of addition of microbiocide needed depends on many factors. To optimize your use of water treatment microbiocide, follow this procedure.   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,355,NULL,3396),(3550,'DEACTIVATION',NULL,'DEACTIVATION: ','Use bentonite clay at the minimum ratio of 5 ppm clay to 1 ppm product. This product must be deactivated prior to discharge of the NPDES outfall. Do not apply this product more than 4 times a year. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,355,NULL,3397),(3551,'OILFIELD INJECTION AND WASTE WATER',NULL,'OILFIELD INJECTION AND WASTE WATER (Not for use in CA.): ','This product must be added to the water handling system at a point of uniform mixing such as the area of addition of makeup water to the holding tank.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,355,NULL,3398),(3552,'GAS PRODUCTION AND TRANSMISSION PIPELINE AND SYSTEMS',NULL,'GAS PRODUCTION AND TRANSMISSION PIPELINE AND SYSTEMS: ','For the control of sulfate-reducing bacteria and slime forming bacteria, this product must be added to a gas production or transmission pipeline via direct injection at a point where uniform and maximum distribution will occur. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,356,NULL,3399),(3553,'GAS STORAGE WELLS AND SYSTEMS',NULL,'GAS STORAGE WELLS AND SYSTEMS: ','Treat individual injection wells with this product to produce an effective concentration of 651000 ppm active. Update treatment rate as needed. This product must be diluted by the water present in the formation. Injection takes place before gas is injected and may be repeated yearly or as needed to maintain control. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,356,NULL,3400),(3554,'PIPELINE PIGGING AND SCRAPING OPERATIONS',NULL,'PIPELINE PIGGING AND SCRAPING OPERATIONS: ','Add this product to slug of water immediately following the scraper {(keep the water volume to a minimum and contained between the scraper and the following pig)}. Add an effective concentration to produce 75-500 ppm depending on the length of the pipeline and the severity of the biofouling. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,356,NULL,3401),(3555,'DRILLING, COMPLETION AND WORKOVER FLUIDS SYSTEMS',NULL,'DRILLING, COMPLETION AND WORKOVER FLUIDS SYSTEMS:','Add to the fluid system at a point of uniform mixing such as circulating mud tank. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,356,NULL,3402),(3556,'PACKER FLUIDS',NULL,'PACKER FLUIDS: ','Add to a packer fluid at a point of uniform mixing such as a circulating holding tank at a rate of 65-1,000 ppm active per 100 barrels of fluid to a freshly prepared fluid depending on the severity of contamination. Seal the fresh packer fluid in the wall between the casing and the production tube. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,356,NULL,3403),(3557,'HYDROTESTING',NULL,'HYDROTESTING: ','Treat water used to hydrotest pipelines or vessels at 65-1,000 ppm active depending on the water quality and length of time the equipment will remain idle. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,356,NULL,3404),(3558,'AUTOMATED DILUTION SYSTEM',NULL,'AUTOMATED DILUTION SYSTEM {{DilutionSystemsTradeName}} INSTRUCTIONS:',NULL,NULL,NULL,NULL,NULL,NULL,'Y',NULL,NULL,1,NULL,NULL,357,NULL,3405),(3559,'BAG-IN BOX CONTAINERS',NULL,'BAG-IN BOX CONTAINERS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,357,NULL,3406),(3560,'COARSE TRIGGER SPRAYERS',NULL,'{{Coarse}} TRIGGER SPRAYERS: Fill bottle from dispenser. {{ApplyAccordingToDirectionsAbove}} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,357,NULL,3407),(3561,'SPRAY USE INSTRUCTIONS',NULL,'SPRAY USE INSTRUCTIONS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,357,NULL,3408),(3562,'Spray Cap container language',NULL,'(Spray Cap container language) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,357,NULL,3409),(3563,'MOP BUCKETS',NULL,'MOP BUCKETS:','Fill bucket from dispenser. Set up Wet Floor signs. Mop floor surfaces as specified in directions above.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,357,NULL,3410),(3564,'PACKETS',NULL,'PACKETS: ','{{SimplyTearOpen}} pour contents into X gal. of water. Keep packets in box until ready to use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,357,NULL,3411),(3565,'REFILLS',NULL,'REFILLS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,357,NULL,3412),(3566,'GENERAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,358,NULL,3283),(3567,'MedicalDevice',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Y',NULL,NULL,2,NULL,NULL,358,NULL,3284),(3568,'DISINFECTANT CLEANER',NULL,'{{DISINFECTANT}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,359,NULL,3285),(3569,'HOSPITAL',NULL,'HOSPITAL/HEALTH CARE/MEDICAL/NON-MEDICAL DISINFECTION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,359,NULL,3286),(3570,'BLOODBORNE PATHOGEN INSTRUCTIONS',NULL,'BLOODBORNE PATHOGEN INSTRUCTIONS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,359,NULL,3287),(3571,'SURGICAL INSTRUMENT PRESOAK',NULL,'SURGICAL INSTRUMENT PRESOAK: ',' {{AddMix}} 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} {{450PPM}}. Place pre-cleaned instruments in solution to presoak surgical instruments for a minimum of 10 minutes, then proceed with normal sterilization proc',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,359,NULL,3288),(3572,'ULTRASONIC BATH DISINFECTANT',NULL,'ULTRASONIC BATH DISINFECTANT DIRECTIONS: ','Pre-clean heavily soiled objects. Use this product to disinfect hard, non-porous non-critical objects compatible with Ultrasonic cleaning units. Pour a fresh solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} directly into bath chamber. Place objects into unit and operate {{ManufacturersDirections}} for a minimum of 10 minutes. Remove objects and rinse with sterile water. Allow to air dry. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,359,NULL,3289),(3573,'NON-POROUS BATH AND THERAPY EQUIPMENT',NULL,'FOR DISINFECTING HARD, NON-POROUS {{SealedFiberglass}} BATH AND THERAPY EQUIPMENT:','Drain the water from the unit. Pre-clean heavily soiled surfaces to {{RemoveBuildups}}. Prepare a use solution by adding {{3oz}} of this product per every 5 gal. of water {{EquivalentUse}} {{450PPM}}.  Refill the unit with the use solution to just cover the intake valve. Briefly start the pump to circulate the solution. Turn off pump. Wash down the unit sides, seat of the chair lift, and all related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 10 minutes for proper disinfection. After the unit has been thoroughly disinfected, drain solution from the unit and rinse all surfaces with fresh water. The unit is ready for reuse.    ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,359,NULL,3290),(3574,'CLEANING AND DISINFECTING PERSONAL PROTECTIVE EQUIPMENT',NULL,'CLEANING AND DISINFECTING HARD, NON-POROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT {{Respirators}}:','Pre-clean equipment, if heavily soiled, to ensure proper surface contact. Prepare a use solution by adding 0.6 oz. of this product per gal. of water {{EquivalentDilution}} {{450PPM}}. Gently mix for uniform use solution. Apply use solution to surfaces of the respirator with a sponge, brush, cloth, mop, {{Immersion}}, {{AutoScrubber}}, {{CleaningEquipment}} Rub with brush, cloth, or sponge. Treated surfaces must remain wet for 10 minutes. Remove excess solution from equipment prior to storage. The user must comply with all OSHA regulations for cleaning respiratory protection equipment (29 CFR § 1910.134).  Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,359,NULL,3291),(3575,'GENERAL DISINFECTION',NULL,'GENERAL DISINFECTION','FOR USE AS A CLEANER/GENERAL DISINFECTANT {{KILL}} ON HARD, NON-POROUS SURFACES: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,360,NULL,3292),(3576,'SANITIZING',NULL,'FOOD CONTACT {{TobaccoEquipment}} SANITIZING DIRECTIONS  ','Prior to application, remove gross food particles and soil by a pre-flush or pre-scrape and when necessary, presoak. Then thoroughly wash or flush objects with a good detergent or compatible cleaner, followed by a potable water rinse before applications of the sanitizing solution.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,361,NULL,3293),(3577,'SANITIZING DILUTION',NULL,'FOOD CONTACT SANITIZING DILUTION TABLE {{FoodContactSurfaces}}:','To prepare a 150, 200, 300 or 400 ppm active solution use the following dilution table. Prepare the correct dilution rate based upon the appropriate use site.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,361,NULL,3294),(3578,'SANITIZE FOOD CONTACT SURFACES',NULL,NULL,'{{FoodContactSurfaces}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,361,NULL,3295),(3579,'U.S. PUBLIC HEALTH SERVICE FOOD SERVICE',NULL,'U.S. PUBLIC HEALTH SERVICE FOOD SERVICE SANITIZATION RECOMMENDATIONS CLEANING AND SANITIZING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,361,NULL,3296),(3580,'WISCONSIN STATE DIVISION OF HEALTH',NULL,'{{WisconsinHealth}} DIRECTIONS FOR EATING ESTABLISHMENTS ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,361,NULL,3297),(3581,'CLOSED LOOP SANITIZING',NULL,'CLOSED LOOP {{Circulation}} SANITIZING {{FoodProcessing}}: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,361,NULL,3298),(3582,'CLEAN-IN-PLACE METHOD ',NULL,'CLEAN-IN-PLACE (CIP) METHOD {{For}} {{Dairy}}, {{DairyFarm}} {{And}} {{FoodProcessing}}: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,361,NULL,3299),(3583,'SANITIZING FOOD PROCESSING EQUIPMENT',NULL,'SANITIZING OF {{Refrigerated}} FOOD PROCESSING EQUIPMENT AND OTHER HARD, NON-POROUS SURFACES IN FOOD CONTACT LOCATIONS: ','For sanitizing {{NonPorousSurfaces}} hard, non-porous food contact surfaces, surfaces must be thoroughly pre-flushed or pre-scraped and, when necessary, presoaked to remove gross food particles.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,361,NULL,3300),(3584,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES',NULL,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES OF {{InteriorNonPorousSurfaces}}',NULL,NULL,NULL,NULL,NULL,NULL,'Y',NULL,NULL,9,NULL,NULL,361,NULL,3301),(3585,'WATER SOFTENERS AND REVERSE OSMOSIS (RO) UNITS',NULL,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES OF WATER SOFTENERS AND REVERSE OSMOSIS (RO) UNITS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,361,NULL,3302),(3586,'BEVERAGE DISPENSING AND SANITARY FILLING EQUIPMENT',NULL,'BEVERAGE DISPENSING AND SANITARY FILLING EQUIPMENT SANITIZER DIRECTIONS:','For sanitizing hard, non-porous bottling or pre-mix dispensing equipment and bottles or cans in the final rinse application. This product is {{ProportionedExteriorApplication}}. Fill equipment with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product. Surfaces must remain wet for at least 1 minute or until operations resume at which time the sanitizing solution must be drained from the system. Allow sanitized surfaces to adequately drain {{AirDry}} before contact with liquid. Do not rinse.   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,361,NULL,3303),(3587,'BEER FERMENTATION',NULL,'{{BeerFermentation}} STORAGE TANK SANITIZER DIRECTIONS: ','For sanitizing hard, non-porous beer fermentation and holding tanks, wine, citrus and food processing storage and holding tanks. Prepare a solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product for mechanical or automated systems. {{ManufacturersDirections}} Surfaces must remain wet for at least 1 minute. Allow sanitized surfaces to adequately drain before contact with {{FoodLiquid}}. Do not rinse. For mechanical operations or automated systems, the used sanitizing solution must not be reused for sanitizing, but can be reused for other purposes such as cleaning.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,361,NULL,3304),(3588,'SANITIZING EGG SHELLS',NULL,'SANITIZING EGG SHELLS INTENDED FOR FOOD DIRECTIONS: ','To sanitize previously cleaned food-grade eggs in shell egg and egg product processing plants, spray with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product. The solution must be warmer than the eggs, but not to exceed 130°F. Wet eggs thoroughly and allow solution to drain. Eggs sanitized with this product must be subjected to a potable water rinse only if they are to be broken immediately for use in the manufacture of egg products. Eggs must be reasonably dry before casing or breaking. The solution must not be re-used for sanitizing eggs. Note: Only clean, whole eggs can be sanitized. Dirty, cracked or punctured eggs cannot be sanitized. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,NULL,NULL,361,NULL,3305),(3589,'TREATMENT OF CONVEYOR BELTS',NULL,'FOR TREATMENT OF [{{MEAT}} {{And}} {{POULTRY}} {{Or}} {{FRUITVEGETABLE}}] {{CONVEYORS_BELTS}}: ','Remove gross food particles and excess soil by a pre-flush or pre-scrape. Wash with a good detergent or compatible cleaner. Rinse equipment thoroughly with potable water and then rinse equipment with a sanitizing solution. During processing apply {{#AppropriateDilution}} {{EquivalentDilution}} of this product to conveyors with suitable feeding equipment. Do not allow this solution to be sprayed directly on food. Controlled volumes of sanitizer are applied to return portion of conveyor through nozzles so located as to permit maximum drainage of sanitizer from equipment and to prevent puddles on top of belt. During interruptions in operation, apply solution using coarse spray equipment to peelers, collators, slicers and saws, and other non-porous conveyor equipment. Allow surfaces to remain wet for at least 1 minute. Conveyors and other equipment must be free of product when applying this coarse spray.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,14,NULL,NULL,361,NULL,3306),(3590,'GLOVE DIP',NULL,'GLOVE DIP SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animal areas and the packaging and storage areas of food plants, dip or soak pre-washed {{PlasticRubber}} non-porous gloved hands in a suitable clean container that contains enough freshly made sanitizing solution to cover the gloved hand area. Do not let sanitizing solution come into contact with exposed skin. Gloved hands must remain wet for at least 1 minute. Do Not Rinse. Prepare sanitizing solution by adding {{#AppropriateDilution}} {{EquivalentDilution}}. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,NULL,NULL,361,NULL,3307),(3591,'GLOVE SPRAY',NULL,'GLOVE SPRAY SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animals areas and the packaging and storage areas of food plants, spray pre-washed {{PlasticRubber}} gloves thoroughly to ensure sanitizing solution covers the exterior surfaces of the gloves prior to {{UsageWearing}} using a coarse spray device. Do not let sanitizing solution come into contact with exposed skin. After applying solution, allow gloves to remain wet for at least 1 minute. Let air dry thoroughly before wearing gloves. Do not rinse. Prepare sanitizing solution by adding (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}}. Prepare a fresh solution daily.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,NULL,NULL,361,NULL,3308),(3592,'GLOVE DIP/SPRAY',NULL,'GLOVE DIP/SPRAY SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animals areas and the packaging and storage areas of food plants, dip, soak or spray pre-washed {{PlasticSynthetic}} gloves thoroughly to ensure sanitizing solution covers the exterior surfaces of the gloves prior to {{UsageWearing}}.  For spray applications, use a coarse spray device. Do not let sanitizing solution come into contact with exposed skin. After applying solution, allow gloves to remain wet for at least 1 minute. Let air dry thoroughly before wearing gloves. Do not rinse. Prepare sanitizing solution by adding {{#AppropriateDilution}} {{EquivalentDilution}}. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,17,NULL,NULL,361,NULL,3309),(3593,'NON-FOOD CONTACT SANITIZING DIRECTIONS',NULL,'NON-FOOD CONTACT SANITIZING DIRECTIONS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,NULL,NULL,361,NULL,3310),(3594,'NON-FOOD CONTACT SANITIZING',NULL,'NON-FOOD CONTACT SANITIZING:','Pre-clean heavily soiled surfaces. Add {{OneOzPacket}} of this product per 5 gal. of water {{150PPM}} {{EquivalentDilution}}. Apply solution to hard, non-porous surfaces with a sponge, brush, cloth, mop, {{ByImmersion}}, {{AutoScrubber}}, {{SprayDevices}}. Treated surfaces must remain wet for 3 minutes. Prepare a fresh solution daily or when visibly dirty.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,NULL,NULL,361,NULL,3311),(3595,'ULTRASONIC BATH',NULL,'ULTRASONIC BATH SANITIZER DIRECTIONS: ','Pre-clean heavily soiled surfaces. Use this product to sanitize hard, non-porous, noncritical objects compatible with Ultrasonic cleaning units. Prepare a use solution of {{OneOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}} directly into bath chamber. Place objects into unit and operate for a minimum of 3 minutes, {{ManufacturersDirections}}. Remove objects and rinse with {{Sterile}} water. {{AirDry}} Prepare a fresh solution daily or when visibly dirty.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,20,NULL,NULL,361,NULL,3312),(3596,'PERSONAL PROTECTIVE EQUIPMENT',NULL,'SANITIZATION OF HARD, NON-POROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT {{RESPIRATORS}}:','Add {{OneOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}}.  Gently mix for uniform solution. Apply solution to surfaces of the respirator with a sponge, brush, cloth, mop, {{ByImmersion}}, {{AutoScrubber}}, {{SprayDevices}} Thoroughly wet all surfaces to be sanitized. Treated surfaces must remain wet for 3 minutes. Remove excess solution from equipment prior to storage. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,21,NULL,NULL,361,NULL,3313),(3597,'SHOE/BOOT',NULL,'{{SHOE/BOOT}} {{BATH}} SANITIZER DIRECTIONS: ','To prevent cross contamination {{FromAreas}} shoe baths containing one inch of freshly made sanitizing solution must be placed at all entrances to buildings, hatcheries and at all the entrances to the production and packaging rooms. Scrape waterproof shoes and place in a 1 oz. of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}} use solution {{AllowToRemainWet}} for 3 minutes prior to entering area. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,NULL,NULL,361,NULL,3314),(3598,'FOOT DIP',NULL,'FOR FOOT DIP OF WATER PROOF FOOTWEAR: ','Use this product at 1 oz. per 5 gal. of water in foot dip tray. Shoe baths must contain at least 1 inch of freshly made solution and be placed at the entrances to buildings. Scrape shoes and place in diluted solution {{AllowToRemainWet}} for 3 minutes before entering building. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,23,NULL,NULL,361,NULL,3315),(3599,'SHOE FOAM',NULL,'SHOE FOAM DIRECTIONS:','To prevent cross contamination {{FromAreas}}apply a foam layer approximately 0.5 to 2 inches thick made from a solution of 1 to 1.5 oz. of this product per gal. of water {{EquivalentDilution}} {{800-1200PPM}} at all entrances to buildings, hatcheries, production and packaging rooms by using a foam generating machine or aerator to apply foam layer. Follow the foaming directions as specified by the manufacturer of the foam generator/aerator. Scrape waterproof shoes. Stand and/or walk through foamed area {{AllowToRemainWet}} for 3 minutes prior to entering area. Foam area must be washed and replaced daily or when it appears visibly soiled or dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,24,NULL,NULL,361,NULL,3316),(3600,'SHOE SPRAY',NULL,'SHOE SPRAY SANITIZING DIRECTIONS: ','For heavily soiled {{WorkWear}}, {{ScrapeWipe}} with brush, sponge or cloth or Neat Feet Clean Solution Welcome Mat to remove excess dirt.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,25,NULL,NULL,361,NULL,3317),(3601,'ENTRYWAY',NULL,'ENTRYWAY SANITIZING SYSTEMS: ','To prevent cross contamination from area to area, set the system to deliver 1.25  2.5 oz. of this product per 2.5 gal. of water {{EquivalentDilution}} {{400-800PPM}} of sanitizing solution. The {{SprayFoam}} must cover the entire path of the doorway. Set the system so that a continuous wet blanket of sanitizer solution is delivered to the floor.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,26,NULL,NULL,361,NULL,3318),(3602,'MOLD/MILDEW',NULL,'MOLD/MILDEW {{MILDEWSTATICACTIVITY}}: ','{{ControlMoldMildew}} {{ControlsPrevents}} {{AspergillusNiger}} {{ATCC6275}} {{OdorsCausedByApplication}} Prepare use solution by adding 3 oz. of this product per 5 gal. of water {{0.6OzProduct}} {{EquivalentDilution}}.  Apply use solution to hard, non-porous surfaces for 10 minutes which will effectively inhibit the growth of mold and mildew and their odors.  Repeat treatment every seven days, or more often if new growth appears.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,362,NULL,3319),(3603,'ATHLETIC EQUIPMENT MOLD AND MILDEW',NULL,'TO CONTROL THE GROWTH OF MOLD AND MILDEW ON NON-POROUS ATHLETIC EQUIPMENT:  ','For use on wrestling and gymnastic mats, athletic mats, exercise equipment, athletic training tables, physical therapy tables, athletic helmets, wrestling/boxing headgear, athletic shoe soles, and other hard, non-porous surfaces. Saturate surfaces with a use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}.  Apply by sponge, brush, cloth, mop, {{Immersion}}, {{SprayDevices}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.  Allow surfaces to remain wet for a period of 10 minutes. Do not use equipment until treatment has been absorbed, set or dried.  Repeat treatment every seven days, or more often if new growth appears. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,362,NULL,3320),(3604,'PLASTIC AND RUBBER STRUCTURES',NULL,'TO CONTROL THE GROWTH OF MOLD AND MILDEW ON LARGE, INFLATABLE, NON-POROUS PLASTIC AND RUBBER STRUCTURES:','For use on nonporous plastic and rubber surfaces such as inflatable animals, promotional items, moonwalks, slides, obstacle course play and exercise equipment. Thoroughly clean all surfaces with soap or detergent and rinse with water. Apply a use solution of {{ThreeOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} by sponge, brush, cloth, mop, {{SprayDevices}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.  Allow surfaces to remain wet for a period of 10 minutes. Do not use equipment until treatment has dried. Repeat treatment every seven days, or more often if new growth appears. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,362,NULL,3321),(3605,'HUMIDIFIER BACTERIA/ALGAE',NULL,'HUMIDIFIER BACTERIA/ALGAE TREATMENT (Not for use in CA):','Formulated for use in portable {{Evaporative}} humidifiers. Thoroughly clean the hard, non-porous surfaces of the water tank and filters before each heating season, or sooner if necessary. For every gallon of water in the humidifier tank, add 0.2 ounce of this product (or equivalent use dilution). When you refill the tank, add 0.2 oz. of this product for every gallon of water added in the tank {{EquivalentDilution}}. {{RinseWipeAirDry}}.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,362,NULL,3322),(3606,'Prior To Use',NULL,NULL,'Prior to use of this product, remove all animals {{Poultry}} and feeds from {{{PremisesAreas}}, animal transportation vehicles {{Trucks,Cars}}, and enclosures {{Coops,Crates,Kennels,Stables}}. Remove all litter, droppings and manure from floors, walls and surfaces of barns, pens, stalls, chutes and other surfaces of facilities and fixtures occupied or traversed by animals. Empty all troughs, racks and other feeding and watering appliances. Thoroughly clean surfaces with soap or detergent and rinse with water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,363,NULL,3323),(3607,'ANIMAL PREMISE DISINFECTANT/VIRUCIDE*',NULL,'FOR USE AS AN ANIMAL PREMISE DISINFECTANT/VIRUCIDE*: ','Apply a use solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} to disinfect hard, non-porous surfaces with a sponge, brush, cloth, {by immersion}, {mechanical spray device,} {{hand pump} coarse pump or trigger spray device}. Immerse all halters and other types of equipment used in handling and restraining animals, as well as forks, shovels, and scrapers used for removing litter and manure in the use solution. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Treated surfaces must remain wet for 10 minutes. Ventilate buildings, coops and other closed spaces. Do not house [{animals} {poultry} {livestock}] or employ equipment until treatment has been absorbed, set or dried. Thoroughly scrub all treated feed racks, troughs, automatic feeders, fountains and waterers and other treated equipment which can contact food or water with soap or detergent, and rinse with potable water before reuse.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,363,NULL,3324),(3608,'HATCHERIES',NULL,'HATCHERIES:','Use to treat hatchers, setters, trays, racks, carts, sexing tables, delivery trucks and other hard surfaces. Use 3 oz. of this product per 5 gal. of water. Leave all treated surfaces wet for 10 minutes or more. Allow to air dry. VEHICLES: Clean all vehicles including mats, crates, cabs, and wheels with water and this product. Use 3 oz. of this product per 5 gal. of water. Apply use solution to treat all vehicles. Leave treated surfaces wet for 10 minutes or more. Allow to air dry.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,363,NULL,3325),(3609,'DRESSING/RENDERING PLANT',NULL,'DRESSING {/RENDERING} PLANT:','Disinfect equipment, utensils, walls and floors in poultry and animal dressing plants. Disinfect offal rooms, exterior walls and loading platforms of dressing plants. Cover or remove all food and packaging materials. Remove all heavy soils prior to application. Saturate all surfaces with a solution of [{3 oz. of this product per 5 gal. of water} {(or equivalent use dilution)} and scrub to loosen all soils. Surfaces must remain wet for 10 minutes, and then be thoroughly rinsed with potable water before operations are resumed. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,363,NULL,3326),(3610,'TERRARIUM AND SMALL ANIMAL CAGE',NULL,'TERRARIUM AND SMALL ANIMAL CAGE AND CAGE FURNITURE DISINFECTION:','{Animals frequently defecate on hot rocks and other hard, non-porous cage furniture items inside your terrarium. This can result in high bacteria and ammonia levels that can lead to possible infection/disease in your animals. When used regularly, this product can eliminate these high bacteria/ammonia levels in your cage and on your cage furniture items.} (Do not use on porous rocks, hot rocks, and driftwood.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,363,NULL,3327),(3611,'REPTILE TANK',NULL,'REPTILE TANK CLEANING AND DISINFECTION DIRECTIONS:  ','Remove all reptiles from the [{enclosure} {tank}] prior to cleaning and disinfecting. Remove all litter or drippings from surfaces. Empty all equipment used for feeding or watering reptiles. Thoroughly clean all surfaces with soap or detergent and rinse with water.  Apply disinfecting and virucidal* solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} {(450 ppm active)} {to hard, non-porous surfaces of the enclosure {tank}}. Apply by cloth, mop, brush, sponge, auto scrubber, mechanical spray device, {{hand pump} coarse pump or trigger spray device} or by immersion until thoroughly wet. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Allow surfaces to remain wet for 10 minutes. Wipe dry {with a paper towel}. Rinse all surfaces that come in contact with food with potable water before reuse. Allow the enclosure {tank} to ventilate for a minimum of 10-15 minutes before replacing the reptiles. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,363,NULL,3328),(3612,' NON-FOOD CONTACT SURFACES IN ANIMAL PREMISES',NULL,'SANITIZER DIRECTIONS FOR NON-FOOD CONTACT SURFACES IN ANIMAL PREMISES ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,363,NULL,3329),(3613,'HOOF TRIMMING EQUIPMENT',NULL,'TO SANITIZE HOOF TRIMMING EQUIPMENT:  ','Prior to application, pre-clean hoof trimming equipment before and after use on each animal with detergent and warm water or compatible cleaner to remove soil using a pre-scrape, pre-flush, or when necessary, pre-soak followed by a potable water rinse. To sanitize, add Add {{OneOzPacket}} of this product per 5 gal. of water {{150PPM}} {{EquivalentDilution}}. Treated surfaces must remain wet for 3 minutes. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,363,NULL,3330),(3614,'MEDICAL',NULL,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. {This product can be used to pre-clean or decontaminate critical or semi-critical medical devices prior to sterilization or high-level disinfection.} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,364,NULL,3331),(3615,'NON-MEDICAL',NULL,'This product is not for use on medical device surfaces.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,364,NULL,3332),(3616,'DILUTION TABLE',NULL,'{{#DILUTION TABLE}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,364,NULL,3333),(3617,'FOGGING FOOD PREMISES',NULL,'{{FoggingFoodPremises}} ','ALL SURFACES MUST BE CLEANED AND DISINFECTED IN ACCORDANCE WITH LABEL DIRECTIONS PRIOR TO FOGGING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,364,NULL,3334),(3618,'DAIRIES, BEVERAGE AND FOOD PROCESSING PLANTS',NULL,'DIRECTIONS FOR FOGGING IN DAIRIES, BEVERAGE AND FOOD PROCESSING PLANTS:','Prior to fogging, food products and packaging material must be removed from the room or carefully protected. After disinfecting, fog desired areas using 1 quart per 1000 cubic feet of room area with a solution containing 1.5 oz. of product per gal. of water {(1,200 ppm active)} {(or equivalent use dilution)}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Vacate the area of all personnel during fogging and for a minimum of 2 hours after fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. All food contact surfaces must be sanitized with an EPA approved food contact sanitizer solution prior to use.  All food contact surfaces must be thoroughly rinsed with potable water prior to sanitizing.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,364,NULL,3335),(3619,'FOGGING POULTRY HOUSES',NULL,'{{FoggingPoultryHouses}}','ALL SURFACES MUST BE CLEANED AND DISINFECTED IN ACCORDANCE WITH LABEL DIRECTIONS PRIOR TO FOGGING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,364,NULL,3336),(3620,' HATCHERY ROOMS',NULL,'TREATMENT OF HATCHERY ROOMS USING FOGGING DEVICES: ','Remove all animals and feed from premises, vehicles and enclosures. Remove all litter and manure from floors, walls and surfaces of the room to be treated. Empty all troughs, racks and other feeding and watering appliances. Thoroughly clean all surfaces with soap or detergent and rinse with water. Close room off so fog is confined to room to be treated. Mix 140 oz. of this product per 2.5 gal. of water {{EquivalentDilution}}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Insert the nozzle of the fogger through a suitable opening into the room. With the setting in maximum output, fog for one minute for each 4000 cubic feet of space in the room. Under no circumstances will a room be entered by anyone within 2 hours of actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. When fogging is completed ventilate buildings and other closed spaces. Do not house {{Livestock}} or employ equipment until treatment has been absorbed or dried. Thoroughly clean all treated surfaces with soap or detergent and rinse with water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,364,NULL,3337),(3621,'INCUBATORS AND HATCHERS',NULL,'TREATMENT OF INCUBATORS AND HATCHERS USING FOGGING DEVICES: ','Only for treatment of setters and hatchers after poultry/chicks/eggs have been removed. Not for treatment of hatchers which contain chicks/eggs. Mix 14.5 oz. of this product per gal. of water {(or equivalent use dilution)}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Fog 3-8 oz. of this into setters and hatchers immediately after transfer. Repeat daily in setters and every 12 hours in hatchers. Discontinue hatcher treatments at least 24 hours prior to pulling the hatch. Do not allow people to contact or breathe this fog. It is acceptable to fog setters and hatchers with a 1.1 oz. of this product per gal. of water solution {(or equivalent use dilution)} on an hourly or every other hour basis. If this is done, fog for 30-90 seconds once per hour or once every two hours. When fogging is complete, ventilate buildings, and other closed spaces. Do not house livestock or employ equipment until treatment has been absorbed or dried. Thoroughly scrub all treated feed racks, mangers, troughs, automatic feeders, fountains and waterers, and other treated equipment with soap or detergent, and rinse with potable water before reuse. Under no circumstances will a room be entered by anyone within two hours of the actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,364,NULL,3338),(3622,'GROOMING IMPLEMENTS',NULL,'FOR USE AS A DISINFECTANT, VIRUCIDE* OF GROOMING CLIPPERS, HAIR CLIPPERS, ELECTRIC SHEARS, BARBER/SALON SHEERS AND OTHER IMPLEMENTS {{InstrumentsTools}}:','{{RemoveParticles}} Immerse pre-cleaned barber/salon tools such as combs, brushes, {{PlasticRollers}} razors, {{ClipperTrimmerBlades}}, {{Tweezers}} manicure/pedicure tools, scissors, and other salon instruments and tools in a use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} for at least 10 minutes. Rinse thoroughly and dry before use. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,365,NULL,3339),(3623,'FOOTBATHS',NULL,'FOR USE AS A DISINFECTANT, VIRUCIDE* OF HARD, NON-POROUS SURFACES IN FOOTBATHS:','To remove body oils, dead tissue, soil and all other buildups or organic matter on surfaces after using the footbath, drain the water and thoroughly clean all surfaces with soap or detergent, then rinse with water. Apply a use solution of 3 oz. of this product per 5 gal. of water  {(or equivalent use dilution)} on all surfaces with a brush, cloth, mop, sponge, {{PumpSpray}}. Brush or swab thoroughly and allow solution to stand for 10 minutes. For spray applications, spray 6-8 inches from surface. Do not breathe spray. After the unit has been thoroughly disinfected, rinse all surfaces with fresh water. The unit is then ready for reuse.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,365,NULL,3340),(3624,'BARBER/SALON NON-FOOD CONTACT SURFACES',NULL,'SANITIZER DIRECTIONS FOR NON-FOOD CONTACT SURFACES IN BARBER/SALON FACILITIES  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,365,NULL,3341),(3625,'BARBER/SALON INSTRUMENTS AND TOOLS',NULL,'TO SANITIZE [{BARBER} {MANICURE} {NAIL} {SALON}] INSTRUMENTS AND TOOLS:','Immerse pre-cleaned barber/salon instruments and tools {{InstrumentsTools}} in a use-solution of 1 oz. of this product per 5 gal. of water {{EquivalentDilution}} for at least 3 minutes. Rinse thoroughly and dry before use. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,365,NULL,3342),(3626,'TOILET BOWL AND URINAL DISINFECTANT/CLEANING',NULL,'NON-ACID TOILET BOWL {{Urinal}} DISINFECTANT {{Cleaning}} DIRECTIONS ','Remove heavy soil prior to disinfection.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,366,NULL,3343),(3627,'HEAVY DUTY CLEANING OF TOILET BOWLS AND URNINALS',NULL,'FOR HEAVY DUTY CLEANING OF TOILET BOWLS AND URNINALS: ','Pre-clean heavily soiled areas. Empty toilet bowl or urinal and apply 1.2 oz. of this product to exposed surfaces including under the rim with toilet {{BrushMop}}, cloth, or sponge, or mechanical spray device, {{SprayDevices}}. To aid in soil removal, allow to soak. For sprayer application, spray 6-8 inches from surface. Brush or swab thoroughly and allow solution to stand for 10 minutes and flush.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,366,NULL,3344),(3628,'DEEP CLEANING URINALS',NULL,'{{Deep}} CLEANING/DISINFECTING {{Waterless}} URINALS: ','Preliminary cleaning is required for heavily soiled surfaces. Remove and properly dispose of cartridge according to manufacturers directions. Deep clean or disinfect the entire urinal by applying 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} directly onto surface. {{BrushScrub}} surfaces and let solution stand for 10 minutes. Wipe surface to clean. Change cartridge as needed. The unit is ready for use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,366,NULL,3345),(3629,'CLEAN WATERLESS URINALS',NULL,'TO CLEAN WATERFREE {{Waterless}} URINALS: ','Remove any debris from the urinal. Spray 0.5 to 1 oz. of use solution onto urinal surface. To prepare use solution: add 0.6 oz. of this product per gal. of water {{EquivalentDilution}} {{450PPM}}. DO NOT spray product directly onto cartridge. Wipe surface to clean. Change cartridge as needed. The unit is ready for use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,366,NULL,3346),(3630,'CLEAN OPEN AREAS WITH FLOOR DRAINS',NULL,'FOR USE TO CLEAN AND DISINFECT SHOWER ROOMS, LOCKER ROOMS AND OTHER LARGE, OPEN AREAS WITH FLOOR DRAINS:  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,366,NULL,3347),(3631,'GENERAL CLEANER/DEODORIZER',NULL,'FOR USE AS A {GENERAL} CLEANER {AND/OR DEODORIZER}: ','Apply use solution of 1.75 oz. of this product per 5 gal. of water to hard, non-porous surfaces. {{RinseWipeAirDry}}. For heavy-duty use, {{AddMix}} 4 oz. of this product per 5 gal. to clean hard, non-porous surfaces. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,367,NULL,3348),(3632,'GENERAL DEODORIZER',NULL,'GENERAL DEODORIZATION','To deodorize, apply 1.75 oz. of this product per 5 gal. of water to hard, non-porous surfaces. {{RinseWipeAirDry}}. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,367,NULL,3349),(3633,'SEPTIC STORAGE TANKS',NULL,'FOR DEODORIZING SEPTIC STORAGE TANKS: ','Pre-clean heavily soiled areas. When tanks are empty, pour 1.75 oz. of this product for every 5 gal. of water in tank on recreational vehicles, campers and boats to control odors. As tank fills with sewage and the vehicle is moving, this solution will mix and provide an adequate deodorizing solution for this use. This product is to be used on gray and black water tanks only. Check with local, state, or federal authorities before disposing of sewage in accordance to federal, state and local regulations for waste disposal. (Not for use in CA.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,367,NULL,3350),(3634,'RV HOLDING TANKS',NULL,'RV HOLDING TANKS/RECREATIONAL VEHICLES: ','For toilet waste and holding tanks, cover bottom of holding tank with water and add 1.75 to 3 oz. of this product per 5 gal. of water to deodorize. If odors return before time to empty, add another 1.75 to 3 oz. per 5 gal. of water to the tank. For kitchen waste, add 1.75 to 3 oz. per 5 gal. of water to gray water tank as needed to control malodors created by dirty dishwater. (Not for use in CA.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,367,NULL,3351),(3635,'AUTOMOTIVE',NULL,'AUTOMOTIVE USES: ','A solution of 1.75 oz. of this product per 5 gal. of water will effectively neutralize {{DampMusty}} odors. Spray or apply onto seats, carpets, headliner and ashtray or into trunk and all vents to eliminate odors from tobacco, food, beverage spills and musty carpet. For sprayer applications, use a coarse spray device. {{WipeAirDry}}.  (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,367,NULL,3352),(3636,'AIR FRESHENER',NULL,'AIR FRESHENER: ','A solution of 1.75 oz. of this product per 5 gal. of water will effectively neutralize {{DampMusty}} odors caused by mildew in storage areas, basements, closets, bathrooms and A/C filters. Spray to eliminate odors from tobacco, food, beverage spills and musty carpet. For sprayer applications, use a coarse spray device. {{WipeAirDry}}.  (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,367,NULL,3353),(3637,'WATERBED CONDITIONER',NULL,'WATERBED CONDITIONER (Not for use in CA.): ','When used as a waterbed conditioner, this product eliminates odor. If bed has not been treated properly, drain bed completely. Add 15 gal. of water, mix vigorously, drain bed again. Fill bed with water and follow dosage directions. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,367,NULL,3354),(3638,'GLASS CLEANING',NULL,'GLASS CLEANING {{Deodorizing}} DIRECTIONS:','Use a 1.75 oz. of this product per 5 gal. of water use solution to clean and deodorize windows, mirrors, and glass surfaces. Use a coarse spray device. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Rub with sponge or cloth. Change cloth, sponge or towels frequently to avoid re-deposition of soil. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,367,NULL,3355),(3639,'FINISHED FLOORS',NULL,'FOR USE AS A CLEANER ON FINISHED FLOORS:  ','To limit gloss reduction, use 1.75 oz. of this product per 5 gal. of water. Apply with a damp mop or auto scrubber. Allow surface to air dry. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,367,NULL,3356),(3640,'CARPET CLEANING',NULL,'CARPET CLEANING',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,367,NULL,3357),(3641,'SPECIAL CARPET CLEANING',NULL,'SPECIAL INSTRUCTIONS FOR CLEANING CARPETS: ','This product can be used to clean carpets in industrial, institutional, commercial and residential areas such as homes, motel & hotel chains, nursing homes, schools and hospitals. For use on wet, cleanable synthetic fibers. Do not use on wool. Vacuum carpet thoroughly prior to cleaning. Test fabric for color fastness. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,367,NULL,3358),(3642,'Portable Extraction Units',NULL,'For Portable Extraction Units: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}}.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,367,NULL,3359),(3643,'Truck Mounted Extraction Machines',NULL,'For Truck Mounted Extraction Machines: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}} and meter at 5 gal. per hour',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,NULL,NULL,367,NULL,3360),(3644,'Rotary Floor Machines',NULL,'For Rotary Floor Machines: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}} and apply at the rate of 300-500 sq. ft. per 1 gal. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,14,NULL,NULL,367,NULL,3361),(3645,'Do not mix',NULL,NULL,'Do not mix this product with other cleaning products. Follow the cleaning procedures specified by the manufacturer of the cleaning equipment. After using this product set the carpet pile and protect the carpet from furniture legs and bases while drying. Do not over wet. If applied to stain resistant nylon carpet, apply a fabric protector according to the carpet manufacturers directions.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,NULL,NULL,367,NULL,3362),(3646,'CARPET HOME',NULL,'CARPET {{Cleaning/Deodorizing}} FOR HOME, INSTITUTIONAL, INDUSTRIAL AND HOSPITAL USE: ','This product {{CleansDeodorizes}} the carpet. It can be used in industrial, institutional, commercial and residential areas such as homes, motels, hotel chains, nursing homes and hospitals. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,NULL,NULL,367,NULL,3363),(3647,'Vacuum carpet thoroughly',NULL,NULL,'Vacuum carpet thoroughly prior to application. Mix 1.1 oz. per gal. of water {{EquivalentDilution}}. Follow the injection and/or extraction procedures as specified for any conventional steam cleaning equipment you are using. For rotary floor machines, mix 1.1 oz. of this product per gal. of water and spray on carpet at a rate of 300-500 sq. ft. per 1 gal.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,17,NULL,NULL,367,NULL,3364),(3648,'Washable synthetic fibers',NULL,NULL,'{{Use}} on washable synthetic fibers. Do not use on wool. Test color fastness of carpet before use. Apply diluted product to a small concealed spot, then rub with a clean white cloth. If color changes or transfers to the cloth, a water-based product must not be used. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,NULL,NULL,367,NULL,3365),(3649,'After using',NULL,NULL,'After using the product, set carpet pile in one direction with a stiff brush. Place aluminum foil under the legs of furniture while carpet is drying. Over-wetting can cause carpet to shrink. Manufacturer assumes no responsibility for over-wetting misuse. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,NULL,NULL,367,NULL,3366),(3650,'SEWER BACKUP & RIVER FLOODING',NULL,'SEWER BACKUP & RIVER FLOODING: ','To use as a deodorizer, dilute 1.1 to 2.2 oz. of this product per gal. of water allowing for the diluting effect of absorbed water within saturated materials. Remove gross filth or heavy soil along with non-salvageable materials. Saturate all affected areas with a mechanical spray device, {{CoarsePumpTriggerSprayDevice}} before and after cleaning and extraction. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Use proper ventilation; open windows. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,368,NULL,3367),(3651,'POROUS MATERIALS',NULL,'CARPETS, CARPET CUSHIONS, UPHOLSTERY, DRAPES AND OTHER POROUS MATERIALS, SUB FLOORS, DRYWALL, TRIM AND FRAME LUMBER, TACKLESS STRIP AND PANELING: ','To use as a deodorizer against water damage, extract the excess water. Test hidden area for colorfastness. Dilute 1.1 to 2.2 oz. of this product per gal. of water, allowing for the diluting effect of absorbed water within saturated materials. Remove gross filth or heavy soil. Apply directly with a mechanical spray device {or coarse pump or trigger spray device} to fully saturate affected materials. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Roll, brush or agitate into materials. Follow with a thorough extraction. Dry rapidly and thoroughly. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,368,NULL,3368),(3652,'WATER/SMOKE DAMAGE',NULL,'{{WaterSmoke}} DAMAGE RESTORATION: ','Effective against odor caused by smoke and water damage for home, institutional, industrial and hospital use. This product is particularly suitable for use in water damage restoration. Dilute 1.1 to 2.2 oz. of this product per gal. of water, allowing for the diluting effect of absorbed water within saturated materials. Saturate affected materials with enough product to remain wet for at least 10 minutes. Use proper ventilation. (Not for use in CA.)   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,368,NULL,3369),(3653,'DROSOPHILA SPP. AND PHORIDAE FAMILY OF FLIES',NULL,'FOR CONTROL OF DROSOPHILA SPP. AND PHORIDAE FAMILY OF FLIES ON NON-FOOD CONTACT SURFACES: ','To control flies on hard, non-porous non-food contact surfaces such as floors, walls, countertops, metal surfaces, painted surfaces, glazed porcelain, glazed tile, glass, chrome, rubber, and plastic in restaurants, bars, kitchens, dishwashing areas, and bar and wait station areas and other food storage areas. After removing gross filth, apply a solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} to surfaces and locations where flies breed. Spray surfaces thoroughly or apply by pouring, mopping or sponging onto the surface. Allow surface to remain wet for 10 minutes. Repeat application 1-2 times per week or as needed. Do not contaminate food and food packaging.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,369,NULL,3370),(3654,'SMALL FLIES IN DRAINS',NULL,'FOR CONTROL OF SMALL FLIES IN DRAINS:  ','For control of small flies: Drosophila spp. and the Phoridae family. Spray or pour solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} into the drain during time of lowest level of drain use. Add 14 oz. of use solution daily to each drain to maintain fly control. Apply product around the edge of the drain and thoroughly coat inside of drain. Repeat application 1-2 times per week or as needed. Do not contaminate food and food packaging.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,369,NULL,3371),(3655,'MUSHROOM FARM INDUSTRY',NULL,'MUSHROOM FARM INDUSTRY USE DIRECTIONS ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,369,NULL,3372),(3656,'CITRUS CANKER CONTROL',NULL,'CITRUS CANKER CONTROL (Not For Use in CA): ','For prevention of Citrus Canker Disease through treatment of pre-cleaned equipment. Effective against Xanthomonas axonopodis pv. citri {{CitrusCanker}} at 2000 ppm active. Treatment can be applied to trucks, attached trailers, field harvesting equipment, including cargo area, wheels, tires, undercarriage, hood, roof, fenders and any other hard, non-porous part of equipment that can be taken into infested areas. Thoroughly clean all surfaces with soap or detergent and rinse with water. Then saturate surfaces with a use dilution of 2.5 oz. of this product per gal. of water {{EquivalentDilution}} {{2000PPM}} for a period of 10 minutes. Allow to air dry. All surfaces that come in contact with food or crop must be rinsed with potable water before reuse. To prevent the spread of Citrus Canker Disease by this artificial means of transportation, treatments are made by trigger spraying, dipping or brushing. Clothing must be either thoroughly rinsed or laundered before reuse. Footwear must be rinsed before reuse. Prepare a fresh solution daily or when visibly dirty',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,369,NULL,3373),(3657,'WHIRLPOOL UNITS DISINFECTION/VIRUCIDE*',NULL,'DISINFECTION/VIRUCIDE* OF HARD, NON-POROUS SURFACES IN WHIRLPOOL UNITS: ','After using the whirlpool unit, drain unit. Prepare a use solution of 3 oz. of the product per 5 gal. of water {{EquivalentDilution}} and refill with use solution to just cover intake valves {{2InchesAboveHighestJet}}. Briefly start the pump to circulate the solution. Turn off the pump. Wash down the unit sides, seat of the chair lift and any other related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 10 minutes. After the unit has been thoroughly disinfected, drain the solution from the unit and rinse disinfected surfaces with fresh water. Wipe dry with a clean sponge or cloth or allow to air dry. Repeat for heavy soiled units. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,369,NULL,3374),(3658,'WHIRLPOOL UNITS SANITIZATION',NULL,'SANITIZATION OF HARD, NON-POROUS SURFACES IN WHIRLPOOL UNITS: ','To remove body oils, dead tissue, soil and all other buildups or organic matter on surfaces after using the whirlpool unit, drain unit. Prepare a use solution of 0.25 oz. of this product per gal. of water {{EquivalentDilution}} and refill with use solution to just cover the intake valves {{2InchesAboveHighestJet}}. Briefly start the pump to circulate the solution. Turn off the pump. Wash down the unit sides, seat of the chair lift and any other related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 3 minutes. After the unit has been thoroughly sanitized, drain the solution from the unit and rinse all with fresh water. Repeat for heavy soiled units. Then the unit is ready for reuse.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,369,NULL,3375),(3659,'BAGLESS VACUUM CLEANERS',NULL,'FOR DISINFECTING BAGLESS VACUUM CLEANERS: ','Add 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Turn off and unplug vacuum cleaner. Remove the hard, non-porous container that houses collected material from the vacuum cleaner. Empty contents into a waste receptacle. Rinse collection container with water and wipe clean to remove any additional collected material. Apply use solution to collection container with a brush, cloth, mop, sponge, mechanical spray device, {{{SprayDevices}} so as to wet all surfaces thoroughly. {{SprayerApplications}} Allow surfaces to remain wet for 10 minutes. Wipe up excess liquid with a clean cloth or sponge or allow to air dry. Reattach container to vacuum cleaner. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,369,NULL,3376),(3660,'VACUUM CLEANER BRUSHES',NULL,'FOR DISINFECTING NON-POROUS VACUUM CLEANER BRUSHES: ','Add 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Turn off and unplug vacuum cleaner. Remove the non-porous brushes from vacuum cleaner. Submerge brush in use solution so as to wet all surfaces thoroughly. Allow surfaces to remain wet for 10 minutes. Wipe up excess liquid with a clean cloth or sponge or allow to air dry. Reattach brushes to vacuum cleaner. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,369,NULL,3377),(3661,'COMMERCIAL FLORIST',NULL,'COMMERCIAL FLORIST USE DIRECTIONS: ','To clean, disinfect {{Deodorize}} hard, non-porous surfaces, prepare use solution of 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}}. For heavy-duty use, add 4 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Remove all leaves, petals, garbage and refuse. Pre-clean surfaces using pressurized water where possible. Apply use solution to hard, non-porous surfaces, thoroughly wetting surfaces as required, with a cloth, mop, brush, sponge, {{AutoScrubber,}} or mechanical spray device, {{SprayDevices}}. For sprayer applications, spray 6-8 inches from surface. Rub with brush, sponge, mop or cloth. Do not breathe spray. Treated surfaces must remain wet for 10 minutes. Wipe up excess or allow to air dry. Change cloth, sponge or towels frequently to avoid re-deposition of soil. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,369,NULL,3378),(3662,'WORK AREAS AND BENCHES',NULL,'WORK AREAS AND BENCHES, POTS, FLATS AND FLOWER BUCKETS, CUTTING TOOLS: ','Pre-clean surfaces. {{SpraySwabSoak}} with a solution of 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}} before each work period and again after each plant is completed {{ControlDiseaseTransfer}}. Allow surface to remain wet for 10 minutes. To apply solution as a sprayer application, use as a coarse spray only and spray 6-8 inches from surface. Wipe up excess liquid or allow to air dry. {{DryOilTools}} Prepare a fresh solution daily or when visibly dirty. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,369,NULL,3379),(3663,'CLEANSING OF EXTERIOR BODY SURFACES',NULL,'CLEANSING OF EXTERIOR BODY SURFACES OF {{HumanRemains}}: ','To cleanse away skin secretions and accompanying malodor, to ensure the removal of all soil and bloodstains, and to remove and reduce surface contamination, apply 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}} to the exterior surfaces of the body. Bathe the entire body using sponge or washcloth. A soft brush may be employed on surfaces other than the face. Allow a 10 minute contact time for optimal results. Prepare a fresh solution for each human remain. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,369,NULL,3380),(3664,'KITCHEN/BATHROOM/HOUSEHOLD',NULL,'CLEAN/DISINFECT/DEODORIZE {{KitchenBathroomHousehold}} SURFACES: ','Pre-clean surfaces. Apply a solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} with brush, cloth, mop, sponge, mechanical spray device, {{SprayDevices}}. For spray applications, hold container 6 to 8 inches from surface and spray until thoroughly wet. For disinfection, treated surfaces must remain wet for 10 minutes. Wipe up excess liquid or allow to air dry. Rinse with potable water after use on surfaces that come in contact with food. This product is not to be used to clean or disinfect dishware, glasses or eating utensils. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,370,NULL,3381),(3665,'EXTERIOR HOUSEHOLD SURFACES',NULL,'SANITIZATION OF EXTERIOR HOUSEHOLD SURFACES DIRECTIONS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,370,NULL,3382),(3666,'LAUNDRY',NULL,'COMMERCIAL AND INSTITUTIONAL LAUNDRY USE: ','For residual bacteriostatic activity against gram negative and/or gram positive odor-causing bacteria and/or residual self-sanitizing activity against Klebsiella pneumoniae and Staphylococcus aureus, use this product as directed. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,371,NULL,3383),(3667,'Initial Treatment',NULL,'Initial Treatment:','Use 10 oz. of this product per 100 pounds of fabric (dry weight) {{EquivalentDilution}}. Dilute the appropriate amount of this product in one to two gal. of water, and then add solution to the wash wheel at the beginning of the final rinse cycle. A minimum rinse cycle time of 5 minutes is required',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,371,NULL,3384),(3668,'Repeat Treatment',NULL,'Repeat Treatment: ','Repeat Treatment: Follow Initial Treatment directions and re-treat fabric after each washing {{IfOdorPersists}}. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,371,NULL,3385),(3669,'LAUNDRY BACTERIOSTAT',NULL,'LAUNDRY BACTERIOSTAT FOR COMMERCIAL, INDUSTRIAL, AND NON-MEDICAL INSTITUTIONAL LAUNDRY APPLICATIONS: ','This product provides the fabric with residual bacteriostatic activity against odor causing gram-negative and gram-positive bacteria when added to the final rinse at a rate of 10 oz. of this product per 100 lbs. of dry laundry. This product was evaluated against:  Corynebacterium ammoniagenes {{ATCC6872}} Klebsiella pneumoniae {{ATCC4352}} Staphylococcus aureus {{ATCC6538}} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,371,NULL,3386),(3670,'LAUNDRY DEODORIZER ',NULL,'LAUNDRY DEODORIZER {AGAINST ODOR CAUSING BACTERIA}: ','For activity against odor causing bacteria caused by conditions of high relative humidity or wet contamination, use 12 oz. of this product per 100 pounds of dry weight fabric. Dilute the appropriate amount of this product in one to two gal. of water, and then add to the wash wheel in the final rinse. Re-treat fabric after each washing. Laundered fabric may also be treated by soaking. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,371,NULL,3387),(3671,'PRESERVATION AGAINST MILDEW',NULL,'PRESERVATION AGAINST MILDEW BY SOAKING: ','Use 10 oz. of this product per 100 pounds of fabric (dry weight). A minimum soaking time of 5 minutes is required.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,371,NULL,3388),(3672,'LAUNDRY SANITIZER',NULL,'LAUNDRY SANITIZER: ','When added at the rate of 1 oz. of this product per gal. water {{Yield780PPM}} {{12Oz}} {{EquivalentDilution}} {{780PPM}}, this formulation provides sanitization against Staphylococcus aureus, Klebsiella pneumoniae, Pseudomonas aeruginosa, and Staphylococcus aureus Methicillin Resistant (MRSA) and is effective against HIV-1 in rinse water up to 200 ppm hard water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,371,NULL,3389),(3673,'KILLS HIV-1 ON LAUNDRY',NULL,'KILLS HIV-1 ON LAUNDRY IN COMMERCIAL, INDUSTRIAL AND INSTITUTIONAL APPLICATIONS. ','This product provides virucidal* activity against HIV-1 on fabrics when presoaked with a 4 minute contact time followed by normal washing in detergent and rinsing at a rate of 12 oz. of this product per 100 lbs. of dry laundry in water hardness up to 200 ppm.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,371,NULL,3390),(3674,'LAUNDRY SANITIZING',NULL,'LAUNDRY SANITIZING DIRECTIONS FOR USE: ','For sanitizing step, fill washer to low water level with minimum temperature water of 95°F. Using an appropriate {{#CompanyName}}} dispenser, inject this product into the sanitizing rinse step at the rate of 1 oz. of this product per gal. water {{Yield780PPM}} {{12Oz}} {{780PPM}} {{EquivalentDilution}}. Treat the laundry for a minimum of 5 minutes at a minimum temperature of 95°F. Other laundry additives, such as fabric softeners, laundry sours, starch and sizing must be used per manufacturers instructions in subsequent rinse cycles after the sanitizing rinse cycle.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,371,NULL,3391),(3675,'LAUNDRY FINAL CYCLE',NULL,'LAUNDRY SANITIZING DIRECTIONS FOR USE: ','This product is used in the final, warm rinse cycle at a low water level. Dilute at 1 oz. of this product per gal. of water {{12Oz}} {{780PPM}} {{EquivalentDilution}}, then add to the wash in the final rinse, or dispense directly through automatic dispensing equipment. Run for a minimum of 5 minutes. Retreat as necessary. This product will not harm fabrics. DO NOT USE IN THE PRESENCE OF, OR MIX WITH OTHER CHEMICALS.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,371,NULL,3392),(3676,'SMALL COMMERCIAL WASHING MACHINES',NULL,'FOR USE IN SMALL COMMERCIAL WASHING MACHINES: ','Use the chart below to determine the equivalent use dilution per wash load for use as a Laundry Sanitizer in small commercial washing machines. This is based on 12 oz. of this product per 100 lbs. of dry laundry. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,371,NULL,3393),(3677,'CONSUMER WASHING MACHINES',NULL,'FOR USE IN CONSUMER OR HOUSEHOLD TYPE WASHING MACHINES:',' Use the chart below to determine the equivalent use dilution per wash load for use as a Laundry Sanitizer in consumer or household type washing machines. This is based on 12 oz. of this product per 100 lbs. of dry laundry.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,371,NULL,3394),(3678,'RECIRCULATING COOLING WATER TOWERS',NULL,'INDUSTRIAL {{AND/OR} COMMERCIAL} RECIRCULATING COOLING WATER TOWERS, RETORT WATER SYSTEMS (Not for use in CA.) ','Cooling tower waters that are inherently low in algae growth and bacteria count may be adequately controlled by the lower range of these dosages. Repeat every seven days or increase frequency if needed. Should slime develop again, repeat initial dosage.\r\n\r\nFor best results, clean heavily contaminated systems before treatment with this product. If soap or anionic detergent is used, rinse thoroughly before charging with this algaecide.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,372,NULL,3395),(3679,'ONCE THROUGH WATER COOLING SYSTEM',NULL,'ONCE THROUGH FRESH {{AndSea}} WATER COOLING SYSTEM (Not for use in CA.) ','Use of the product in either public/municipal or single or multiple family private/residential potable/drinking water systems is strictly prohibited. Use of the product in any cooling water system that discharges effluent within 0.25 mile of either a public/municipal or single or multiple family private/residential potable/drinking water intake is strictly prohibited.\r\n\r\nFor best results, slug feed. The frequency of addition of microbiocide needed depends on many factors. To optimize your use of water treatment microbiocide, follow this procedure.   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,372,NULL,3396),(3680,'DEACTIVATION',NULL,'DEACTIVATION: ','Use bentonite clay at the minimum ratio of 5 ppm clay to 1 ppm product. This product must be deactivated prior to discharge of the NPDES outfall. Do not apply this product more than 4 times a year. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,372,NULL,3397),(3681,'OILFIELD INJECTION AND WASTE WATER',NULL,'OILFIELD INJECTION AND WASTE WATER (Not for use in CA.): ','This product must be added to the water handling system at a point of uniform mixing such as the area of addition of makeup water to the holding tank.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,372,NULL,3398),(3682,'GAS PRODUCTION AND TRANSMISSION PIPELINE AND SYSTEMS',NULL,'GAS PRODUCTION AND TRANSMISSION PIPELINE AND SYSTEMS: ','For the control of sulfate-reducing bacteria and slime forming bacteria, this product must be added to a gas production or transmission pipeline via direct injection at a point where uniform and maximum distribution will occur. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,373,NULL,3399),(3683,'GAS STORAGE WELLS AND SYSTEMS',NULL,'GAS STORAGE WELLS AND SYSTEMS: ','Treat individual injection wells with this product to produce an effective concentration of 651000 ppm active. Update treatment rate as needed. This product must be diluted by the water present in the formation. Injection takes place before gas is injected and may be repeated yearly or as needed to maintain control. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,373,NULL,3400),(3684,'PIPELINE PIGGING AND SCRAPING OPERATIONS',NULL,'PIPELINE PIGGING AND SCRAPING OPERATIONS: ','Add this product to slug of water immediately following the scraper {(keep the water volume to a minimum and contained between the scraper and the following pig)}. Add an effective concentration to produce 75-500 ppm depending on the length of the pipeline and the severity of the biofouling. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,373,NULL,3401),(3685,'DRILLING, COMPLETION AND WORKOVER FLUIDS SYSTEMS',NULL,'DRILLING, COMPLETION AND WORKOVER FLUIDS SYSTEMS:','Add to the fluid system at a point of uniform mixing such as circulating mud tank. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,373,NULL,3402),(3686,'PACKER FLUIDS',NULL,'PACKER FLUIDS: ','Add to a packer fluid at a point of uniform mixing such as a circulating holding tank at a rate of 65-1,000 ppm active per 100 barrels of fluid to a freshly prepared fluid depending on the severity of contamination. Seal the fresh packer fluid in the wall between the casing and the production tube. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,373,NULL,3403),(3687,'HYDROTESTING',NULL,'HYDROTESTING: ','Treat water used to hydrotest pipelines or vessels at 65-1,000 ppm active depending on the water quality and length of time the equipment will remain idle. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,373,NULL,3404),(3688,'AUTOMATED DILUTION SYSTEM',NULL,'AUTOMATED DILUTION SYSTEM {{DilutionSystemsTradeName}} INSTRUCTIONS:',NULL,NULL,NULL,NULL,NULL,NULL,'Y',NULL,NULL,1,NULL,NULL,374,NULL,3405),(3689,'BAG-IN BOX CONTAINERS',NULL,'BAG-IN BOX CONTAINERS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,374,NULL,3406),(3690,'COARSE TRIGGER SPRAYERS',NULL,'{{Coarse}} TRIGGER SPRAYERS: Fill bottle from dispenser. {{ApplyAccordingToDirectionsAbove}} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,374,NULL,3407),(3691,'SPRAY USE INSTRUCTIONS',NULL,'SPRAY USE INSTRUCTIONS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,374,NULL,3408),(3692,'Spray Cap container language',NULL,'(Spray Cap container language) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,374,NULL,3409),(3693,'MOP BUCKETS',NULL,'MOP BUCKETS:','Fill bucket from dispenser. Set up Wet Floor signs. Mop floor surfaces as specified in directions above.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,374,NULL,3410),(3694,'PACKETS',NULL,'PACKETS: ','{{SimplyTearOpen}} pour contents into X gal. of water. Keep packets in box until ready to use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,374,NULL,3411),(3695,'REFILLS',NULL,'REFILLS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,374,NULL,3412),(5646,'GENERAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,630,NULL,4193),(5647,'MedicalDevice',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Y',NULL,NULL,2,NULL,NULL,630,NULL,4194),(5648,'DISINFECTANT CLEANER',NULL,'{{DISINFECTANT}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,631,NULL,4195),(5649,'HOSPITAL',NULL,'HOSPITAL/HEALTH CARE/MEDICAL/NON-MEDICAL DISINFECTION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,631,NULL,4196),(5650,'BLOODBORNE PATHOGEN INSTRUCTIONS',NULL,'BLOODBORNE PATHOGEN INSTRUCTIONS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,631,NULL,4197),(5651,'SURGICAL INSTRUMENT PRESOAK',NULL,'SURGICAL INSTRUMENT PRESOAK: ',' {{AddMix}} 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} {{450PPM}}. Place pre-cleaned instruments in solution to presoak surgical instruments for a minimum of 10 minutes, then proceed with normal sterilization proc',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,631,NULL,4198),(5652,'ULTRASONIC BATH DISINFECTANT',NULL,'ULTRASONIC BATH DISINFECTANT DIRECTIONS: ','Pre-clean heavily soiled objects. Use this product to disinfect hard, non-porous non-critical objects compatible with Ultrasonic cleaning units. Pour a fresh solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} directly into bath chamber. Place objects into unit and operate {{ManufacturersDirections}} for a minimum of 10 minutes. Remove objects and rinse with sterile water. Allow to air dry. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,631,NULL,4199),(5653,'NON-POROUS BATH AND THERAPY EQUIPMENT',NULL,'FOR DISINFECTING HARD, NON-POROUS {{SealedFiberglass}} BATH AND THERAPY EQUIPMENT:','Drain the water from the unit. Pre-clean heavily soiled surfaces to {{RemoveBuildups}}. Prepare a use solution by adding {{3oz}} of this product per every 5 gal. of water {{EquivalentUse}} {{450PPM}}.  Refill the unit with the use solution to just cover the intake valve. Briefly start the pump to circulate the solution. Turn off pump. Wash down the unit sides, seat of the chair lift, and all related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 10 minutes for proper disinfection. After the unit has been thoroughly disinfected, drain solution from the unit and rinse all surfaces with fresh water. The unit is ready for reuse.    ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,631,NULL,4200),(5654,'CLEANING AND DISINFECTING PERSONAL PROTECTIVE EQUIPMENT',NULL,'CLEANING AND DISINFECTING HARD, NON-POROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT {{Respirators}}:','Pre-clean equipment, if heavily soiled, to ensure proper surface contact. Prepare a use solution by adding 0.6 oz. of this product per gal. of water {{EquivalentDilution}} {{450PPM}}. Gently mix for uniform use solution. Apply use solution to surfaces of the respirator with a sponge, brush, cloth, mop, {{Immersion}}, {{AutoScrubber}}, {{CleaningEquipment}} Rub with brush, cloth, or sponge. Treated surfaces must remain wet for 10 minutes. Remove excess solution from equipment prior to storage. The user must comply with all OSHA regulations for cleaning respiratory protection equipment (29 CFR § 1910.134).  Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,631,NULL,4201),(5655,'GENERAL DISINFECTION',NULL,'GENERAL DISINFECTION','FOR USE AS A CLEANER/GENERAL DISINFECTANT {{KILL}} ON HARD, NON-POROUS SURFACES: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,632,NULL,4202),(5656,'SANITIZING',NULL,'FOOD CONTACT {{TobaccoEquipment}} SANITIZING DIRECTIONS  ','Prior to application, remove gross food particles and soil by a pre-flush or pre-scrape and when necessary, presoak. Then thoroughly wash or flush objects with a good detergent or compatible cleaner, followed by a potable water rinse before applications of the sanitizing solution.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,633,NULL,4203),(5657,'SANITIZING DILUTION',NULL,'FOOD CONTACT SANITIZING DILUTION TABLE {{FoodContactSurfaces}}:','To prepare a 150, 200, 300 or 400 ppm active solution use the following dilution table. Prepare the correct dilution rate based upon the appropriate use site.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,633,NULL,4204),(5658,'SANITIZE FOOD CONTACT SURFACES',NULL,NULL,'{{FoodContactSurfaces}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,633,NULL,4205),(5659,'U.S. PUBLIC HEALTH SERVICE FOOD SERVICE',NULL,'U.S. PUBLIC HEALTH SERVICE FOOD SERVICE SANITIZATION RECOMMENDATIONS CLEANING AND SANITIZING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,633,NULL,4206),(5660,'WISCONSIN STATE DIVISION OF HEALTH',NULL,'{{WisconsinHealth}} DIRECTIONS FOR EATING ESTABLISHMENTS ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,633,NULL,4207),(5661,'CLOSED LOOP SANITIZING',NULL,'CLOSED LOOP {{Circulation}} SANITIZING {{FoodProcessing}}: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,633,NULL,4208),(5662,'CLEAN-IN-PLACE METHOD ',NULL,'CLEAN-IN-PLACE (CIP) METHOD {{For}} {{Dairy}}, {{DairyFarm}} {{And}} {{FoodProcessing}}: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,633,NULL,4209),(5663,'SANITIZING FOOD PROCESSING EQUIPMENT',NULL,'SANITIZING OF {{Refrigerated}} FOOD PROCESSING EQUIPMENT AND OTHER HARD, NON-POROUS SURFACES IN FOOD CONTACT LOCATIONS: ','For sanitizing {{NonPorousSurfaces}} hard, non-porous food contact surfaces, surfaces must be thoroughly pre-flushed or pre-scraped and, when necessary, presoaked to remove gross food particles.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,633,NULL,4210),(5664,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES',NULL,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES OF {{InteriorNonPorousSurfaces}}',NULL,NULL,NULL,NULL,NULL,NULL,'Y',NULL,NULL,9,NULL,NULL,633,NULL,4211),(5665,'WATER SOFTENERS AND REVERSE OSMOSIS (RO) UNITS',NULL,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES OF WATER SOFTENERS AND REVERSE OSMOSIS (RO) UNITS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,633,NULL,4212),(5666,'BEVERAGE DISPENSING AND SANITARY FILLING EQUIPMENT',NULL,'BEVERAGE DISPENSING AND SANITARY FILLING EQUIPMENT SANITIZER DIRECTIONS:','For sanitizing hard, non-porous bottling or pre-mix dispensing equipment and bottles or cans in the final rinse application. This product is {{ProportionedExteriorApplication}}. Fill equipment with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product. Surfaces must remain wet for at least 1 minute or until operations resume at which time the sanitizing solution must be drained from the system. Allow sanitized surfaces to adequately drain {{AirDry}} before contact with liquid. Do not rinse.   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,633,NULL,4213),(5667,'BEER FERMENTATION',NULL,'{{BeerFermentation}} STORAGE TANK SANITIZER DIRECTIONS: ','For sanitizing hard, non-porous beer fermentation and holding tanks, wine, citrus and food processing storage and holding tanks. Prepare a solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product for mechanical or automated systems. {{ManufacturersDirections}} Surfaces must remain wet for at least 1 minute. Allow sanitized surfaces to adequately drain before contact with {{FoodLiquid}}. Do not rinse. For mechanical operations or automated systems, the used sanitizing solution must not be reused for sanitizing, but can be reused for other purposes such as cleaning.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,633,NULL,4214),(5668,'SANITIZING EGG SHELLS',NULL,'SANITIZING EGG SHELLS INTENDED FOR FOOD DIRECTIONS: ','To sanitize previously cleaned food-grade eggs in shell egg and egg product processing plants, spray with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product. The solution must be warmer than the eggs, but not to exceed 130°F. Wet eggs thoroughly and allow solution to drain. Eggs sanitized with this product must be subjected to a potable water rinse only if they are to be broken immediately for use in the manufacture of egg products. Eggs must be reasonably dry before casing or breaking. The solution must not be re-used for sanitizing eggs. Note: Only clean, whole eggs can be sanitized. Dirty, cracked or punctured eggs cannot be sanitized. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,NULL,NULL,633,NULL,4215),(5669,'TREATMENT OF CONVEYOR BELTS',NULL,'FOR TREATMENT OF [{{MEAT}} {{And}} {{POULTRY}} {{Or}} {{FRUITVEGETABLE}}] {{CONVEYORS_BELTS}}: ','Remove gross food particles and excess soil by a pre-flush or pre-scrape. Wash with a good detergent or compatible cleaner. Rinse equipment thoroughly with potable water and then rinse equipment with a sanitizing solution. During processing apply {{#AppropriateDilution}} {{EquivalentDilution}} of this product to conveyors with suitable feeding equipment. Do not allow this solution to be sprayed directly on food. Controlled volumes of sanitizer are applied to return portion of conveyor through nozzles so located as to permit maximum drainage of sanitizer from equipment and to prevent puddles on top of belt. During interruptions in operation, apply solution using coarse spray equipment to peelers, collators, slicers and saws, and other non-porous conveyor equipment. Allow surfaces to remain wet for at least 1 minute. Conveyors and other equipment must be free of product when applying this coarse spray.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,14,NULL,NULL,633,NULL,4216),(5670,'GLOVE DIP',NULL,'GLOVE DIP SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animal areas and the packaging and storage areas of food plants, dip or soak pre-washed {{PlasticRubber}} non-porous gloved hands in a suitable clean container that contains enough freshly made sanitizing solution to cover the gloved hand area. Do not let sanitizing solution come into contact with exposed skin. Gloved hands must remain wet for at least 1 minute. Do Not Rinse. Prepare sanitizing solution by adding {{#AppropriateDilution}} {{EquivalentDilution}}. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,NULL,NULL,633,NULL,4217),(5671,'GLOVE SPRAY',NULL,'GLOVE SPRAY SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animals areas and the packaging and storage areas of food plants, spray pre-washed {{PlasticRubber}} gloves thoroughly to ensure sanitizing solution covers the exterior surfaces of the gloves prior to {{UsageWearing}} using a coarse spray device. Do not let sanitizing solution come into contact with exposed skin. After applying solution, allow gloves to remain wet for at least 1 minute. Let air dry thoroughly before wearing gloves. Do not rinse. Prepare sanitizing solution by adding (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}}. Prepare a fresh solution daily.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,NULL,NULL,633,NULL,4218),(5672,'GLOVE DIP/SPRAY',NULL,'GLOVE DIP/SPRAY SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animals areas and the packaging and storage areas of food plants, dip, soak or spray pre-washed {{PlasticSynthetic}} gloves thoroughly to ensure sanitizing solution covers the exterior surfaces of the gloves prior to {{UsageWearing}}.  For spray applications, use a coarse spray device. Do not let sanitizing solution come into contact with exposed skin. After applying solution, allow gloves to remain wet for at least 1 minute. Let air dry thoroughly before wearing gloves. Do not rinse. Prepare sanitizing solution by adding {{#AppropriateDilution}} {{EquivalentDilution}}. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,17,NULL,NULL,633,NULL,4219),(5673,'NON-FOOD CONTACT SANITIZING DIRECTIONS',NULL,'NON-FOOD CONTACT SANITIZING DIRECTIONS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,NULL,NULL,633,NULL,4220),(5674,'NON-FOOD CONTACT SANITIZING',NULL,'NON-FOOD CONTACT SANITIZING:','Pre-clean heavily soiled surfaces. Add {{OneOzPacket}} of this product per 5 gal. of water {{150PPM}} {{EquivalentDilution}}. Apply solution to hard, non-porous surfaces with a sponge, brush, cloth, mop, {{ByImmersion}}, {{AutoScrubber}}, {{SprayDevices}}. Treated surfaces must remain wet for 3 minutes. Prepare a fresh solution daily or when visibly dirty.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,NULL,NULL,633,NULL,4221),(5675,'ULTRASONIC BATH',NULL,'ULTRASONIC BATH SANITIZER DIRECTIONS: ','Pre-clean heavily soiled surfaces. Use this product to sanitize hard, non-porous, noncritical objects compatible with Ultrasonic cleaning units. Prepare a use solution of {{OneOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}} directly into bath chamber. Place objects into unit and operate for a minimum of 3 minutes, {{ManufacturersDirections}}. Remove objects and rinse with {{Sterile}} water. {{AirDry}} Prepare a fresh solution daily or when visibly dirty.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,20,NULL,NULL,633,NULL,4222),(5676,'PERSONAL PROTECTIVE EQUIPMENT',NULL,'SANITIZATION OF HARD, NON-POROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT {{RESPIRATORS}}:','Add {{OneOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}}.  Gently mix for uniform solution. Apply solution to surfaces of the respirator with a sponge, brush, cloth, mop, {{ByImmersion}}, {{AutoScrubber}}, {{SprayDevices}} Thoroughly wet all surfaces to be sanitized. Treated surfaces must remain wet for 3 minutes. Remove excess solution from equipment prior to storage. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,21,NULL,NULL,633,NULL,4223),(5677,'SHOE/BOOT',NULL,'{{SHOE/BOOT}} {{BATH}} SANITIZER DIRECTIONS: ','To prevent cross contamination {{FromAreas}} shoe baths containing one inch of freshly made sanitizing solution must be placed at all entrances to buildings, hatcheries and at all the entrances to the production and packaging rooms. Scrape waterproof shoes and place in a 1 oz. of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}} use solution {{AllowToRemainWet}} for 3 minutes prior to entering area. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,NULL,NULL,633,NULL,4224),(5678,'FOOT DIP',NULL,'FOR FOOT DIP OF WATER PROOF FOOTWEAR: ','Use this product at 1 oz. per 5 gal. of water in foot dip tray. Shoe baths must contain at least 1 inch of freshly made solution and be placed at the entrances to buildings. Scrape shoes and place in diluted solution {{AllowToRemainWet}} for 3 minutes before entering building. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,23,NULL,NULL,633,NULL,4225),(5679,'SHOE FOAM',NULL,'SHOE FOAM DIRECTIONS:','To prevent cross contamination {{FromAreas}}apply a foam layer approximately 0.5 to 2 inches thick made from a solution of 1 to 1.5 oz. of this product per gal. of water {{EquivalentDilution}} {{800-1200PPM}} at all entrances to buildings, hatcheries, production and packaging rooms by using a foam generating machine or aerator to apply foam layer. Follow the foaming directions as specified by the manufacturer of the foam generator/aerator. Scrape waterproof shoes. Stand and/or walk through foamed area {{AllowToRemainWet}} for 3 minutes prior to entering area. Foam area must be washed and replaced daily or when it appears visibly soiled or dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,24,NULL,NULL,633,NULL,4226),(5680,'SHOE SPRAY',NULL,'SHOE SPRAY SANITIZING DIRECTIONS: ','For heavily soiled {{WorkWear}}, {{ScrapeWipe}} with brush, sponge or cloth or Neat Feet Clean Solution Welcome Mat to remove excess dirt.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,25,NULL,NULL,633,NULL,4227),(5681,'ENTRYWAY',NULL,'ENTRYWAY SANITIZING SYSTEMS: ','To prevent cross contamination from area to area, set the system to deliver 1.25  2.5 oz. of this product per 2.5 gal. of water {{EquivalentDilution}} {{400-800PPM}} of sanitizing solution. The {{SprayFoam}} must cover the entire path of the doorway. Set the system so that a continuous wet blanket of sanitizer solution is delivered to the floor.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,26,NULL,NULL,633,NULL,4228),(5682,'MOLD/MILDEW',NULL,'MOLD/MILDEW {{MILDEWSTATICACTIVITY}}: ','{{ControlMoldMildew}} {{ControlsPrevents}} {{AspergillusNiger}} {{ATCC6275}} {{OdorsCausedByApplication}} Prepare use solution by adding 3 oz. of this product per 5 gal. of water {{0.6OzProduct}} {{EquivalentDilution}}.  Apply use solution to hard, non-porous surfaces for 10 minutes which will effectively inhibit the growth of mold and mildew and their odors.  Repeat treatment every seven days, or more often if new growth appears.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,634,NULL,4229),(5683,'ATHLETIC EQUIPMENT MOLD AND MILDEW',NULL,'TO CONTROL THE GROWTH OF MOLD AND MILDEW ON NON-POROUS ATHLETIC EQUIPMENT:  ','For use on wrestling and gymnastic mats, athletic mats, exercise equipment, athletic training tables, physical therapy tables, athletic helmets, wrestling/boxing headgear, athletic shoe soles, and other hard, non-porous surfaces. Saturate surfaces with a use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}.  Apply by sponge, brush, cloth, mop, {{Immersion}}, {{SprayDevices}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.  Allow surfaces to remain wet for a period of 10 minutes. Do not use equipment until treatment has been absorbed, set or dried.  Repeat treatment every seven days, or more often if new growth appears. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,634,NULL,4230),(5684,'PLASTIC AND RUBBER STRUCTURES',NULL,'TO CONTROL THE GROWTH OF MOLD AND MILDEW ON LARGE, INFLATABLE, NON-POROUS PLASTIC AND RUBBER STRUCTURES:','For use on nonporous plastic and rubber surfaces such as inflatable animals, promotional items, moonwalks, slides, obstacle course play and exercise equipment. Thoroughly clean all surfaces with soap or detergent and rinse with water. Apply a use solution of {{ThreeOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} by sponge, brush, cloth, mop, {{SprayDevices}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.  Allow surfaces to remain wet for a period of 10 minutes. Do not use equipment until treatment has dried. Repeat treatment every seven days, or more often if new growth appears. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,634,NULL,4231),(5685,'HUMIDIFIER BACTERIA/ALGAE',NULL,'HUMIDIFIER BACTERIA/ALGAE TREATMENT (Not for use in CA):','Formulated for use in portable {{Evaporative}} humidifiers. Thoroughly clean the hard, non-porous surfaces of the water tank and filters before each heating season, or sooner if necessary. For every gallon of water in the humidifier tank, add 0.2 ounce of this product (or equivalent use dilution). When you refill the tank, add 0.2 oz. of this product for every gallon of water added in the tank {{EquivalentDilution}}. {{RinseWipeAirDry}}.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,634,NULL,4232),(5686,'Prior To Use',NULL,NULL,'Prior to use of this product, remove all animals {{Poultry}} and feeds from {{{PremisesAreas}}, animal transportation vehicles {{Trucks,Cars}}, and enclosures {{Coops,Crates,Kennels,Stables}}. Remove all litter, droppings and manure from floors, walls and surfaces of barns, pens, stalls, chutes and other surfaces of facilities and fixtures occupied or traversed by animals. Empty all troughs, racks and other feeding and watering appliances. Thoroughly clean surfaces with soap or detergent and rinse with water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,635,NULL,4233),(5687,'ANIMAL PREMISE DISINFECTANT/VIRUCIDE*',NULL,'FOR USE AS AN ANIMAL PREMISE DISINFECTANT/VIRUCIDE*: ','Apply a use solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} to disinfect hard, non-porous surfaces with a sponge, brush, cloth, {by immersion}, {mechanical spray device,} {{hand pump} coarse pump or trigger spray device}. Immerse all halters and other types of equipment used in handling and restraining animals, as well as forks, shovels, and scrapers used for removing litter and manure in the use solution. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Treated surfaces must remain wet for 10 minutes. Ventilate buildings, coops and other closed spaces. Do not house [{animals} {poultry} {livestock}] or employ equipment until treatment has been absorbed, set or dried. Thoroughly scrub all treated feed racks, troughs, automatic feeders, fountains and waterers and other treated equipment which can contact food or water with soap or detergent, and rinse with potable water before reuse.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,635,NULL,4234),(5688,'HATCHERIES',NULL,'HATCHERIES:','Use to treat hatchers, setters, trays, racks, carts, sexing tables, delivery trucks and other hard surfaces. Use 3 oz. of this product per 5 gal. of water. Leave all treated surfaces wet for 10 minutes or more. Allow to air dry. VEHICLES: Clean all vehicles including mats, crates, cabs, and wheels with water and this product. Use 3 oz. of this product per 5 gal. of water. Apply use solution to treat all vehicles. Leave treated surfaces wet for 10 minutes or more. Allow to air dry.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,635,NULL,4235),(5689,'DRESSING/RENDERING PLANT',NULL,'DRESSING {/RENDERING} PLANT:','Disinfect equipment, utensils, walls and floors in poultry and animal dressing plants. Disinfect offal rooms, exterior walls and loading platforms of dressing plants. Cover or remove all food and packaging materials. Remove all heavy soils prior to application. Saturate all surfaces with a solution of [{3 oz. of this product per 5 gal. of water} {(or equivalent use dilution)} and scrub to loosen all soils. Surfaces must remain wet for 10 minutes, and then be thoroughly rinsed with potable water before operations are resumed. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,635,NULL,4236),(5690,'TERRARIUM AND SMALL ANIMAL CAGE',NULL,'TERRARIUM AND SMALL ANIMAL CAGE AND CAGE FURNITURE DISINFECTION:','{Animals frequently defecate on hot rocks and other hard, non-porous cage furniture items inside your terrarium. This can result in high bacteria and ammonia levels that can lead to possible infection/disease in your animals. When used regularly, this product can eliminate these high bacteria/ammonia levels in your cage and on your cage furniture items.} (Do not use on porous rocks, hot rocks, and driftwood.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,635,NULL,4237),(5691,'REPTILE TANK',NULL,'REPTILE TANK CLEANING AND DISINFECTION DIRECTIONS:  ','Remove all reptiles from the [{enclosure} {tank}] prior to cleaning and disinfecting. Remove all litter or drippings from surfaces. Empty all equipment used for feeding or watering reptiles. Thoroughly clean all surfaces with soap or detergent and rinse with water.  Apply disinfecting and virucidal* solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} {(450 ppm active)} {to hard, non-porous surfaces of the enclosure {tank}}. Apply by cloth, mop, brush, sponge, auto scrubber, mechanical spray device, {{hand pump} coarse pump or trigger spray device} or by immersion until thoroughly wet. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Allow surfaces to remain wet for 10 minutes. Wipe dry {with a paper towel}. Rinse all surfaces that come in contact with food with potable water before reuse. Allow the enclosure {tank} to ventilate for a minimum of 10-15 minutes before replacing the reptiles. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,635,NULL,4238),(5692,' NON-FOOD CONTACT SURFACES IN ANIMAL PREMISES',NULL,'SANITIZER DIRECTIONS FOR NON-FOOD CONTACT SURFACES IN ANIMAL PREMISES ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,635,NULL,4239),(5693,'HOOF TRIMMING EQUIPMENT',NULL,'TO SANITIZE HOOF TRIMMING EQUIPMENT:  ','Prior to application, pre-clean hoof trimming equipment before and after use on each animal with detergent and warm water or compatible cleaner to remove soil using a pre-scrape, pre-flush, or when necessary, pre-soak followed by a potable water rinse. To sanitize, add Add {{OneOzPacket}} of this product per 5 gal. of water {{150PPM}} {{EquivalentDilution}}. Treated surfaces must remain wet for 3 minutes. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,635,NULL,4240),(5694,'MEDICAL',NULL,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. {This product can be used to pre-clean or decontaminate critical or semi-critical medical devices prior to sterilization or high-level disinfection.} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,636,NULL,4241),(5695,'NON-MEDICAL',NULL,'This product is not for use on medical device surfaces.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,636,NULL,4242),(5696,'DILUTION TABLE',NULL,'{{#DILUTION TABLE}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,636,NULL,4243),(5697,'FOGGING FOOD PREMISES',NULL,'{{FoggingFoodPremises}} ','ALL SURFACES MUST BE CLEANED AND DISINFECTED IN ACCORDANCE WITH LABEL DIRECTIONS PRIOR TO FOGGING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,636,NULL,4244),(5698,'DAIRIES, BEVERAGE AND FOOD PROCESSING PLANTS',NULL,'DIRECTIONS FOR FOGGING IN DAIRIES, BEVERAGE AND FOOD PROCESSING PLANTS:','Prior to fogging, food products and packaging material must be removed from the room or carefully protected. After disinfecting, fog desired areas using 1 quart per 1000 cubic feet of room area with a solution containing 1.5 oz. of product per gal. of water {(1,200 ppm active)} {(or equivalent use dilution)}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Vacate the area of all personnel during fogging and for a minimum of 2 hours after fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. All food contact surfaces must be sanitized with an EPA approved food contact sanitizer solution prior to use.  All food contact surfaces must be thoroughly rinsed with potable water prior to sanitizing.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,636,NULL,4245),(5699,'FOGGING POULTRY HOUSES',NULL,'{{FoggingPoultryHouses}}','ALL SURFACES MUST BE CLEANED AND DISINFECTED IN ACCORDANCE WITH LABEL DIRECTIONS PRIOR TO FOGGING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,636,NULL,4246),(5700,' HATCHERY ROOMS',NULL,'TREATMENT OF HATCHERY ROOMS USING FOGGING DEVICES: ','Remove all animals and feed from premises, vehicles and enclosures. Remove all litter and manure from floors, walls and surfaces of the room to be treated. Empty all troughs, racks and other feeding and watering appliances. Thoroughly clean all surfaces with soap or detergent and rinse with water. Close room off so fog is confined to room to be treated. Mix 140 oz. of this product per 2.5 gal. of water {{EquivalentDilution}}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Insert the nozzle of the fogger through a suitable opening into the room. With the setting in maximum output, fog for one minute for each 4000 cubic feet of space in the room. Under no circumstances will a room be entered by anyone within 2 hours of actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. When fogging is completed ventilate buildings and other closed spaces. Do not house {{Livestock}} or employ equipment until treatment has been absorbed or dried. Thoroughly clean all treated surfaces with soap or detergent and rinse with water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,636,NULL,4247),(5701,'INCUBATORS AND HATCHERS',NULL,'TREATMENT OF INCUBATORS AND HATCHERS USING FOGGING DEVICES: ','Only for treatment of setters and hatchers after poultry/chicks/eggs have been removed. Not for treatment of hatchers which contain chicks/eggs. Mix 14.5 oz. of this product per gal. of water {(or equivalent use dilution)}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Fog 3-8 oz. of this into setters and hatchers immediately after transfer. Repeat daily in setters and every 12 hours in hatchers. Discontinue hatcher treatments at least 24 hours prior to pulling the hatch. Do not allow people to contact or breathe this fog. It is acceptable to fog setters and hatchers with a 1.1 oz. of this product per gal. of water solution {(or equivalent use dilution)} on an hourly or every other hour basis. If this is done, fog for 30-90 seconds once per hour or once every two hours. When fogging is complete, ventilate buildings, and other closed spaces. Do not house livestock or employ equipment until treatment has been absorbed or dried. Thoroughly scrub all treated feed racks, mangers, troughs, automatic feeders, fountains and waterers, and other treated equipment with soap or detergent, and rinse with potable water before reuse. Under no circumstances will a room be entered by anyone within two hours of the actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,636,NULL,4248),(5702,'GROOMING IMPLEMENTS',NULL,'FOR USE AS A DISINFECTANT, VIRUCIDE* OF GROOMING CLIPPERS, HAIR CLIPPERS, ELECTRIC SHEARS, BARBER/SALON SHEERS AND OTHER IMPLEMENTS {{InstrumentsTools}}:','{{RemoveParticles}} Immerse pre-cleaned barber/salon tools such as combs, brushes, {{PlasticRollers}} razors, {{ClipperTrimmerBlades}}, {{Tweezers}} manicure/pedicure tools, scissors, and other salon instruments and tools in a use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} for at least 10 minutes. Rinse thoroughly and dry before use. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,637,NULL,4249),(5703,'FOOTBATHS',NULL,'FOR USE AS A DISINFECTANT, VIRUCIDE* OF HARD, NON-POROUS SURFACES IN FOOTBATHS:','To remove body oils, dead tissue, soil and all other buildups or organic matter on surfaces after using the footbath, drain the water and thoroughly clean all surfaces with soap or detergent, then rinse with water. Apply a use solution of 3 oz. of this product per 5 gal. of water  {(or equivalent use dilution)} on all surfaces with a brush, cloth, mop, sponge, {{PumpSpray}}. Brush or swab thoroughly and allow solution to stand for 10 minutes. For spray applications, spray 6-8 inches from surface. Do not breathe spray. After the unit has been thoroughly disinfected, rinse all surfaces with fresh water. The unit is then ready for reuse.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,637,NULL,4250),(5704,'BARBER/SALON NON-FOOD CONTACT SURFACES',NULL,'SANITIZER DIRECTIONS FOR NON-FOOD CONTACT SURFACES IN BARBER/SALON FACILITIES  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,637,NULL,4251),(5705,'BARBER/SALON INSTRUMENTS AND TOOLS',NULL,'TO SANITIZE [{BARBER} {MANICURE} {NAIL} {SALON}] INSTRUMENTS AND TOOLS:','Immerse pre-cleaned barber/salon instruments and tools {{InstrumentsTools}} in a use-solution of 1 oz. of this product per 5 gal. of water {{EquivalentDilution}} for at least 3 minutes. Rinse thoroughly and dry before use. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,637,NULL,4252),(5706,'TOILET BOWL AND URINAL DISINFECTANT/CLEANING',NULL,'NON-ACID TOILET BOWL {{Urinal}} DISINFECTANT {{Cleaning}} DIRECTIONS ','Remove heavy soil prior to disinfection.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,638,NULL,4253),(5707,'HEAVY DUTY CLEANING OF TOILET BOWLS AND URNINALS',NULL,'FOR HEAVY DUTY CLEANING OF TOILET BOWLS AND URNINALS: ','Pre-clean heavily soiled areas. Empty toilet bowl or urinal and apply 1.2 oz. of this product to exposed surfaces including under the rim with toilet {{BrushMop}}, cloth, or sponge, or mechanical spray device, {{SprayDevices}}. To aid in soil removal, allow to soak. For sprayer application, spray 6-8 inches from surface. Brush or swab thoroughly and allow solution to stand for 10 minutes and flush.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,638,NULL,4254),(5708,'DEEP CLEANING URINALS',NULL,'{{Deep}} CLEANING/DISINFECTING {{Waterless}} URINALS: ','Preliminary cleaning is required for heavily soiled surfaces. Remove and properly dispose of cartridge according to manufacturers directions. Deep clean or disinfect the entire urinal by applying 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} directly onto surface. {{BrushScrub}} surfaces and let solution stand for 10 minutes. Wipe surface to clean. Change cartridge as needed. The unit is ready for use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,638,NULL,4255),(5709,'CLEAN WATERLESS URINALS',NULL,'TO CLEAN WATERFREE {{Waterless}} URINALS: ','Remove any debris from the urinal. Spray 0.5 to 1 oz. of use solution onto urinal surface. To prepare use solution: add 0.6 oz. of this product per gal. of water {{EquivalentDilution}} {{450PPM}}. DO NOT spray product directly onto cartridge. Wipe surface to clean. Change cartridge as needed. The unit is ready for use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,638,NULL,4256),(5710,'CLEAN OPEN AREAS WITH FLOOR DRAINS',NULL,'FOR USE TO CLEAN AND DISINFECT SHOWER ROOMS, LOCKER ROOMS AND OTHER LARGE, OPEN AREAS WITH FLOOR DRAINS:  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,638,NULL,4257),(5711,'GENERAL CLEANER/DEODORIZER',NULL,'FOR USE AS A {GENERAL} CLEANER {AND/OR DEODORIZER}: ','Apply use solution of 1.75 oz. of this product per 5 gal. of water to hard, non-porous surfaces. {{RinseWipeAirDry}}. For heavy-duty use, {{AddMix}} 4 oz. of this product per 5 gal. to clean hard, non-porous surfaces. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,639,NULL,4258),(5712,'GENERAL DEODORIZER',NULL,'GENERAL DEODORIZATION','To deodorize, apply 1.75 oz. of this product per 5 gal. of water to hard, non-porous surfaces. {{RinseWipeAirDry}}. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,639,NULL,4259),(5713,'SEPTIC STORAGE TANKS',NULL,'FOR DEODORIZING SEPTIC STORAGE TANKS: ','Pre-clean heavily soiled areas. When tanks are empty, pour 1.75 oz. of this product for every 5 gal. of water in tank on recreational vehicles, campers and boats to control odors. As tank fills with sewage and the vehicle is moving, this solution will mix and provide an adequate deodorizing solution for this use. This product is to be used on gray and black water tanks only. Check with local, state, or federal authorities before disposing of sewage in accordance to federal, state and local regulations for waste disposal. (Not for use in CA.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,639,NULL,4260),(5714,'RV HOLDING TANKS',NULL,'RV HOLDING TANKS/RECREATIONAL VEHICLES: ','For toilet waste and holding tanks, cover bottom of holding tank with water and add 1.75 to 3 oz. of this product per 5 gal. of water to deodorize. If odors return before time to empty, add another 1.75 to 3 oz. per 5 gal. of water to the tank. For kitchen waste, add 1.75 to 3 oz. per 5 gal. of water to gray water tank as needed to control malodors created by dirty dishwater. (Not for use in CA.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,639,NULL,4261),(5715,'AUTOMOTIVE',NULL,'AUTOMOTIVE USES: ','A solution of 1.75 oz. of this product per 5 gal. of water will effectively neutralize {{DampMusty}} odors. Spray or apply onto seats, carpets, headliner and ashtray or into trunk and all vents to eliminate odors from tobacco, food, beverage spills and musty carpet. For sprayer applications, use a coarse spray device. {{WipeAirDry}}.  (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,639,NULL,4262),(5716,'AIR FRESHENER',NULL,'AIR FRESHENER: ','A solution of 1.75 oz. of this product per 5 gal. of water will effectively neutralize {{DampMusty}} odors caused by mildew in storage areas, basements, closets, bathrooms and A/C filters. Spray to eliminate odors from tobacco, food, beverage spills and musty carpet. For sprayer applications, use a coarse spray device. {{WipeAirDry}}.  (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,639,NULL,4263),(5717,'WATERBED CONDITIONER',NULL,'WATERBED CONDITIONER (Not for use in CA.): ','When used as a waterbed conditioner, this product eliminates odor. If bed has not been treated properly, drain bed completely. Add 15 gal. of water, mix vigorously, drain bed again. Fill bed with water and follow dosage directions. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,639,NULL,4264),(5718,'GLASS CLEANING',NULL,'GLASS CLEANING {{Deodorizing}} DIRECTIONS:','Use a 1.75 oz. of this product per 5 gal. of water use solution to clean and deodorize windows, mirrors, and glass surfaces. Use a coarse spray device. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Rub with sponge or cloth. Change cloth, sponge or towels frequently to avoid re-deposition of soil. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,639,NULL,4265),(5719,'FINISHED FLOORS',NULL,'FOR USE AS A CLEANER ON FINISHED FLOORS:  ','To limit gloss reduction, use 1.75 oz. of this product per 5 gal. of water. Apply with a damp mop or auto scrubber. Allow surface to air dry. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,639,NULL,4266),(5720,'CARPET CLEANING',NULL,'CARPET CLEANING',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,639,NULL,4267),(5721,'SPECIAL CARPET CLEANING',NULL,'SPECIAL INSTRUCTIONS FOR CLEANING CARPETS: ','This product can be used to clean carpets in industrial, institutional, commercial and residential areas such as homes, motel & hotel chains, nursing homes, schools and hospitals. For use on wet, cleanable synthetic fibers. Do not use on wool. Vacuum carpet thoroughly prior to cleaning. Test fabric for color fastness. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,639,NULL,4268),(5722,'Portable Extraction Units',NULL,'For Portable Extraction Units: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}}.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,639,NULL,4269),(5723,'Truck Mounted Extraction Machines',NULL,'For Truck Mounted Extraction Machines: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}} and meter at 5 gal. per hour',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,NULL,NULL,639,NULL,4270),(5724,'Rotary Floor Machines',NULL,'For Rotary Floor Machines: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}} and apply at the rate of 300-500 sq. ft. per 1 gal. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,14,NULL,NULL,639,NULL,4271),(5725,'Do not mix',NULL,NULL,'Do not mix this product with other cleaning products. Follow the cleaning procedures specified by the manufacturer of the cleaning equipment. After using this product set the carpet pile and protect the carpet from furniture legs and bases while drying. Do not over wet. If applied to stain resistant nylon carpet, apply a fabric protector according to the carpet manufacturers directions.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,NULL,NULL,639,NULL,4272),(5726,'CARPET HOME',NULL,'CARPET {{Cleaning/Deodorizing}} FOR HOME, INSTITUTIONAL, INDUSTRIAL AND HOSPITAL USE: ','This product {{CleansDeodorizes}} the carpet. It can be used in industrial, institutional, commercial and residential areas such as homes, motels, hotel chains, nursing homes and hospitals. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,NULL,NULL,639,NULL,4273),(5727,'Vacuum carpet thoroughly',NULL,NULL,'Vacuum carpet thoroughly prior to application. Mix 1.1 oz. per gal. of water {{EquivalentDilution}}. Follow the injection and/or extraction procedures as specified for any conventional steam cleaning equipment you are using. For rotary floor machines, mix 1.1 oz. of this product per gal. of water and spray on carpet at a rate of 300-500 sq. ft. per 1 gal.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,17,NULL,NULL,639,NULL,4274),(5728,'Washable synthetic fibers',NULL,NULL,'{{Use}} on washable synthetic fibers. Do not use on wool. Test color fastness of carpet before use. Apply diluted product to a small concealed spot, then rub with a clean white cloth. If color changes or transfers to the cloth, a water-based product must not be used. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,NULL,NULL,639,NULL,4275),(5729,'After using',NULL,NULL,'After using the product, set carpet pile in one direction with a stiff brush. Place aluminum foil under the legs of furniture while carpet is drying. Over-wetting can cause carpet to shrink. Manufacturer assumes no responsibility for over-wetting misuse. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,NULL,NULL,639,NULL,4276),(5730,'SEWER BACKUP & RIVER FLOODING',NULL,'SEWER BACKUP & RIVER FLOODING: ','To use as a deodorizer, dilute 1.1 to 2.2 oz. of this product per gal. of water allowing for the diluting effect of absorbed water within saturated materials. Remove gross filth or heavy soil along with non-salvageable materials. Saturate all affected areas with a mechanical spray device, {{CoarsePumpTriggerSprayDevice}} before and after cleaning and extraction. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Use proper ventilation; open windows. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,640,NULL,4277),(5731,'POROUS MATERIALS',NULL,'CARPETS, CARPET CUSHIONS, UPHOLSTERY, DRAPES AND OTHER POROUS MATERIALS, SUB FLOORS, DRYWALL, TRIM AND FRAME LUMBER, TACKLESS STRIP AND PANELING: ','To use as a deodorizer against water damage, extract the excess water. Test hidden area for colorfastness. Dilute 1.1 to 2.2 oz. of this product per gal. of water, allowing for the diluting effect of absorbed water within saturated materials. Remove gross filth or heavy soil. Apply directly with a mechanical spray device {or coarse pump or trigger spray device} to fully saturate affected materials. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Roll, brush or agitate into materials. Follow with a thorough extraction. Dry rapidly and thoroughly. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,640,NULL,4278),(5732,'WATER/SMOKE DAMAGE',NULL,'{{WaterSmoke}} DAMAGE RESTORATION: ','Effective against odor caused by smoke and water damage for home, institutional, industrial and hospital use. This product is particularly suitable for use in water damage restoration. Dilute 1.1 to 2.2 oz. of this product per gal. of water, allowing for the diluting effect of absorbed water within saturated materials. Saturate affected materials with enough product to remain wet for at least 10 minutes. Use proper ventilation. (Not for use in CA.)   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,640,NULL,4279),(5733,'DROSOPHILA SPP. AND PHORIDAE FAMILY OF FLIES',NULL,'FOR CONTROL OF DROSOPHILA SPP. AND PHORIDAE FAMILY OF FLIES ON NON-FOOD CONTACT SURFACES: ','To control flies on hard, non-porous non-food contact surfaces such as floors, walls, countertops, metal surfaces, painted surfaces, glazed porcelain, glazed tile, glass, chrome, rubber, and plastic in restaurants, bars, kitchens, dishwashing areas, and bar and wait station areas and other food storage areas. After removing gross filth, apply a solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} to surfaces and locations where flies breed. Spray surfaces thoroughly or apply by pouring, mopping or sponging onto the surface. Allow surface to remain wet for 10 minutes. Repeat application 1-2 times per week or as needed. Do not contaminate food and food packaging.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,641,NULL,4280),(5734,'SMALL FLIES IN DRAINS',NULL,'FOR CONTROL OF SMALL FLIES IN DRAINS:  ','For control of small flies: Drosophila spp. and the Phoridae family. Spray or pour solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} into the drain during time of lowest level of drain use. Add 14 oz. of use solution daily to each drain to maintain fly control. Apply product around the edge of the drain and thoroughly coat inside of drain. Repeat application 1-2 times per week or as needed. Do not contaminate food and food packaging.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,641,NULL,4281),(5735,'MUSHROOM FARM INDUSTRY',NULL,'MUSHROOM FARM INDUSTRY USE DIRECTIONS ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,641,NULL,4282),(5736,'CITRUS CANKER CONTROL',NULL,'CITRUS CANKER CONTROL (Not For Use in CA): ','For prevention of Citrus Canker Disease through treatment of pre-cleaned equipment. Effective against Xanthomonas axonopodis pv. citri {{CitrusCanker}} at 2000 ppm active. Treatment can be applied to trucks, attached trailers, field harvesting equipment, including cargo area, wheels, tires, undercarriage, hood, roof, fenders and any other hard, non-porous part of equipment that can be taken into infested areas. Thoroughly clean all surfaces with soap or detergent and rinse with water. Then saturate surfaces with a use dilution of 2.5 oz. of this product per gal. of water {{EquivalentDilution}} {{2000PPM}} for a period of 10 minutes. Allow to air dry. All surfaces that come in contact with food or crop must be rinsed with potable water before reuse. To prevent the spread of Citrus Canker Disease by this artificial means of transportation, treatments are made by trigger spraying, dipping or brushing. Clothing must be either thoroughly rinsed or laundered before reuse. Footwear must be rinsed before reuse. Prepare a fresh solution daily or when visibly dirty',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,641,NULL,4283),(5737,'WHIRLPOOL UNITS DISINFECTION/VIRUCIDE*',NULL,'DISINFECTION/VIRUCIDE* OF HARD, NON-POROUS SURFACES IN WHIRLPOOL UNITS: ','After using the whirlpool unit, drain unit. Prepare a use solution of 3 oz. of the product per 5 gal. of water {{EquivalentDilution}} and refill with use solution to just cover intake valves {{2InchesAboveHighestJet}}. Briefly start the pump to circulate the solution. Turn off the pump. Wash down the unit sides, seat of the chair lift and any other related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 10 minutes. After the unit has been thoroughly disinfected, drain the solution from the unit and rinse disinfected surfaces with fresh water. Wipe dry with a clean sponge or cloth or allow to air dry. Repeat for heavy soiled units. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,641,NULL,4284),(5738,'WHIRLPOOL UNITS SANITIZATION',NULL,'SANITIZATION OF HARD, NON-POROUS SURFACES IN WHIRLPOOL UNITS: ','To remove body oils, dead tissue, soil and all other buildups or organic matter on surfaces after using the whirlpool unit, drain unit. Prepare a use solution of 0.25 oz. of this product per gal. of water {{EquivalentDilution}} and refill with use solution to just cover the intake valves {{2InchesAboveHighestJet}}. Briefly start the pump to circulate the solution. Turn off the pump. Wash down the unit sides, seat of the chair lift and any other related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 3 minutes. After the unit has been thoroughly sanitized, drain the solution from the unit and rinse all with fresh water. Repeat for heavy soiled units. Then the unit is ready for reuse.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,641,NULL,4285),(5739,'BAGLESS VACUUM CLEANERS',NULL,'FOR DISINFECTING BAGLESS VACUUM CLEANERS: ','Add 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Turn off and unplug vacuum cleaner. Remove the hard, non-porous container that houses collected material from the vacuum cleaner. Empty contents into a waste receptacle. Rinse collection container with water and wipe clean to remove any additional collected material. Apply use solution to collection container with a brush, cloth, mop, sponge, mechanical spray device, {{{SprayDevices}} so as to wet all surfaces thoroughly. {{SprayerApplications}} Allow surfaces to remain wet for 10 minutes. Wipe up excess liquid with a clean cloth or sponge or allow to air dry. Reattach container to vacuum cleaner. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,641,NULL,4286),(5740,'VACUUM CLEANER BRUSHES',NULL,'FOR DISINFECTING NON-POROUS VACUUM CLEANER BRUSHES: ','Add 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Turn off and unplug vacuum cleaner. Remove the non-porous brushes from vacuum cleaner. Submerge brush in use solution so as to wet all surfaces thoroughly. Allow surfaces to remain wet for 10 minutes. Wipe up excess liquid with a clean cloth or sponge or allow to air dry. Reattach brushes to vacuum cleaner. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,641,NULL,4287),(5741,'COMMERCIAL FLORIST',NULL,'COMMERCIAL FLORIST USE DIRECTIONS: ','To clean, disinfect {{Deodorize}} hard, non-porous surfaces, prepare use solution of 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}}. For heavy-duty use, add 4 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Remove all leaves, petals, garbage and refuse. Pre-clean surfaces using pressurized water where possible. Apply use solution to hard, non-porous surfaces, thoroughly wetting surfaces as required, with a cloth, mop, brush, sponge, {{AutoScrubber,}} or mechanical spray device, {{SprayDevices}}. For sprayer applications, spray 6-8 inches from surface. Rub with brush, sponge, mop or cloth. Do not breathe spray. Treated surfaces must remain wet for 10 minutes. Wipe up excess or allow to air dry. Change cloth, sponge or towels frequently to avoid re-deposition of soil. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,641,NULL,4288),(5742,'WORK AREAS AND BENCHES',NULL,'WORK AREAS AND BENCHES, POTS, FLATS AND FLOWER BUCKETS, CUTTING TOOLS: ','Pre-clean surfaces. {{SpraySwabSoak}} with a solution of 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}} before each work period and again after each plant is completed {{ControlDiseaseTransfer}}. Allow surface to remain wet for 10 minutes. To apply solution as a sprayer application, use as a coarse spray only and spray 6-8 inches from surface. Wipe up excess liquid or allow to air dry. {{DryOilTools}} Prepare a fresh solution daily or when visibly dirty. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,641,NULL,4289),(5743,'CLEANSING OF EXTERIOR BODY SURFACES',NULL,'CLEANSING OF EXTERIOR BODY SURFACES OF {{HumanRemains}}: ','To cleanse away skin secretions and accompanying malodor, to ensure the removal of all soil and bloodstains, and to remove and reduce surface contamination, apply 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}} to the exterior surfaces of the body. Bathe the entire body using sponge or washcloth. A soft brush may be employed on surfaces other than the face. Allow a 10 minute contact time for optimal results. Prepare a fresh solution for each human remain. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,641,NULL,4290),(5744,'KITCHEN/BATHROOM/HOUSEHOLD',NULL,'CLEAN/DISINFECT/DEODORIZE {{KitchenBathroomHousehold}} SURFACES: ','Pre-clean surfaces. Apply a solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} with brush, cloth, mop, sponge, mechanical spray device, {{SprayDevices}}. For spray applications, hold container 6 to 8 inches from surface and spray until thoroughly wet. For disinfection, treated surfaces must remain wet for 10 minutes. Wipe up excess liquid or allow to air dry. Rinse with potable water after use on surfaces that come in contact with food. This product is not to be used to clean or disinfect dishware, glasses or eating utensils. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,642,NULL,4291),(5745,'EXTERIOR HOUSEHOLD SURFACES',NULL,'SANITIZATION OF EXTERIOR HOUSEHOLD SURFACES DIRECTIONS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,642,NULL,4292),(5746,'LAUNDRY',NULL,'COMMERCIAL AND INSTITUTIONAL LAUNDRY USE: ','For residual bacteriostatic activity against gram negative and/or gram positive odor-causing bacteria and/or residual self-sanitizing activity against Klebsiella pneumoniae and Staphylococcus aureus, use this product as directed. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,643,NULL,4293),(5747,'Initial Treatment',NULL,'Initial Treatment:','Use 10 oz. of this product per 100 pounds of fabric (dry weight) {{EquivalentDilution}}. Dilute the appropriate amount of this product in one to two gal. of water, and then add solution to the wash wheel at the beginning of the final rinse cycle. A minimum rinse cycle time of 5 minutes is required',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,643,NULL,4294),(5748,'Repeat Treatment',NULL,'Repeat Treatment: ','Repeat Treatment: Follow Initial Treatment directions and re-treat fabric after each washing {{IfOdorPersists}}. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,643,NULL,4295),(5749,'LAUNDRY BACTERIOSTAT',NULL,'LAUNDRY BACTERIOSTAT FOR COMMERCIAL, INDUSTRIAL, AND NON-MEDICAL INSTITUTIONAL LAUNDRY APPLICATIONS: ','This product provides the fabric with residual bacteriostatic activity against odor causing gram-negative and gram-positive bacteria when added to the final rinse at a rate of 10 oz. of this product per 100 lbs. of dry laundry. This product was evaluated against:  Corynebacterium ammoniagenes {{ATCC6872}} Klebsiella pneumoniae {{ATCC4352}} Staphylococcus aureus {{ATCC6538}} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,643,NULL,4296),(5750,'LAUNDRY DEODORIZER ',NULL,'LAUNDRY DEODORIZER {AGAINST ODOR CAUSING BACTERIA}: ','For activity against odor causing bacteria caused by conditions of high relative humidity or wet contamination, use 12 oz. of this product per 100 pounds of dry weight fabric. Dilute the appropriate amount of this product in one to two gal. of water, and then add to the wash wheel in the final rinse. Re-treat fabric after each washing. Laundered fabric may also be treated by soaking. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,643,NULL,4297),(5751,'PRESERVATION AGAINST MILDEW',NULL,'PRESERVATION AGAINST MILDEW BY SOAKING: ','Use 10 oz. of this product per 100 pounds of fabric (dry weight). A minimum soaking time of 5 minutes is required.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,643,NULL,4298),(5752,'LAUNDRY SANITIZER',NULL,'LAUNDRY SANITIZER: ','When added at the rate of 1 oz. of this product per gal. water {{Yield780PPM}} {{12Oz}} {{EquivalentDilution}} {{780PPM}}, this formulation provides sanitization against Staphylococcus aureus, Klebsiella pneumoniae, Pseudomonas aeruginosa, and Staphylococcus aureus Methicillin Resistant (MRSA) and is effective against HIV-1 in rinse water up to 200 ppm hard water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,643,NULL,4299),(5753,'KILLS HIV-1 ON LAUNDRY',NULL,'KILLS HIV-1 ON LAUNDRY IN COMMERCIAL, INDUSTRIAL AND INSTITUTIONAL APPLICATIONS. ','This product provides virucidal* activity against HIV-1 on fabrics when presoaked with a 4 minute contact time followed by normal washing in detergent and rinsing at a rate of 12 oz. of this product per 100 lbs. of dry laundry in water hardness up to 200 ppm.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,643,NULL,4300),(5754,'LAUNDRY SANITIZING',NULL,'LAUNDRY SANITIZING DIRECTIONS FOR USE: ','For sanitizing step, fill washer to low water level with minimum temperature water of 95°F. Using an appropriate {{#CompanyName}}} dispenser, inject this product into the sanitizing rinse step at the rate of 1 oz. of this product per gal. water {{Yield780PPM}} {{12Oz}} {{780PPM}} {{EquivalentDilution}}. Treat the laundry for a minimum of 5 minutes at a minimum temperature of 95°F. Other laundry additives, such as fabric softeners, laundry sours, starch and sizing must be used per manufacturers instructions in subsequent rinse cycles after the sanitizing rinse cycle.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,643,NULL,4301),(5755,'LAUNDRY FINAL CYCLE',NULL,'LAUNDRY SANITIZING DIRECTIONS FOR USE: ','This product is used in the final, warm rinse cycle at a low water level. Dilute at 1 oz. of this product per gal. of water {{12Oz}} {{780PPM}} {{EquivalentDilution}}, then add to the wash in the final rinse, or dispense directly through automatic dispensing equipment. Run for a minimum of 5 minutes. Retreat as necessary. This product will not harm fabrics. DO NOT USE IN THE PRESENCE OF, OR MIX WITH OTHER CHEMICALS.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,643,NULL,4302),(5756,'SMALL COMMERCIAL WASHING MACHINES',NULL,'FOR USE IN SMALL COMMERCIAL WASHING MACHINES: ','Use the chart below to determine the equivalent use dilution per wash load for use as a Laundry Sanitizer in small commercial washing machines. This is based on 12 oz. of this product per 100 lbs. of dry laundry. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,643,NULL,4303),(5757,'CONSUMER WASHING MACHINES',NULL,'FOR USE IN CONSUMER OR HOUSEHOLD TYPE WASHING MACHINES:',' Use the chart below to determine the equivalent use dilution per wash load for use as a Laundry Sanitizer in consumer or household type washing machines. This is based on 12 oz. of this product per 100 lbs. of dry laundry.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,643,NULL,4304),(5758,'RECIRCULATING COOLING WATER TOWERS',NULL,'INDUSTRIAL {{AND/OR} COMMERCIAL} RECIRCULATING COOLING WATER TOWERS, RETORT WATER SYSTEMS (Not for use in CA.) ','Cooling tower waters that are inherently low in algae growth and bacteria count may be adequately controlled by the lower range of these dosages. Repeat every seven days or increase frequency if needed. Should slime develop again, repeat initial dosage.\r\n\r\nFor best results, clean heavily contaminated systems before treatment with this product. If soap or anionic detergent is used, rinse thoroughly before charging with this algaecide.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,644,NULL,4305),(5759,'ONCE THROUGH WATER COOLING SYSTEM',NULL,'ONCE THROUGH FRESH {{AndSea}} WATER COOLING SYSTEM (Not for use in CA.) ','Use of the product in either public/municipal or single or multiple family private/residential potable/drinking water systems is strictly prohibited. Use of the product in any cooling water system that discharges effluent within 0.25 mile of either a public/municipal or single or multiple family private/residential potable/drinking water intake is strictly prohibited.\r\n\r\nFor best results, slug feed. The frequency of addition of microbiocide needed depends on many factors. To optimize your use of water treatment microbiocide, follow this procedure.   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,644,NULL,4306),(5760,'DEACTIVATION',NULL,'DEACTIVATION: ','Use bentonite clay at the minimum ratio of 5 ppm clay to 1 ppm product. This product must be deactivated prior to discharge of the NPDES outfall. Do not apply this product more than 4 times a year. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,644,NULL,4307),(5761,'OILFIELD INJECTION AND WASTE WATER',NULL,'OILFIELD INJECTION AND WASTE WATER (Not for use in CA.): ','This product must be added to the water handling system at a point of uniform mixing such as the area of addition of makeup water to the holding tank.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,644,NULL,4308),(5762,'GAS PRODUCTION AND TRANSMISSION PIPELINE AND SYSTEMS',NULL,'GAS PRODUCTION AND TRANSMISSION PIPELINE AND SYSTEMS: ','For the control of sulfate-reducing bacteria and slime forming bacteria, this product must be added to a gas production or transmission pipeline via direct injection at a point where uniform and maximum distribution will occur. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,645,NULL,4309),(5763,'GAS STORAGE WELLS AND SYSTEMS',NULL,'GAS STORAGE WELLS AND SYSTEMS: ','Treat individual injection wells with this product to produce an effective concentration of 651000 ppm active. Update treatment rate as needed. This product must be diluted by the water present in the formation. Injection takes place before gas is injected and may be repeated yearly or as needed to maintain control. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,645,NULL,4310),(5764,'PIPELINE PIGGING AND SCRAPING OPERATIONS',NULL,'PIPELINE PIGGING AND SCRAPING OPERATIONS: ','Add this product to slug of water immediately following the scraper {(keep the water volume to a minimum and contained between the scraper and the following pig)}. Add an effective concentration to produce 75-500 ppm depending on the length of the pipeline and the severity of the biofouling. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,645,NULL,4311),(5765,'DRILLING, COMPLETION AND WORKOVER FLUIDS SYSTEMS',NULL,'DRILLING, COMPLETION AND WORKOVER FLUIDS SYSTEMS:','Add to the fluid system at a point of uniform mixing such as circulating mud tank. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,645,NULL,4312),(5766,'PACKER FLUIDS',NULL,'PACKER FLUIDS: ','Add to a packer fluid at a point of uniform mixing such as a circulating holding tank at a rate of 65-1,000 ppm active per 100 barrels of fluid to a freshly prepared fluid depending on the severity of contamination. Seal the fresh packer fluid in the wall between the casing and the production tube. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,645,NULL,4313),(5767,'HYDROTESTING',NULL,'HYDROTESTING: ','Treat water used to hydrotest pipelines or vessels at 65-1,000 ppm active depending on the water quality and length of time the equipment will remain idle. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,645,NULL,4314),(5768,'AUTOMATED DILUTION SYSTEM',NULL,'AUTOMATED DILUTION SYSTEM {{DilutionSystemsTradeName}} INSTRUCTIONS:',NULL,NULL,NULL,NULL,NULL,NULL,'Y',NULL,NULL,1,NULL,NULL,646,NULL,4315),(5769,'BAG-IN BOX CONTAINERS',NULL,'BAG-IN BOX CONTAINERS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,646,NULL,4316),(5770,'COARSE TRIGGER SPRAYERS',NULL,'{{Coarse}} TRIGGER SPRAYERS: Fill bottle from dispenser. {{ApplyAccordingToDirectionsAbove}} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,646,NULL,4317),(5771,'SPRAY USE INSTRUCTIONS',NULL,'SPRAY USE INSTRUCTIONS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,646,NULL,4318),(5772,'Spray Cap container language',NULL,'(Spray Cap container language) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,646,NULL,4319),(5773,'MOP BUCKETS',NULL,'MOP BUCKETS:','Fill bucket from dispenser. Set up Wet Floor signs. Mop floor surfaces as specified in directions above.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,646,NULL,4320),(5774,'PACKETS',NULL,'PACKETS: ','{{SimplyTearOpen}} pour contents into X gal. of water. Keep packets in box until ready to use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,646,NULL,4321),(5775,'REFILLS',NULL,'REFILLS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,646,NULL,4322),(5906,'GENERAL',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,664,NULL,4193),(5907,'MedicalDevice',NULL,NULL,NULL,NULL,NULL,NULL,NULL,' For labels that list medical premises and metal and/or stainless steel surfaces, one of the following FDA/EPA Memorandum of Understanding statements must be used.','Y',NULL,NULL,2,NULL,NULL,664,NULL,4194),(5908,'DISINFECTANT CLEANER',NULL,'{{DISINFECTANT}}',NULL,NULL,NULL,NULL,NULL,'This DILUTION TABLE is optional. ',NULL,NULL,NULL,1,NULL,NULL,665,NULL,4195),(5909,'HOSPITAL',NULL,'HOSPITAL/HEALTH CARE/MEDICAL/NON-MEDICAL DISINFECTION',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,665,NULL,4196),(5910,'BLOODBORNE PATHOGEN INSTRUCTIONS',NULL,'BLOODBORNE PATHOGEN INSTRUCTIONS: ',NULL,NULL,NULL,NULL,NULL,'Note to Reviewer: Heading is optional. If instructions used, all indented text must be included.',NULL,NULL,NULL,3,NULL,NULL,665,NULL,4197),(5911,'SURGICAL INSTRUMENT PRESOAK',NULL,'SURGICAL INSTRUMENT PRESOAK: ',' {{AddMix}} 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} {{450PPM}}. Place pre-cleaned instruments in solution to presoak surgical instruments for a minimum of 10 minutes, then proceed with normal sterilization proc','Plastic instruments can remain immersed until sterilization. Metal instruments must be removed after 10 minutes, rinsed, dried, and kept in a clean non-contaminated receptacle until sterilization. Prolonged soaking will cause damage to metal instruments. Surgical instruments must be sterilized before use.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,665,NULL,4198),(5912,'ULTRASONIC BATH DISINFECTANT',NULL,'ULTRASONIC BATH DISINFECTANT DIRECTIONS: ','Pre-clean heavily soiled objects. Use this product to disinfect hard, non-porous non-critical objects compatible with Ultrasonic cleaning units. Pour a fresh solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} directly into bath chamber. Place objects into unit and operate {{ManufacturersDirections}} for a minimum of 10 minutes. Remove objects and rinse with sterile water. Allow to air dry. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,665,NULL,4199),(5913,'NON-POROUS BATH AND THERAPY EQUIPMENT',NULL,'FOR DISINFECTING HARD, NON-POROUS {{SealedFiberglass}} BATH AND THERAPY EQUIPMENT:','Drain the water from the unit. Pre-clean heavily soiled surfaces to {{RemoveBuildups}}. Prepare a use solution by adding {{3oz}} of this product per every 5 gal. of water {{EquivalentUse}} {{450PPM}}.  Refill the unit with the use solution to just cover the intake valve. Briefly start the pump to circulate the solution. Turn off pump. Wash down the unit sides, seat of the chair lift, and all related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 10 minutes for proper disinfection. After the unit has been thoroughly disinfected, drain solution from the unit and rinse all surfaces with fresh water. The unit is ready for reuse.    ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,665,NULL,4200),(5914,'CLEANING AND DISINFECTING PERSONAL PROTECTIVE EQUIPMENT',NULL,'CLEANING AND DISINFECTING HARD, NON-POROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT {{Respirators}}:','Pre-clean equipment, if heavily soiled, to ensure proper surface contact. Prepare a use solution by adding 0.6 oz. of this product per gal. of water {{EquivalentDilution}} {{450PPM}}. Gently mix for uniform use solution. Apply use solution to surfaces of the respirator with a sponge, brush, cloth, mop, {{Immersion}}, {{AutoScrubber}}, {{CleaningEquipment}} Rub with brush, cloth, or sponge. Treated surfaces must remain wet for 10 minutes. Remove excess solution from equipment prior to storage. The user must comply with all OSHA regulations for cleaning respiratory protection equipment (29 CFR § 1910.134).  Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,665,NULL,4201),(5915,'GENERAL DISINFECTION',NULL,'GENERAL DISINFECTION','FOR USE AS A CLEANER/GENERAL DISINFECTANT {{KILL}} ON HARD, NON-POROUS SURFACES: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,666,NULL,4202),(5916,'SANITIZING',NULL,'FOOD CONTACT {{TobaccoEquipment}} SANITIZING DIRECTIONS  ','Prior to application, remove gross food particles and soil by a pre-flush or pre-scrape and when necessary, presoak. Then thoroughly wash or flush objects with a good detergent or compatible cleaner, followed by a potable water rinse before applications of the sanitizing solution.  ',NULL,NULL,NULL,NULL,'This statement must appear with any of the Food Contact Sanitizing claims unless already included in the use instructions.',NULL,NULL,NULL,1,NULL,NULL,667,NULL,4203),(5917,'SANITIZING DILUTION',NULL,'FOOD CONTACT SANITIZING DILUTION TABLE {{FoodContactSurfaces}}:','To prepare a 150, 200, 300 or 400 ppm active solution use the following dilution table. Prepare the correct dilution rate based upon the appropriate use site.  ',NULL,NULL,NULL,NULL,'On the final printed label either the dilution table and/or one of the dilution rates (or equivalent use dilution) will be used. If the dilution table is used then the 150  400 ppm dilution instruction will be used.',NULL,NULL,NULL,2,NULL,NULL,667,NULL,4204),(5918,'SANITIZE FOOD CONTACT SURFACES',NULL,NULL,'{{FoodContactSurfaces}}',NULL,NULL,NULL,NULL,'One of the following two headers will be used.',NULL,NULL,NULL,3,NULL,NULL,667,NULL,4205),(5919,'U.S. PUBLIC HEALTH SERVICE FOOD SERVICE',NULL,'U.S. PUBLIC HEALTH SERVICE FOOD SERVICE SANITIZATION RECOMMENDATIONS CLEANING AND SANITIZING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,667,NULL,4206),(5920,'WISCONSIN STATE DIVISION OF HEALTH',NULL,'{{WisconsinHealth}} DIRECTIONS FOR EATING ESTABLISHMENTS ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,667,NULL,4207),(5921,'CLOSED LOOP SANITIZING',NULL,'CLOSED LOOP {{Circulation}} SANITIZING {{FoodProcessing}}: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,667,NULL,4208),(5922,'CLEAN-IN-PLACE METHOD ',NULL,'CLEAN-IN-PLACE (CIP) METHOD {{For}} {{Dairy}}, {{DairyFarm}} {{And}} {{FoodProcessing}}: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,667,NULL,4209),(5923,'SANITIZING FOOD PROCESSING EQUIPMENT',NULL,'SANITIZING OF {{Refrigerated}} FOOD PROCESSING EQUIPMENT AND OTHER HARD, NON-POROUS SURFACES IN FOOD CONTACT LOCATIONS: ','For sanitizing {{NonPorousSurfaces}} hard, non-porous food contact surfaces, surfaces must be thoroughly pre-flushed or pre-scraped and, when necessary, presoaked to remove gross food particles.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,667,NULL,4210),(5924,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES',NULL,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES OF {{InteriorNonPorousSurfaces}}',NULL,NULL,NULL,NULL,NULL,' Must choose appropriate instructions below.','Y',NULL,NULL,9,NULL,NULL,667,NULL,4211),(5925,'WATER SOFTENERS AND REVERSE OSMOSIS (RO) UNITS',NULL,'SANITIZATION OF INTERIOR HARD, NON-POROUS SURFACES OF WATER SOFTENERS AND REVERSE OSMOSIS (RO) UNITS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,667,NULL,4212),(5926,'BEVERAGE DISPENSING AND SANITARY FILLING EQUIPMENT',NULL,'BEVERAGE DISPENSING AND SANITARY FILLING EQUIPMENT SANITIZER DIRECTIONS:','For sanitizing hard, non-porous bottling or pre-mix dispensing equipment and bottles or cans in the final rinse application. This product is {{ProportionedExteriorApplication}}. Fill equipment with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product. Surfaces must remain wet for at least 1 minute or until operations resume at which time the sanitizing solution must be drained from the system. Allow sanitized surfaces to adequately drain {{AirDry}} before contact with liquid. Do not rinse.   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,667,NULL,4213),(5927,'BEER FERMENTATION',NULL,'{{BeerFermentation}} STORAGE TANK SANITIZER DIRECTIONS: ','For sanitizing hard, non-porous beer fermentation and holding tanks, wine, citrus and food processing storage and holding tanks. Prepare a solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product for mechanical or automated systems. {{ManufacturersDirections}} Surfaces must remain wet for at least 1 minute. Allow sanitized surfaces to adequately drain before contact with {{FoodLiquid}}. Do not rinse. For mechanical operations or automated systems, the used sanitizing solution must not be reused for sanitizing, but can be reused for other purposes such as cleaning.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,667,NULL,4214),(5928,'SANITIZING EGG SHELLS',NULL,'SANITIZING EGG SHELLS INTENDED FOR FOOD DIRECTIONS: ','To sanitize previously cleaned food-grade eggs in shell egg and egg product processing plants, spray with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product. The solution must be warmer than the eggs, but not to exceed 130°F. Wet eggs thoroughly and allow solution to drain. Eggs sanitized with this product must be subjected to a potable water rinse only if they are to be broken immediately for use in the manufacture of egg products. Eggs must be reasonably dry before casing or breaking. The solution must not be re-used for sanitizing eggs. Note: Only clean, whole eggs can be sanitized. Dirty, cracked or punctured eggs cannot be sanitized. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,NULL,NULL,667,NULL,4215),(5929,'TREATMENT OF CONVEYOR BELTS',NULL,'FOR TREATMENT OF [{{MEAT}} {{And}} {{POULTRY}} {{Or}} {{FRUITVEGETABLE}}] {{CONVEYORS_BELTS}}: ','Remove gross food particles and excess soil by a pre-flush or pre-scrape. Wash with a good detergent or compatible cleaner. Rinse equipment thoroughly with potable water and then rinse equipment with a sanitizing solution. During processing apply {{#AppropriateDilution}} {{EquivalentDilution}} of this product to conveyors with suitable feeding equipment. Do not allow this solution to be sprayed directly on food. Controlled volumes of sanitizer are applied to return portion of conveyor through nozzles so located as to permit maximum drainage of sanitizer from equipment and to prevent puddles on top of belt. During interruptions in operation, apply solution using coarse spray equipment to peelers, collators, slicers and saws, and other non-porous conveyor equipment. Allow surfaces to remain wet for at least 1 minute. Conveyors and other equipment must be free of product when applying this coarse spray.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,14,NULL,NULL,667,NULL,4216),(5930,'GLOVE DIP',NULL,'GLOVE DIP SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animal areas and the packaging and storage areas of food plants, dip or soak pre-washed {{PlasticRubber}} non-porous gloved hands in a suitable clean container that contains enough freshly made sanitizing solution to cover the gloved hand area. Do not let sanitizing solution come into contact with exposed skin. Gloved hands must remain wet for at least 1 minute. Do Not Rinse. Prepare sanitizing solution by adding {{#AppropriateDilution}} {{EquivalentDilution}}. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,NULL,NULL,667,NULL,4217),(5931,'GLOVE SPRAY',NULL,'GLOVE SPRAY SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animals areas and the packaging and storage areas of food plants, spray pre-washed {{PlasticRubber}} gloves thoroughly to ensure sanitizing solution covers the exterior surfaces of the gloves prior to {{UsageWearing}} using a coarse spray device. Do not let sanitizing solution come into contact with exposed skin. After applying solution, allow gloves to remain wet for at least 1 minute. Let air dry thoroughly before wearing gloves. Do not rinse. Prepare sanitizing solution by adding (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}}. Prepare a fresh solution daily.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,NULL,NULL,667,NULL,4218),(5932,'GLOVE DIP/SPRAY',NULL,'GLOVE DIP/SPRAY SANITIZER DIRECTIONS: ','To prevent cross contamination from area to area in animals areas and the packaging and storage areas of food plants, dip, soak or spray pre-washed {{PlasticSynthetic}} gloves thoroughly to ensure sanitizing solution covers the exterior surfaces of the gloves prior to {{UsageWearing}}.  For spray applications, use a coarse spray device. Do not let sanitizing solution come into contact with exposed skin. After applying solution, allow gloves to remain wet for at least 1 minute. Let air dry thoroughly before wearing gloves. Do not rinse. Prepare sanitizing solution by adding {{#AppropriateDilution}} {{EquivalentDilution}}. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,17,NULL,NULL,667,NULL,4219),(5933,'NON-FOOD CONTACT SANITIZING DIRECTIONS',NULL,'NON-FOOD CONTACT SANITIZING DIRECTIONS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,NULL,NULL,667,NULL,4220),(5934,'NON-FOOD CONTACT SANITIZING',NULL,'NON-FOOD CONTACT SANITIZING:','Pre-clean heavily soiled surfaces. Add {{OneOzPacket}} of this product per 5 gal. of water {{150PPM}} {{EquivalentDilution}}. Apply solution to hard, non-porous surfaces with a sponge, brush, cloth, mop, {{ByImmersion}}, {{AutoScrubber}}, {{SprayDevices}}. Treated surfaces must remain wet for 3 minutes. Prepare a fresh solution daily or when visibly dirty.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,NULL,NULL,667,NULL,4221),(5935,'ULTRASONIC BATH',NULL,'ULTRASONIC BATH SANITIZER DIRECTIONS: ','Pre-clean heavily soiled surfaces. Use this product to sanitize hard, non-porous, noncritical objects compatible with Ultrasonic cleaning units. Prepare a use solution of {{OneOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}} directly into bath chamber. Place objects into unit and operate for a minimum of 3 minutes, {{ManufacturersDirections}}. Remove objects and rinse with {{Sterile}} water. {{AirDry}} Prepare a fresh solution daily or when visibly dirty.  ','This product in its use solution is compatible with stainless steel, aluminum and most other hard, non-porous surfaces. Before product use, it is recommended that you apply product to a smaller test area to determine compatibility before proceeding with its use.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,20,NULL,NULL,667,NULL,4222),(5936,'PERSONAL PROTECTIVE EQUIPMENT',NULL,'SANITIZATION OF HARD, NON-POROUS SURFACES ON PERSONAL PROTECTIVE EQUIPMENT {{RESPIRATORS}}:','Add {{OneOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}}.  Gently mix for uniform solution. Apply solution to surfaces of the respirator with a sponge, brush, cloth, mop, {{ByImmersion}}, {{AutoScrubber}}, {{SprayDevices}} Thoroughly wet all surfaces to be sanitized. Treated surfaces must remain wet for 3 minutes. Remove excess solution from equipment prior to storage. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,21,NULL,NULL,667,NULL,4223),(5937,'SHOE/BOOT',NULL,'{{SHOE/BOOT}} {{BATH}} SANITIZER DIRECTIONS: ','To prevent cross contamination {{FromAreas}} shoe baths containing one inch of freshly made sanitizing solution must be placed at all entrances to buildings, hatcheries and at all the entrances to the production and packaging rooms. Scrape waterproof shoes and place in a 1 oz. of this product per 5 gal. of water {{EquivalentDilution}} {{150PPM}} use solution {{AllowToRemainWet}} for 3 minutes prior to entering area. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,22,NULL,NULL,667,NULL,4224),(5938,'FOOT DIP',NULL,'FOR FOOT DIP OF WATER PROOF FOOTWEAR: ','Use this product at 1 oz. per 5 gal. of water in foot dip tray. Shoe baths must contain at least 1 inch of freshly made solution and be placed at the entrances to buildings. Scrape shoes and place in diluted solution {{AllowToRemainWet}} for 3 minutes before entering building. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,23,NULL,NULL,667,NULL,4225),(5939,'SHOE FOAM',NULL,'SHOE FOAM DIRECTIONS:','To prevent cross contamination {{FromAreas}}apply a foam layer approximately 0.5 to 2 inches thick made from a solution of 1 to 1.5 oz. of this product per gal. of water {{EquivalentDilution}} {{800-1200PPM}} at all entrances to buildings, hatcheries, production and packaging rooms by using a foam generating machine or aerator to apply foam layer. Follow the foaming directions as specified by the manufacturer of the foam generator/aerator. Scrape waterproof shoes. Stand and/or walk through foamed area {{AllowToRemainWet}} for 3 minutes prior to entering area. Foam area must be washed and replaced daily or when it appears visibly soiled or dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,24,NULL,NULL,667,NULL,4226),(5940,'SHOE SPRAY',NULL,'SHOE SPRAY SANITIZING DIRECTIONS: ','For heavily soiled {{WorkWear}}, {{ScrapeWipe}} with brush, sponge or cloth or Neat Feet Clean Solution Welcome Mat to remove excess dirt.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,25,NULL,NULL,667,NULL,4227),(5941,'ENTRYWAY',NULL,'ENTRYWAY SANITIZING SYSTEMS: ','To prevent cross contamination from area to area, set the system to deliver 1.25  2.5 oz. of this product per 2.5 gal. of water {{EquivalentDilution}} {{400-800PPM}} of sanitizing solution. The {{SprayFoam}} must cover the entire path of the doorway. Set the system so that a continuous wet blanket of sanitizer solution is delivered to the floor.','Do not mix other foam additives with the sanitizing solution.',NULL,NULL,NULL,'(For food processing or other facilities that have installed entryway sanitizing systems.)',NULL,NULL,NULL,26,NULL,NULL,667,NULL,4228),(5942,'MOLD/MILDEW',NULL,'MOLD/MILDEW {{MILDEWSTATICACTIVITY}}: ','{{ControlMoldMildew}} {{ControlsPrevents}} {{AspergillusNiger}} {{ATCC6275}} {{OdorsCausedByApplication}} Prepare use solution by adding 3 oz. of this product per 5 gal. of water {{0.6OzProduct}} {{EquivalentDilution}}.  Apply use solution to hard, non-porous surfaces for 10 minutes which will effectively inhibit the growth of mold and mildew and their odors.  Repeat treatment every seven days, or more often if new growth appears.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,668,NULL,4229),(5943,'ATHLETIC EQUIPMENT MOLD AND MILDEW',NULL,'TO CONTROL THE GROWTH OF MOLD AND MILDEW ON NON-POROUS ATHLETIC EQUIPMENT:  ','For use on wrestling and gymnastic mats, athletic mats, exercise equipment, athletic training tables, physical therapy tables, athletic helmets, wrestling/boxing headgear, athletic shoe soles, and other hard, non-porous surfaces. Saturate surfaces with a use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}.  Apply by sponge, brush, cloth, mop, {{Immersion}}, {{SprayDevices}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.  Allow surfaces to remain wet for a period of 10 minutes. Do not use equipment until treatment has been absorbed, set or dried.  Repeat treatment every seven days, or more often if new growth appears. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,668,NULL,4230),(5944,'PLASTIC AND RUBBER STRUCTURES',NULL,'TO CONTROL THE GROWTH OF MOLD AND MILDEW ON LARGE, INFLATABLE, NON-POROUS PLASTIC AND RUBBER STRUCTURES:','For use on nonporous plastic and rubber surfaces such as inflatable animals, promotional items, moonwalks, slides, obstacle course play and exercise equipment. Thoroughly clean all surfaces with soap or detergent and rinse with water. Apply a use solution of {{ThreeOzPacket}} of this product per 5 gal. of water {{EquivalentDilution}} by sponge, brush, cloth, mop, {{SprayDevices}}. For spray applications, spray 6-8 inches from surface. Do not breathe spray.  Allow surfaces to remain wet for a period of 10 minutes. Do not use equipment until treatment has dried. Repeat treatment every seven days, or more often if new growth appears. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,668,NULL,4231),(5945,'HUMIDIFIER BACTERIA/ALGAE',NULL,'HUMIDIFIER BACTERIA/ALGAE TREATMENT (Not for use in CA):','Formulated for use in portable {{Evaporative}} humidifiers. Thoroughly clean the hard, non-porous surfaces of the water tank and filters before each heating season, or sooner if necessary. For every gallon of water in the humidifier tank, add 0.2 ounce of this product (or equivalent use dilution). When you refill the tank, add 0.2 oz. of this product for every gallon of water added in the tank {{EquivalentDilution}}. {{RinseWipeAirDry}}.','Not for use in heat vaporizing or atomizing type vaporizer humidifiers. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,668,NULL,4232),(5946,'Prior To Use',NULL,NULL,'Prior to use of this product, remove all animals {{Poultry}} and feeds from {{{PremisesAreas}}, animal transportation vehicles {{Trucks,Cars}}, and enclosures {{Coops,Crates,Kennels,Stables}}. Remove all litter, droppings and manure from floors, walls and surfaces of barns, pens, stalls, chutes and other surfaces of facilities and fixtures occupied or traversed by animals. Empty all troughs, racks and other feeding and watering appliances. Thoroughly clean surfaces with soap or detergent and rinse with water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,669,NULL,4233),(5947,'ANIMAL PREMISE DISINFECTANT/VIRUCIDE*',NULL,'FOR USE AS AN ANIMAL PREMISE DISINFECTANT/VIRUCIDE*: ','Apply a use solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} to disinfect hard, non-porous surfaces with a sponge, brush, cloth, {by immersion}, {mechanical spray device,} {{hand pump} coarse pump or trigger spray device}. Immerse all halters and other types of equipment used in handling and restraining animals, as well as forks, shovels, and scrapers used for removing litter and manure in the use solution. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Treated surfaces must remain wet for 10 minutes. Ventilate buildings, coops and other closed spaces. Do not house [{animals} {poultry} {livestock}] or employ equipment until treatment has been absorbed, set or dried. Thoroughly scrub all treated feed racks, troughs, automatic feeders, fountains and waterers and other treated equipment which can contact food or water with soap or detergent, and rinse with potable water before reuse.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,669,NULL,4234),(5948,'HATCHERIES',NULL,'HATCHERIES:','Use to treat hatchers, setters, trays, racks, carts, sexing tables, delivery trucks and other hard surfaces. Use 3 oz. of this product per 5 gal. of water. Leave all treated surfaces wet for 10 minutes or more. Allow to air dry. VEHICLES: Clean all vehicles including mats, crates, cabs, and wheels with water and this product. Use 3 oz. of this product per 5 gal. of water. Apply use solution to treat all vehicles. Leave treated surfaces wet for 10 minutes or more. Allow to air dry.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,669,NULL,4235),(5949,'DRESSING/RENDERING PLANT',NULL,'DRESSING {/RENDERING} PLANT:','Disinfect equipment, utensils, walls and floors in poultry and animal dressing plants. Disinfect offal rooms, exterior walls and loading platforms of dressing plants. Cover or remove all food and packaging materials. Remove all heavy soils prior to application. Saturate all surfaces with a solution of [{3 oz. of this product per 5 gal. of water} {(or equivalent use dilution)} and scrub to loosen all soils. Surfaces must remain wet for 10 minutes, and then be thoroughly rinsed with potable water before operations are resumed. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,669,NULL,4236),(5950,'TERRARIUM AND SMALL ANIMAL CAGE',NULL,'TERRARIUM AND SMALL ANIMAL CAGE AND CAGE FURNITURE DISINFECTION:','{Animals frequently defecate on hot rocks and other hard, non-porous cage furniture items inside your terrarium. This can result in high bacteria and ammonia levels that can lead to possible infection/disease in your animals. When used regularly, this product can eliminate these high bacteria/ammonia levels in your cage and on your cage furniture items.} (Do not use on porous rocks, hot rocks, and driftwood.)  ','Note: Substrates for desert terrariums (i.e. gravel) must be completely dry before returning to terrarium to avoid high humidity levels. Always replace substrate if a foul odor persists. Do not apply this product directly onto the small animal. If this product comes into contact with the small animals skin, then immediately wash the material off of the animal with lukewarm water. If the small animal ingests this product, contact your veterinarian immediately. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,669,NULL,4237),(5951,'REPTILE TANK',NULL,'REPTILE TANK CLEANING AND DISINFECTION DIRECTIONS:  ','Remove all reptiles from the [{enclosure} {tank}] prior to cleaning and disinfecting. Remove all litter or drippings from surfaces. Empty all equipment used for feeding or watering reptiles. Thoroughly clean all surfaces with soap or detergent and rinse with water.  Apply disinfecting and virucidal* solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} {(450 ppm active)} {to hard, non-porous surfaces of the enclosure {tank}}. Apply by cloth, mop, brush, sponge, auto scrubber, mechanical spray device, {{hand pump} coarse pump or trigger spray device} or by immersion until thoroughly wet. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Allow surfaces to remain wet for 10 minutes. Wipe dry {with a paper towel}. Rinse all surfaces that come in contact with food with potable water before reuse. Allow the enclosure {tank} to ventilate for a minimum of 10-15 minutes before replacing the reptiles. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,'Do not apply this product directly onto the reptile. If this product comes into contact with the reptiles skin, then immediately wash the material off of the animal with lukewarm water. If the reptile ingests this product, contact your veterinarian immediately',NULL,NULL,NULL,6,NULL,NULL,669,NULL,4238),(5952,' NON-FOOD CONTACT SURFACES IN ANIMAL PREMISES',NULL,'SANITIZER DIRECTIONS FOR NON-FOOD CONTACT SURFACES IN ANIMAL PREMISES ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,669,NULL,4239),(5953,'HOOF TRIMMING EQUIPMENT',NULL,'TO SANITIZE HOOF TRIMMING EQUIPMENT:  ','Prior to application, pre-clean hoof trimming equipment before and after use on each animal with detergent and warm water or compatible cleaner to remove soil using a pre-scrape, pre-flush, or when necessary, pre-soak followed by a potable water rinse. To sanitize, add Add {{OneOzPacket}} of this product per 5 gal. of water {{150PPM}} {{EquivalentDilution}}. Treated surfaces must remain wet for 3 minutes. Prepare a fresh solution daily or when visibly dirty. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,669,NULL,4240),(5954,'MEDICAL',NULL,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. {This product can be used to pre-clean or decontaminate critical or semi-critical medical devices prior to sterilization or high-level disinfection.} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,670,NULL,4241),(5955,'NON-MEDICAL',NULL,'This product is not for use on medical device surfaces.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,670,NULL,4242),(5956,'DILUTION TABLE',NULL,'{{#DILUTION TABLE}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,670,NULL,4243),(5957,'FOGGING FOOD PREMISES',NULL,'{{FoggingFoodPremises}} ','ALL SURFACES MUST BE CLEANED AND DISINFECTED IN ACCORDANCE WITH LABEL DIRECTIONS PRIOR TO FOGGING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,670,NULL,4244),(5958,'DAIRIES, BEVERAGE AND FOOD PROCESSING PLANTS',NULL,'DIRECTIONS FOR FOGGING IN DAIRIES, BEVERAGE AND FOOD PROCESSING PLANTS:','Prior to fogging, food products and packaging material must be removed from the room or carefully protected. After disinfecting, fog desired areas using 1 quart per 1000 cubic feet of room area with a solution containing 1.5 oz. of product per gal. of water {(1,200 ppm active)} {(or equivalent use dilution)}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Vacate the area of all personnel during fogging and for a minimum of 2 hours after fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. All food contact surfaces must be sanitized with an EPA approved food contact sanitizer solution prior to use.  All food contact surfaces must be thoroughly rinsed with potable water prior to sanitizing.','Note:  The fog generated is irritating to the eyes, skin and mucous membranes. Under no circumstances must a room or building be entered by anyone within two hours of the actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. If the building must be entered, then the individuals entering the building must wear a self-contained respirator approved by NIOSH/MSHA, goggles, long sleeves and long pants.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,670,NULL,4245),(5959,'FOGGING POULTRY HOUSES',NULL,'{{FoggingPoultryHouses}}','ALL SURFACES MUST BE CLEANED AND DISINFECTED IN ACCORDANCE WITH LABEL DIRECTIONS PRIOR TO FOGGING. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,670,NULL,4246),(5960,' HATCHERY ROOMS',NULL,'TREATMENT OF HATCHERY ROOMS USING FOGGING DEVICES: ','Remove all animals and feed from premises, vehicles and enclosures. Remove all litter and manure from floors, walls and surfaces of the room to be treated. Empty all troughs, racks and other feeding and watering appliances. Thoroughly clean all surfaces with soap or detergent and rinse with water. Close room off so fog is confined to room to be treated. Mix 140 oz. of this product per 2.5 gal. of water {{EquivalentDilution}}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Insert the nozzle of the fogger through a suitable opening into the room. With the setting in maximum output, fog for one minute for each 4000 cubic feet of space in the room. Under no circumstances will a room be entered by anyone within 2 hours of actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. When fogging is completed ventilate buildings and other closed spaces. Do not house {{Livestock}} or employ equipment until treatment has been absorbed or dried. Thoroughly clean all treated surfaces with soap or detergent and rinse with water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,670,NULL,4247),(5961,'INCUBATORS AND HATCHERS',NULL,'TREATMENT OF INCUBATORS AND HATCHERS USING FOGGING DEVICES: ','Only for treatment of setters and hatchers after poultry/chicks/eggs have been removed. Not for treatment of hatchers which contain chicks/eggs. Mix 14.5 oz. of this product per gal. of water {(or equivalent use dilution)}. Wear a dust mist respirator when mixing the use solution and pouring it into the fogging apparatus. Fog 3-8 oz. of this into setters and hatchers immediately after transfer. Repeat daily in setters and every 12 hours in hatchers. Discontinue hatcher treatments at least 24 hours prior to pulling the hatch. Do not allow people to contact or breathe this fog. It is acceptable to fog setters and hatchers with a 1.1 oz. of this product per gal. of water solution {(or equivalent use dilution)} on an hourly or every other hour basis. If this is done, fog for 30-90 seconds once per hour or once every two hours. When fogging is complete, ventilate buildings, and other closed spaces. Do not house livestock or employ equipment until treatment has been absorbed or dried. Thoroughly scrub all treated feed racks, mangers, troughs, automatic feeders, fountains and waterers, and other treated equipment with soap or detergent, and rinse with potable water before reuse. Under no circumstances will a room be entered by anyone within two hours of the actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility.  ','Note:  The fog generated is irritating to the eyes, skin and mucous membranes. Under no circumstances must a room or building be entered by anyone within two hours of the actual fogging and a minimum of 4 air exchanges (ACH) per hour in the facility. If the building must be entered, then the individuals entering the building must wear a self-contained respirator approved by NIOSH/MSHA, goggles, long sleeves and long pants.',NULL,NULL,NULL,'The following statement must be used with either of the previous two fogging directions for use.',NULL,NULL,NULL,8,NULL,NULL,670,NULL,4248),(5962,'GROOMING IMPLEMENTS',NULL,'FOR USE AS A DISINFECTANT, VIRUCIDE* OF GROOMING CLIPPERS, HAIR CLIPPERS, ELECTRIC SHEARS, BARBER/SALON SHEERS AND OTHER IMPLEMENTS {{InstrumentsTools}}:','{{RemoveParticles}} Immerse pre-cleaned barber/salon tools such as combs, brushes, {{PlasticRollers}} razors, {{ClipperTrimmerBlades}}, {{Tweezers}} manicure/pedicure tools, scissors, and other salon instruments and tools in a use solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} for at least 10 minutes. Rinse thoroughly and dry before use. Prepare a fresh solution daily or when visibly dirty. ','Note: Plastic instruments can remain immersed until ready to use. Stainless steel shears and other metal instruments must be removed after 10 minutes, rinsed, dried and kept in a clean, non-contaminated receptacle. Prolonged soaking will cause damage to metal instruments.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,671,NULL,4249),(5963,'FOOTBATHS',NULL,'FOR USE AS A DISINFECTANT, VIRUCIDE* OF HARD, NON-POROUS SURFACES IN FOOTBATHS:','To remove body oils, dead tissue, soil and all other buildups or organic matter on surfaces after using the footbath, drain the water and thoroughly clean all surfaces with soap or detergent, then rinse with water. Apply a use solution of 3 oz. of this product per 5 gal. of water  {(or equivalent use dilution)} on all surfaces with a brush, cloth, mop, sponge, {{PumpSpray}}. Brush or swab thoroughly and allow solution to stand for 10 minutes. For spray applications, spray 6-8 inches from surface. Do not breathe spray. After the unit has been thoroughly disinfected, rinse all surfaces with fresh water. The unit is then ready for reuse.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,671,NULL,4250),(5964,'BARBER/SALON NON-FOOD CONTACT SURFACES',NULL,'SANITIZER DIRECTIONS FOR NON-FOOD CONTACT SURFACES IN BARBER/SALON FACILITIES  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,671,NULL,4251),(5965,'BARBER/SALON INSTRUMENTS AND TOOLS',NULL,'TO SANITIZE [{BARBER} {MANICURE} {NAIL} {SALON}] INSTRUMENTS AND TOOLS:','Immerse pre-cleaned barber/salon instruments and tools {{InstrumentsTools}} in a use-solution of 1 oz. of this product per 5 gal. of water {{EquivalentDilution}} for at least 3 minutes. Rinse thoroughly and dry before use. Prepare a fresh solution daily or when visibly dirty. ','Note: Plastic instruments can remain immersed until ready to use. Stainless steel shears and other metal instruments must be removed after 10 minutes, rinsed, dried, and kept in a clean non-contaminated receptacle. Prolonged soaking will cause damage to metal instruments.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,671,NULL,4252),(5966,'TOILET BOWL AND URINAL DISINFECTANT/CLEANING',NULL,'NON-ACID TOILET BOWL {{Urinal}} DISINFECTANT {{Cleaning}} DIRECTIONS ','Remove heavy soil prior to disinfection.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,672,NULL,4253),(5967,'HEAVY DUTY CLEANING OF TOILET BOWLS AND URNINALS',NULL,'FOR HEAVY DUTY CLEANING OF TOILET BOWLS AND URNINALS: ','Pre-clean heavily soiled areas. Empty toilet bowl or urinal and apply 1.2 oz. of this product to exposed surfaces including under the rim with toilet {{BrushMop}}, cloth, or sponge, or mechanical spray device, {{SprayDevices}}. To aid in soil removal, allow to soak. For sprayer application, spray 6-8 inches from surface. Brush or swab thoroughly and allow solution to stand for 10 minutes and flush.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,672,NULL,4254),(5968,'DEEP CLEANING URINALS',NULL,'{{Deep}} CLEANING/DISINFECTING {{Waterless}} URINALS: ','Preliminary cleaning is required for heavily soiled surfaces. Remove and properly dispose of cartridge according to manufacturers directions. Deep clean or disinfect the entire urinal by applying 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} directly onto surface. {{BrushScrub}} surfaces and let solution stand for 10 minutes. Wipe surface to clean. Change cartridge as needed. The unit is ready for use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,672,NULL,4255),(5969,'CLEAN WATERLESS URINALS',NULL,'TO CLEAN WATERFREE {{Waterless}} URINALS: ','Remove any debris from the urinal. Spray 0.5 to 1 oz. of use solution onto urinal surface. To prepare use solution: add 0.6 oz. of this product per gal. of water {{EquivalentDilution}} {{450PPM}}. DO NOT spray product directly onto cartridge. Wipe surface to clean. Change cartridge as needed. The unit is ready for use. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,672,NULL,4256),(5970,'CLEAN OPEN AREAS WITH FLOOR DRAINS',NULL,'FOR USE TO CLEAN AND DISINFECT SHOWER ROOMS, LOCKER ROOMS AND OTHER LARGE, OPEN AREAS WITH FLOOR DRAINS:  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,672,NULL,4257),(5971,'GENERAL CLEANER/DEODORIZER',NULL,'FOR USE AS A {GENERAL} CLEANER {AND/OR DEODORIZER}: ','Apply use solution of 1.75 oz. of this product per 5 gal. of water to hard, non-porous surfaces. {{RinseWipeAirDry}}. For heavy-duty use, {{AddMix}} 4 oz. of this product per 5 gal. to clean hard, non-porous surfaces. ','Not for use in heat vaporizing or atomizing type vaporizer humidifiers. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,673,NULL,4258),(5972,'GENERAL DEODORIZER',NULL,'GENERAL DEODORIZATION','To deodorize, apply 1.75 oz. of this product per 5 gal. of water to hard, non-porous surfaces. {{RinseWipeAirDry}}. ','Not for use in heat vaporizing or atomizing type vaporizer humidifiers. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,673,NULL,4259),(5973,'SEPTIC STORAGE TANKS',NULL,'FOR DEODORIZING SEPTIC STORAGE TANKS: ','Pre-clean heavily soiled areas. When tanks are empty, pour 1.75 oz. of this product for every 5 gal. of water in tank on recreational vehicles, campers and boats to control odors. As tank fills with sewage and the vehicle is moving, this solution will mix and provide an adequate deodorizing solution for this use. This product is to be used on gray and black water tanks only. Check with local, state, or federal authorities before disposing of sewage in accordance to federal, state and local regulations for waste disposal. (Not for use in CA.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,673,NULL,4260),(5974,'RV HOLDING TANKS',NULL,'RV HOLDING TANKS/RECREATIONAL VEHICLES: ','For toilet waste and holding tanks, cover bottom of holding tank with water and add 1.75 to 3 oz. of this product per 5 gal. of water to deodorize. If odors return before time to empty, add another 1.75 to 3 oz. per 5 gal. of water to the tank. For kitchen waste, add 1.75 to 3 oz. per 5 gal. of water to gray water tank as needed to control malodors created by dirty dishwater. (Not for use in CA.)  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,673,NULL,4261),(5975,'AUTOMOTIVE',NULL,'AUTOMOTIVE USES: ','A solution of 1.75 oz. of this product per 5 gal. of water will effectively neutralize {{DampMusty}} odors. Spray or apply onto seats, carpets, headliner and ashtray or into trunk and all vents to eliminate odors from tobacco, food, beverage spills and musty carpet. For sprayer applications, use a coarse spray device. {{WipeAirDry}}.  (Not for use in CA.)','Not for use in heat vaporizing or atomizing type vaporizer humidifiers. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,673,NULL,4262),(5976,'AIR FRESHENER',NULL,'AIR FRESHENER: ','A solution of 1.75 oz. of this product per 5 gal. of water will effectively neutralize {{DampMusty}} odors caused by mildew in storage areas, basements, closets, bathrooms and A/C filters. Spray to eliminate odors from tobacco, food, beverage spills and musty carpet. For sprayer applications, use a coarse spray device. {{WipeAirDry}}.  (Not for use in CA.)','Not for use in heat vaporizing or atomizing type vaporizer humidifiers. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,673,NULL,4263),(5977,'WATERBED CONDITIONER',NULL,'WATERBED CONDITIONER (Not for use in CA.): ','When used as a waterbed conditioner, this product eliminates odor. If bed has not been treated properly, drain bed completely. Add 15 gal. of water, mix vigorously, drain bed again. Fill bed with water and follow dosage directions. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,673,NULL,4264),(5978,'GLASS CLEANING',NULL,'GLASS CLEANING {{Deodorizing}} DIRECTIONS:','Use a 1.75 oz. of this product per 5 gal. of water use solution to clean and deodorize windows, mirrors, and glass surfaces. Use a coarse spray device. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Rub with sponge or cloth. Change cloth, sponge or towels frequently to avoid re-deposition of soil. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,673,NULL,4265),(5979,'FINISHED FLOORS',NULL,'FOR USE AS A CLEANER ON FINISHED FLOORS:  ','To limit gloss reduction, use 1.75 oz. of this product per 5 gal. of water. Apply with a damp mop or auto scrubber. Allow surface to air dry. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,673,NULL,4266),(5980,'CARPET CLEANING',NULL,'CARPET CLEANING',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,673,NULL,4267),(5981,'SPECIAL CARPET CLEANING',NULL,'SPECIAL INSTRUCTIONS FOR CLEANING CARPETS: ','This product can be used to clean carpets in industrial, institutional, commercial and residential areas such as homes, motel & hotel chains, nursing homes, schools and hospitals. For use on wet, cleanable synthetic fibers. Do not use on wool. Vacuum carpet thoroughly prior to cleaning. Test fabric for color fastness. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,673,NULL,4268),(5982,'Portable Extraction Units',NULL,'For Portable Extraction Units: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}}.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,673,NULL,4269),(5983,'Truck Mounted Extraction Machines',NULL,'For Truck Mounted Extraction Machines: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}} and meter at 5 gal. per hour',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,NULL,NULL,673,NULL,4270),(5984,'Rotary Floor Machines',NULL,'For Rotary Floor Machines: ','Mix 1.1 oz. of this product per 1 gal. of water {{EquivalentDilution}} and apply at the rate of 300-500 sq. ft. per 1 gal. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,14,NULL,NULL,673,NULL,4271),(5985,'Do not mix',NULL,NULL,'Do not mix this product with other cleaning products. Follow the cleaning procedures specified by the manufacturer of the cleaning equipment. After using this product set the carpet pile and protect the carpet from furniture legs and bases while drying. Do not over wet. If applied to stain resistant nylon carpet, apply a fabric protector according to the carpet manufacturers directions.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,NULL,NULL,673,NULL,4272),(5986,'CARPET HOME',NULL,'CARPET {{Cleaning/Deodorizing}} FOR HOME, INSTITUTIONAL, INDUSTRIAL AND HOSPITAL USE: ','This product {{CleansDeodorizes}} the carpet. It can be used in industrial, institutional, commercial and residential areas such as homes, motels, hotel chains, nursing homes and hospitals. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,NULL,NULL,673,NULL,4273),(5987,'Vacuum carpet thoroughly',NULL,NULL,'Vacuum carpet thoroughly prior to application. Mix 1.1 oz. per gal. of water {{EquivalentDilution}}. Follow the injection and/or extraction procedures as specified for any conventional steam cleaning equipment you are using. For rotary floor machines, mix 1.1 oz. of this product per gal. of water and spray on carpet at a rate of 300-500 sq. ft. per 1 gal.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,17,NULL,NULL,673,NULL,4274),(5988,'Washable synthetic fibers',NULL,NULL,'{{Use}} on washable synthetic fibers. Do not use on wool. Test color fastness of carpet before use. Apply diluted product to a small concealed spot, then rub with a clean white cloth. If color changes or transfers to the cloth, a water-based product must not be used. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,NULL,NULL,673,NULL,4275),(5989,'After using',NULL,NULL,'After using the product, set carpet pile in one direction with a stiff brush. Place aluminum foil under the legs of furniture while carpet is drying. Over-wetting can cause carpet to shrink. Manufacturer assumes no responsibility for over-wetting misuse. ','Note: This product must not be mixed with other cleaning products',NULL,NULL,NULL,NULL,NULL,NULL,NULL,19,NULL,NULL,673,NULL,4276),(5990,'SEWER BACKUP & RIVER FLOODING',NULL,'SEWER BACKUP & RIVER FLOODING: ','To use as a deodorizer, dilute 1.1 to 2.2 oz. of this product per gal. of water allowing for the diluting effect of absorbed water within saturated materials. Remove gross filth or heavy soil along with non-salvageable materials. Saturate all affected areas with a mechanical spray device, {{CoarsePumpTriggerSprayDevice}} before and after cleaning and extraction. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Use proper ventilation; open windows. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,674,NULL,4277),(5991,'POROUS MATERIALS',NULL,'CARPETS, CARPET CUSHIONS, UPHOLSTERY, DRAPES AND OTHER POROUS MATERIALS, SUB FLOORS, DRYWALL, TRIM AND FRAME LUMBER, TACKLESS STRIP AND PANELING: ','To use as a deodorizer against water damage, extract the excess water. Test hidden area for colorfastness. Dilute 1.1 to 2.2 oz. of this product per gal. of water, allowing for the diluting effect of absorbed water within saturated materials. Remove gross filth or heavy soil. Apply directly with a mechanical spray device {or coarse pump or trigger spray device} to fully saturate affected materials. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Roll, brush or agitate into materials. Follow with a thorough extraction. Dry rapidly and thoroughly. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,674,NULL,4278),(5992,'WATER/SMOKE DAMAGE',NULL,'{{WaterSmoke}} DAMAGE RESTORATION: ','Effective against odor caused by smoke and water damage for home, institutional, industrial and hospital use. This product is particularly suitable for use in water damage restoration. Dilute 1.1 to 2.2 oz. of this product per gal. of water, allowing for the diluting effect of absorbed water within saturated materials. Saturate affected materials with enough product to remain wet for at least 10 minutes. Use proper ventilation. (Not for use in CA.)   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,674,NULL,4279),(5993,'DROSOPHILA SPP. AND PHORIDAE FAMILY OF FLIES',NULL,'FOR CONTROL OF DROSOPHILA SPP. AND PHORIDAE FAMILY OF FLIES ON NON-FOOD CONTACT SURFACES: ','To control flies on hard, non-porous non-food contact surfaces such as floors, walls, countertops, metal surfaces, painted surfaces, glazed porcelain, glazed tile, glass, chrome, rubber, and plastic in restaurants, bars, kitchens, dishwashing areas, and bar and wait station areas and other food storage areas. After removing gross filth, apply a solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} to surfaces and locations where flies breed. Spray surfaces thoroughly or apply by pouring, mopping or sponging onto the surface. Allow surface to remain wet for 10 minutes. Repeat application 1-2 times per week or as needed. Do not contaminate food and food packaging.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,675,NULL,4280),(5994,'SMALL FLIES IN DRAINS',NULL,'FOR CONTROL OF SMALL FLIES IN DRAINS:  ','For control of small flies: Drosophila spp. and the Phoridae family. Spray or pour solution of {{3oz}} of this product per 5 gal. of water {{EquivalentUse}} into the drain during time of lowest level of drain use. Add 14 oz. of use solution daily to each drain to maintain fly control. Apply product around the edge of the drain and thoroughly coat inside of drain. Repeat application 1-2 times per week or as needed. Do not contaminate food and food packaging.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,675,NULL,4281),(5995,'MUSHROOM FARM INDUSTRY',NULL,'MUSHROOM FARM INDUSTRY USE DIRECTIONS ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,675,NULL,4282),(5996,'CITRUS CANKER CONTROL',NULL,'CITRUS CANKER CONTROL (Not For Use in CA): ','For prevention of Citrus Canker Disease through treatment of pre-cleaned equipment. Effective against Xanthomonas axonopodis pv. citri {{CitrusCanker}} at 2000 ppm active. Treatment can be applied to trucks, attached trailers, field harvesting equipment, including cargo area, wheels, tires, undercarriage, hood, roof, fenders and any other hard, non-porous part of equipment that can be taken into infested areas. Thoroughly clean all surfaces with soap or detergent and rinse with water. Then saturate surfaces with a use dilution of 2.5 oz. of this product per gal. of water {{EquivalentDilution}} {{2000PPM}} for a period of 10 minutes. Allow to air dry. All surfaces that come in contact with food or crop must be rinsed with potable water before reuse. To prevent the spread of Citrus Canker Disease by this artificial means of transportation, treatments are made by trigger spraying, dipping or brushing. Clothing must be either thoroughly rinsed or laundered before reuse. Footwear must be rinsed before reuse. Prepare a fresh solution daily or when visibly dirty',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,675,NULL,4283),(5997,'WHIRLPOOL UNITS DISINFECTION/VIRUCIDE*',NULL,'DISINFECTION/VIRUCIDE* OF HARD, NON-POROUS SURFACES IN WHIRLPOOL UNITS: ','After using the whirlpool unit, drain unit. Prepare a use solution of 3 oz. of the product per 5 gal. of water {{EquivalentDilution}} and refill with use solution to just cover intake valves {{2InchesAboveHighestJet}}. Briefly start the pump to circulate the solution. Turn off the pump. Wash down the unit sides, seat of the chair lift and any other related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 10 minutes. After the unit has been thoroughly disinfected, drain the solution from the unit and rinse disinfected surfaces with fresh water. Wipe dry with a clean sponge or cloth or allow to air dry. Repeat for heavy soiled units. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,675,NULL,4284),(5998,'WHIRLPOOL UNITS SANITIZATION',NULL,'SANITIZATION OF HARD, NON-POROUS SURFACES IN WHIRLPOOL UNITS: ','To remove body oils, dead tissue, soil and all other buildups or organic matter on surfaces after using the whirlpool unit, drain unit. Prepare a use solution of 0.25 oz. of this product per gal. of water {{EquivalentDilution}} and refill with use solution to just cover the intake valves {{2InchesAboveHighestJet}}. Briefly start the pump to circulate the solution. Turn off the pump. Wash down the unit sides, seat of the chair lift and any other related equipment with a clean swab, brush or sponge. Treated surfaces must remain wet for 3 minutes. After the unit has been thoroughly sanitized, drain the solution from the unit and rinse all with fresh water. Repeat for heavy soiled units. Then the unit is ready for reuse.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,675,NULL,4285),(5999,'BAGLESS VACUUM CLEANERS',NULL,'FOR DISINFECTING BAGLESS VACUUM CLEANERS: ','Add 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Turn off and unplug vacuum cleaner. Remove the hard, non-porous container that houses collected material from the vacuum cleaner. Empty contents into a waste receptacle. Rinse collection container with water and wipe clean to remove any additional collected material. Apply use solution to collection container with a brush, cloth, mop, sponge, mechanical spray device, {{{SprayDevices}} so as to wet all surfaces thoroughly. {{SprayerApplications}} Allow surfaces to remain wet for 10 minutes. Wipe up excess liquid with a clean cloth or sponge or allow to air dry. Reattach container to vacuum cleaner. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,675,NULL,4286),(6000,'VACUUM CLEANER BRUSHES',NULL,'FOR DISINFECTING NON-POROUS VACUUM CLEANER BRUSHES: ','Add 3 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Turn off and unplug vacuum cleaner. Remove the non-porous brushes from vacuum cleaner. Submerge brush in use solution so as to wet all surfaces thoroughly. Allow surfaces to remain wet for 10 minutes. Wipe up excess liquid with a clean cloth or sponge or allow to air dry. Reattach brushes to vacuum cleaner. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,675,NULL,4287),(6001,'COMMERCIAL FLORIST',NULL,'COMMERCIAL FLORIST USE DIRECTIONS: ','To clean, disinfect {{Deodorize}} hard, non-porous surfaces, prepare use solution of 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}}. For heavy-duty use, add 4 oz. of this product per 5 gal. of water {{EquivalentDilution}}. Remove all leaves, petals, garbage and refuse. Pre-clean surfaces using pressurized water where possible. Apply use solution to hard, non-porous surfaces, thoroughly wetting surfaces as required, with a cloth, mop, brush, sponge, {{AutoScrubber,}} or mechanical spray device, {{SprayDevices}}. For sprayer applications, spray 6-8 inches from surface. Rub with brush, sponge, mop or cloth. Do not breathe spray. Treated surfaces must remain wet for 10 minutes. Wipe up excess or allow to air dry. Change cloth, sponge or towels frequently to avoid re-deposition of soil. Prepare a fresh solution daily or when visibly dirty.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,675,NULL,4288),(6002,'WORK AREAS AND BENCHES',NULL,'WORK AREAS AND BENCHES, POTS, FLATS AND FLOWER BUCKETS, CUTTING TOOLS: ','Pre-clean surfaces. {{SpraySwabSoak}} with a solution of 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}} before each work period and again after each plant is completed {{ControlDiseaseTransfer}}. Allow surface to remain wet for 10 minutes. To apply solution as a sprayer application, use as a coarse spray only and spray 6-8 inches from surface. Wipe up excess liquid or allow to air dry. {{DryOilTools}} Prepare a fresh solution daily or when visibly dirty. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,675,NULL,4289),(6003,'CLEANSING OF EXTERIOR BODY SURFACES',NULL,'CLEANSING OF EXTERIOR BODY SURFACES OF {{HumanRemains}}: ','To cleanse away skin secretions and accompanying malodor, to ensure the removal of all soil and bloodstains, and to remove and reduce surface contamination, apply 1.75 oz. of this product per 5 gal. of water {{EquivalentDilution}} to the exterior surfaces of the body. Bathe the entire body using sponge or washcloth. A soft brush may be employed on surfaces other than the face. Allow a 10 minute contact time for optimal results. Prepare a fresh solution for each human remain. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,675,NULL,4290),(6004,'KITCHEN/BATHROOM/HOUSEHOLD',NULL,'CLEAN/DISINFECT/DEODORIZE {{KitchenBathroomHousehold}} SURFACES: ','Pre-clean surfaces. Apply a solution of 3 oz. of this product per 5 gal. of water {{EquivalentDilution}} with brush, cloth, mop, sponge, mechanical spray device, {{SprayDevices}}. For spray applications, hold container 6 to 8 inches from surface and spray until thoroughly wet. For disinfection, treated surfaces must remain wet for 10 minutes. Wipe up excess liquid or allow to air dry. Rinse with potable water after use on surfaces that come in contact with food. This product is not to be used to clean or disinfect dishware, glasses or eating utensils. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,676,NULL,4291),(6005,'EXTERIOR HOUSEHOLD SURFACES',NULL,'SANITIZATION OF EXTERIOR HOUSEHOLD SURFACES DIRECTIONS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,676,NULL,4292),(6006,'LAUNDRY',NULL,'COMMERCIAL AND INSTITUTIONAL LAUNDRY USE: ','For residual bacteriostatic activity against gram negative and/or gram positive odor-causing bacteria and/or residual self-sanitizing activity against Klebsiella pneumoniae and Staphylococcus aureus, use this product as directed. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,677,NULL,4293),(6007,'Initial Treatment',NULL,'Initial Treatment:','Use 10 oz. of this product per 100 pounds of fabric (dry weight) {{EquivalentDilution}}. Dilute the appropriate amount of this product in one to two gal. of water, and then add solution to the wash wheel at the beginning of the final rinse cycle. A minimum rinse cycle time of 5 minutes is required',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,677,NULL,4294),(6008,'Repeat Treatment',NULL,'Repeat Treatment: ','Repeat Treatment: Follow Initial Treatment directions and re-treat fabric after each washing {{IfOdorPersists}}. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,677,NULL,4295),(6009,'LAUNDRY BACTERIOSTAT',NULL,'LAUNDRY BACTERIOSTAT FOR COMMERCIAL, INDUSTRIAL, AND NON-MEDICAL INSTITUTIONAL LAUNDRY APPLICATIONS: ','This product provides the fabric with residual bacteriostatic activity against odor causing gram-negative and gram-positive bacteria when added to the final rinse at a rate of 10 oz. of this product per 100 lbs. of dry laundry. This product was evaluated against:  Corynebacterium ammoniagenes {{ATCC6872}} Klebsiella pneumoniae {{ATCC4352}} Staphylococcus aureus {{ATCC6538}} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,677,NULL,4296),(6010,'LAUNDRY DEODORIZER ',NULL,'LAUNDRY DEODORIZER {AGAINST ODOR CAUSING BACTERIA}: ','For activity against odor causing bacteria caused by conditions of high relative humidity or wet contamination, use 12 oz. of this product per 100 pounds of dry weight fabric. Dilute the appropriate amount of this product in one to two gal. of water, and then add to the wash wheel in the final rinse. Re-treat fabric after each washing. Laundered fabric may also be treated by soaking. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,677,NULL,4297),(6011,'PRESERVATION AGAINST MILDEW',NULL,'PRESERVATION AGAINST MILDEW BY SOAKING: ','Use 10 oz. of this product per 100 pounds of fabric (dry weight). A minimum soaking time of 5 minutes is required.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,677,NULL,4298),(6012,'LAUNDRY SANITIZER',NULL,'LAUNDRY SANITIZER: ','When added at the rate of 1 oz. of this product per gal. water {{Yield780PPM}} {{12Oz}} {{EquivalentDilution}} {{780PPM}}, this formulation provides sanitization against Staphylococcus aureus, Klebsiella pneumoniae, Pseudomonas aeruginosa, and Staphylococcus aureus Methicillin Resistant (MRSA) and is effective against HIV-1 in rinse water up to 200 ppm hard water.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,677,NULL,4299),(6013,'KILLS HIV-1 ON LAUNDRY',NULL,'KILLS HIV-1 ON LAUNDRY IN COMMERCIAL, INDUSTRIAL AND INSTITUTIONAL APPLICATIONS. ','This product provides virucidal* activity against HIV-1 on fabrics when presoaked with a 4 minute contact time followed by normal washing in detergent and rinsing at a rate of 12 oz. of this product per 100 lbs. of dry laundry in water hardness up to 200 ppm.  ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,677,NULL,4300),(6014,'LAUNDRY SANITIZING',NULL,'LAUNDRY SANITIZING DIRECTIONS FOR USE: ','For sanitizing step, fill washer to low water level with minimum temperature water of 95°F. Using an appropriate {{#CompanyName}}} dispenser, inject this product into the sanitizing rinse step at the rate of 1 oz. of this product per gal. water {{Yield780PPM}} {{12Oz}} {{780PPM}} {{EquivalentDilution}}. Treat the laundry for a minimum of 5 minutes at a minimum temperature of 95°F. Other laundry additives, such as fabric softeners, laundry sours, starch and sizing must be used per manufacturers instructions in subsequent rinse cycles after the sanitizing rinse cycle.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,NULL,677,NULL,4301),(6015,'LAUNDRY FINAL CYCLE',NULL,'LAUNDRY SANITIZING DIRECTIONS FOR USE: ','This product is used in the final, warm rinse cycle at a low water level. Dilute at 1 oz. of this product per gal. of water {{12Oz}} {{780PPM}} {{EquivalentDilution}}, then add to the wash in the final rinse, or dispense directly through automatic dispensing equipment. Run for a minimum of 5 minutes. Retreat as necessary. This product will not harm fabrics. DO NOT USE IN THE PRESENCE OF, OR MIX WITH OTHER CHEMICALS.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,NULL,677,NULL,4302),(6016,'SMALL COMMERCIAL WASHING MACHINES',NULL,'FOR USE IN SMALL COMMERCIAL WASHING MACHINES: ','Use the chart below to determine the equivalent use dilution per wash load for use as a Laundry Sanitizer in small commercial washing machines. This is based on 12 oz. of this product per 100 lbs. of dry laundry. ','{{#SmallWasherCapacity}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,NULL,677,NULL,4303),(6017,'CONSUMER WASHING MACHINES',NULL,'FOR USE IN CONSUMER OR HOUSEHOLD TYPE WASHING MACHINES:',' Use the chart below to determine the equivalent use dilution per wash load for use as a Laundry Sanitizer in consumer or household type washing machines. This is based on 12 oz. of this product per 100 lbs. of dry laundry.','{{#ConsumerWasherCapacity}}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,NULL,677,NULL,4304),(6018,'RECIRCULATING COOLING WATER TOWERS',NULL,'INDUSTRIAL {{AND/OR} COMMERCIAL} RECIRCULATING COOLING WATER TOWERS, RETORT WATER SYSTEMS (Not for use in CA.) ','Cooling tower waters that are inherently low in algae growth and bacteria count may be adequately controlled by the lower range of these dosages. Repeat every seven days or increase frequency if needed. Should slime develop again, repeat initial dosage.\r\n\r\nFor best results, clean heavily contaminated systems before treatment with this product. If soap or anionic detergent is used, rinse thoroughly before charging with this algaecide.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,678,NULL,4305),(6019,'ONCE THROUGH WATER COOLING SYSTEM',NULL,'ONCE THROUGH FRESH {{AndSea}} WATER COOLING SYSTEM (Not for use in CA.) ','Use of the product in either public/municipal or single or multiple family private/residential potable/drinking water systems is strictly prohibited. Use of the product in any cooling water system that discharges effluent within 0.25 mile of either a public/municipal or single or multiple family private/residential potable/drinking water intake is strictly prohibited.\r\n\r\nFor best results, slug feed. The frequency of addition of microbiocide needed depends on many factors. To optimize your use of water treatment microbiocide, follow this procedure.   ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,678,NULL,4306),(6020,'DEACTIVATION',NULL,'DEACTIVATION: ','Use bentonite clay at the minimum ratio of 5 ppm clay to 1 ppm product. This product must be deactivated prior to discharge of the NPDES outfall. Do not apply this product more than 4 times a year. ',NULL,NULL,NULL,NULL,'Deactivation instructions must be used with the above Once Through directions for use.',NULL,NULL,NULL,3,NULL,NULL,678,NULL,4307),(6021,'OILFIELD INJECTION AND WASTE WATER',NULL,'OILFIELD INJECTION AND WASTE WATER (Not for use in CA.): ','This product must be added to the water handling system at a point of uniform mixing such as the area of addition of makeup water to the holding tank.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,678,NULL,4308),(6022,'GAS PRODUCTION AND TRANSMISSION PIPELINE AND SYSTEMS',NULL,'GAS PRODUCTION AND TRANSMISSION PIPELINE AND SYSTEMS: ','For the control of sulfate-reducing bacteria and slime forming bacteria, this product must be added to a gas production or transmission pipeline via direct injection at a point where uniform and maximum distribution will occur. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,679,NULL,4309),(6023,'GAS STORAGE WELLS AND SYSTEMS',NULL,'GAS STORAGE WELLS AND SYSTEMS: ','Treat individual injection wells with this product to produce an effective concentration of 651000 ppm active. Update treatment rate as needed. This product must be diluted by the water present in the formation. Injection takes place before gas is injected and may be repeated yearly or as needed to maintain control. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,679,NULL,4310),(6024,'PIPELINE PIGGING AND SCRAPING OPERATIONS',NULL,'PIPELINE PIGGING AND SCRAPING OPERATIONS: ','Add this product to slug of water immediately following the scraper {(keep the water volume to a minimum and contained between the scraper and the following pig)}. Add an effective concentration to produce 75-500 ppm depending on the length of the pipeline and the severity of the biofouling. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,679,NULL,4311),(6025,'DRILLING, COMPLETION AND WORKOVER FLUIDS SYSTEMS',NULL,'DRILLING, COMPLETION AND WORKOVER FLUIDS SYSTEMS:','Add to the fluid system at a point of uniform mixing such as circulating mud tank. (Not for use in CA.) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,679,NULL,4312),(6026,'PACKER FLUIDS',NULL,'PACKER FLUIDS: ','Add to a packer fluid at a point of uniform mixing such as a circulating holding tank at a rate of 65-1,000 ppm active per 100 barrels of fluid to a freshly prepared fluid depending on the severity of contamination. Seal the fresh packer fluid in the wall between the casing and the production tube. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,679,NULL,4313),(6027,'HYDROTESTING',NULL,'HYDROTESTING: ','Treat water used to hydrotest pipelines or vessels at 65-1,000 ppm active depending on the water quality and length of time the equipment will remain idle. (Not for use in CA.)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,679,NULL,4314),(6028,'AUTOMATED DILUTION SYSTEM',NULL,'AUTOMATED DILUTION SYSTEM {{DilutionSystemsTradeName}} INSTRUCTIONS:',NULL,NULL,NULL,NULL,NULL,NULL,'Y',NULL,NULL,1,NULL,NULL,680,NULL,4315),(6029,'BAG-IN BOX CONTAINERS',NULL,'BAG-IN BOX CONTAINERS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,NULL,680,NULL,4316),(6030,'COARSE TRIGGER SPRAYERS',NULL,'{{Coarse}} TRIGGER SPRAYERS: Fill bottle from dispenser. {{ApplyAccordingToDirectionsAbove}} ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,680,NULL,4317),(6031,'SPRAY USE INSTRUCTIONS',NULL,'SPRAY USE INSTRUCTIONS: ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,680,NULL,4318),(6032,'Spray Cap container language',NULL,'(Spray Cap container language) ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,680,NULL,4319),(6033,'MOP BUCKETS',NULL,'MOP BUCKETS:','Fill bucket from dispenser. Set up Wet Floor signs. Mop floor surfaces as specified in directions above.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,680,NULL,4320),(6034,'PACKETS',NULL,'PACKETS: ','{{SimplyTearOpen}} pour contents into X gal. of water. Keep packets in box until ready to use. ',NULL,NULL,NULL,NULL,'For pre-measured tear open packets only',NULL,NULL,NULL,7,NULL,NULL,680,NULL,4321),(6035,'REFILLS',NULL,'REFILLS',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,NULL,680,NULL,4322);
