n from table or list) {{EquivalentDilution}} of this product by {{CoarsePumpTriggerSprayDevice}} direct pouring or by recirculating through the system. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Surfaces must remain wet for at least 1 minute',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,3453,4083),(6866,NULL,NULL,NULL,'4. {{Drain}} before contact with food/liquid. Do not rinse. Return machine to service. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,3453,4084),(6867,NULL,NULL,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,3453,4085),(6868,NULL,NULL,'Ice Machines  ','Sanitization must occur after initial installation, after the machine is serviced and periodically during its use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3454,4086),(6869,NULL,NULL,NULL,'1. Shut off incoming water line to machine and turn off refrigeration.  2',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3454,4087),(6870,NULL,NULL,NULL,'2. Wash with a compatible detergent and rinse with potable water before sanitizing. (Note: Use this direction only if applicable.) ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,3454,4088),(6871,NULL,NULL,NULL,'3. Apply a solution of (Insert appropriate food contact dilution from table or list)  {{EquivalentDilution}} of this product by mechanical spray, direct pouring, or by recirculating through the system. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,3454,4089),(6872,NULL,NULL,NULL,'4. Allow surfaces to remain wet or solution to remain in equipment for at least 1 minute. Drain thoroughly before reuse and allow sanitized surfaces to adequately drain {{AirDry}} before contact with liquid. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,3454,4090),(6873,NULL,NULL,NULL,'5. Return machine to normal operation. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,3454,4091),(6874,NULL,NULL,'{{Tanks}}  Sanitization must occur after initial installation, after the system is serviced and periodically during its use. ',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,3454,4092),(6875,NULL,NULL,NULL,'1. Unit must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.)',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,3454,4093),(6876,NULL,NULL,NULL,'2. Backwash the softener and add a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product to the brine tank well. {{BrineTank}} {{Note}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,3454,4094),(6877,NULL,NULL,NULL,'3. Proceed with the normal regeneration or interrupt the cycle after the brining step and let the softener soak for a minimum of 1 minute. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,3454,4095),(6878,NULL,NULL,NULL,'4. Backwash the softener with potable water to make sure all sanitizing solution is thoroughly rinsed from the unit before returning the system to service. Return system to service. Follow the manufacturers directions for re-installation of new pre-filters, membrane element and post filter.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,3454,4096),(6879,NULL,NULL,'Water Softeners ','Sanitization must occur after initial installation, after the system is serviced and periodically during its use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3455,4097),(6880,NULL,NULL,NULL,'1. Unit must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.) ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3455,4098),(6881,NULL,NULL,NULL,'2. Backwash the softener and add a solution of (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product to the brine tank well. {{BrineTank}} {{Note}} ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,3455,4099),(6882,NULL,NULL,NULL,'3. Proceed with the normal regeneration or interrupt the cycle after the brining step and let the softener soak for a minimum of 1 minute.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,3455,4100),(6883,NULL,NULL,NULL,'4. Backwash the softener with potable water to make sure all sanitizing solution is thoroughly rinsed from the unit before returning the system to service. Return system to service. Follow the manufacturers directions for re-installation of new pre-filters, membrane element and post filter.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,3455,4101),(6884,NULL,NULL,'Reverse Osmosis (RO) Units  ','Sanitization must occur after initial installation, after the system is serviced and periodically during its use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,3455,4102),(6885,NULL,NULL,NULL,'1. Turn off RO system, drain storage tank and remove membrane element and pre-filters. Put membrane element in a plastic bag so it remains wet. Do not use this product to sanitize the membrane element. Membrane element must be sterilized separately. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,3455,4103),(6886,NULL,NULL,NULL,'2. Tank must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.) ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,3455,4104),(6887,NULL,NULL,NULL,'3. Fill empty pre-filter housing with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product and turn on raw water. {{Note}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,3455,4105),(6888,NULL,NULL,NULL,'4. After holding tank is full, let system stand idle for a minimum of 1 minute. Turn off water. Drain holding tank. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,3455,4106),(6889,NULL,NULL,NULL,'5. Before the system is put back into service, flush system with potable water to assure sanitizing solution is rinsed thoroughly from system. Return unit{{s}} to normal operation. Follow the manufacturers directions for re-installation of new pre-filters, membrane element and post filter.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,3455,4107),(6890,NULL,NULL,NULL,'1. Hold pre-mixed sanitizer solution of 1 ounce of this product per 5 gal. 4-6 inches away from sole of {{Waterproof}} {{WorkWear}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3470,4108),(6891,NULL,NULL,NULL,'2. Lightly spray sole to thoroughly wet entire surface',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3470,4109),(6892,NULL,NULL,NULL,'3. Repeat procedure on other sole',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,3470,4110),(6893,NULL,NULL,NULL,'4. Treated surfaces must remain wet for 3 minutes',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,3470,4111),(6894,NULL,NULL,NULL,'5. [{{AllowToAirDry}} {{{WipeUp}} {{Absorb}} excess product {{WithCleanCloth}} {{BySteppingOnNeatFeetCleanShoeSolutionWelcomeMat}}].',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,3470,4112),(6895,NULL,NULL,NULL,'1. Remove all animals. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3480,4113),(6896,NULL,NULL,NULL,'2. Thoroughly clean all surfaces and objects {caves, cage furniture, feeding and watering dishes, and appliances} including the substrate in the terrarium or cage with soap or detergent and rinse with water. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3480,4114),(6897,NULL,NULL,NULL,'3. Saturate all hard, non-porous surfaces {such as floors, walls, cages and other washable hard, non-porous surfaces} with the disinfecting and virucidal* solution of 3 oz. of this product per 5 gal. of water {(or equivalent use dilution)} {(450 ppm active)} so as to wet thoroughly.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,3480,4115),(6898,NULL,NULL,NULL,'4. Apply by cloth, mop, brush, sponge, auto scrubber or mechanical spray device {{hand pump} coarse pump or trigger spray device} or by immersion. For spray applications, spray 6-8 inches from surface. Do not breathe spray. Rub with brush, cloth, or sponge. For smaller surfaces, use a trigger spray bottle to spray all surfaces with solution.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,3480,4116),(6899,NULL,NULL,NULL,'5. Allow surfaces to remain wet for a period of 10 minutes.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,3480,4117),(6900,NULL,NULL,NULL,'6. Saturate gravel as above and let stand for 10 minutes. Place in bucket of clean water and swirl for 15-30 seconds. Thoroughly air dry before returning to terrarium.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,3480,4118),(6901,NULL,NULL,NULL,'7. Thoroughly scrub all treated surfaces (except gravel) with soap or detergent and rinse with potable water before reuse.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,3480,4119),(6902,NULL,NULL,NULL,'8. Do not return animals to the habitat until it is dry and ventilated.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,3480,4120),(6903,NULL,NULL,NULL,'9. Clean terrarium at least once weekly or more as needed. Change cloth, sponge or towels frequently to avoid redeposition of soil. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,3480,4121),(6904,NULL,NULL,NULL,'10. Prepare a fresh solution daily or more often if use solution becomes visibly soiled or dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,3480,4122),(6905,NULL,NULL,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. {This product can be used to pre-clean or decontaminate critical or semi-critical medical devices prior to sterilization or high-level disinfection.}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3484,4123),(6906,NULL,NULL,NULL,'This product is not for use on medical device surfaces.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3485,4124),(6907,NULL,NULL,'From a Concentrate: ','Add 0.6 oz. of this product directly into the water in the toilet bowl. Brush thoroughly over exposed surfaces and under the rim with a toilet {{BrushMop}}, cloth, or sponge. Allow solution to stand for 10 minutes and flush. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3496,4125),(6908,NULL,NULL,'From a Use Solution: ','Empty water out of toilet bowl or urinal and apply 0.5 to 1 oz. use solution to exposed surfaces, including under the rim with a toilet {{BrushMop}}, cloth, or sponge, {{SprayDevices}}.  {{SprayApplications}} Brush or swab thoroughly, then allow solution to stand for 10 minutes and flush. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3496,4126),(6909,NULL,NULL,NULL,'1. Pre-clean heavily soiled areas. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3500,4127),(6910,NULL,NULL,NULL,'2. Apply use solution of 3 oz. of this product per 5 gal. of water {{450PPM}} {{EquivalentDilution}} to floors, walls and ceilings making sure not to over spray. To disinfect, all hard, non-porous surfaces must remain wet for 10 minutes.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3500,4128),(6911,NULL,NULL,NULL,'3. Scrub using a deck brush or other coarse material as necessary.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,3500,4129),(6912,NULL,NULL,NULL,'4. Rinse surfaces thoroughly and let air dry.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,3500,4130),(6913,NULL,NULL,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,3500,4131),(6914,NULL,NULL,'Dosage: ','To eliminate odor, add 4  8 oz. of this product in a {{WavelessFree}} waterbed of 90 to 180 gal. capacity. Repeat application every 4 to 6 months. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3507,4132),(6915,NULL,NULL,'Site Preparation: ','The first step in any ongoing sanitation program must be the removal of gross contamination and debris. This may be accomplished by using a shovel, broom, or vacuum, depending on the area to be disinfected.  ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3525,4133),(6916,NULL,NULL,'Disinfection: ','For heavily soiled areas, pre-clean first. Use {{3Oz}} of this product per 5 gal. of water {{EquivalentDilution}} use solution. Wet all hard, non-porous surfaces thoroughly. Treated surfaces must remain wet for 10 minutes. Let air-dry. Prepare a fresh solution for each use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3525,4134),(6917,NULL,NULL,'For Heavy Duty Cleaning: ','When heavy duty cleaning is desired, use 6 oz. of this product per 5 gal. of water {{1.25Oz}} {{EquivalentDilution}}. Heavily soiled areas will require repeated cleaning before treatment. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,3525,4135),(6918,NULL,NULL,'DO NOT APPLY TO THE MUSHROOM CROP, COMPOST OR CASING. ','Rinse treated surfaces with potable water before they contact the crop, compost or casing.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,3525,4136),(6919,NULL,NULL,'Preparation of Use Solution:','Apply a use solution of 0.25 oz. of this product per gal. of water {{200PPM}} {{EquivalentDilution}} to sanitize hard, non-porous exterior surfaces such as vinyl, plastic, sealed concrete, painted or sealed woodwork, and sealed stucco. Surfaces to be treated include house siding, decks, patios, walkways and driveways.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3535,4137),(6920,NULL,NULL,'Application: ','Pre-clean heavily soiled areas. Apply solution with a brush, mop, cloth, sponge, {{AutoScrubber,}} mechanical spray device, {{SprayDevices}}, or with a low-pressure {{LessThan60PSI}} airless sprayer so as to wet all surfaces thoroughly. For sprayer applications, spray 6 inches to 8 inches from surface. Treated surfaces must remain wet for 3 minutes. Wearing suitable respiratory protective equipment and protective eyewear to control exposure to spray, pressure wash surfaces to thoroughly sanitize all treated areas using a high-pressure spray. Do not breathe spray. One-half gal. of diluted product will treat 200-300 sq. ft. of surface. Prepare a fresh solution daily or when visibly dirty. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3535,4138),(6921,NULL,NULL,'1. Dosing Location: ','This product is to be applied at a point in the system where it will be uniformly mixed, such as at the sump.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3548,4139),(6922,NULL,NULL,'2. Dosing Conditions: ','This product must be applied when the system is in jeopardy of being affected or after cleaning systems where efficiency is already impaired. Tower bleed off valves must be closed to permit a retention time of 4 hours. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3548,4140),(6923,NULL,NULL,'3. Method of Application: ',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,3548,4141),(6924,NULL,NULL,'a. INTERMITTENT OR SLUG METHOD','Initial Dose: When the system is noticeably fouled, apply 26.25 fl. oz. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system.\r\n\r\nSubsequent Dose: When microbial control is evident, add 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water in the system weekly or as needed to maintain control. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,3548,4142),(6925,NULL,NULL,'b. MODIFIED INTERMITTENT METHOD','Initial Dose: When the system is noticeably fouled, apply 26.25 fl. oz. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system. Apply half of this initial dose when half of the water in the system has been lost by blowdown.\r\n\r\nSubsequent Dose: When control of microbial growth is evident, apply 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water in the system. Apply half of this subsequent dose when half of the water in the system has been lost by blowdown.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,3548,4143),(6926,NULL,NULL,'c. CONTINUOUS FEED METHOD ','Initial Dose: When the system is noticeably fouled, apply 26.25. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system.\r\n\r\nSubsequent Dose: Maintain this treatment by starting a continuous feed of 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water lost by blowdown. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,3548,4144),(6927,NULL,NULL,'1. Dosing Location:  ','This product is to be applied at a point in the system where it will be uniformly mixed, such as at the sump. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3549,4145),(6928,NULL,NULL,'2. Dosing Conditions:  ','This product must be applied when the system is in jeopardy of being affected or after cleaning systems where efficiency is already impaired.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3549,4146),(6929,NULL,NULL,'3. Method Of Applications:',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,3549,4147),(6930,NULL,NULL,'a. ','Wear safety glasses, rubber gloves and impervious apron',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,3549,4148),(6931,NULL,NULL,'b. ','To reduce foaming, mix 10 parts of water to 1 part of this product',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,3549,4149),(6932,NULL,NULL,'c. ','{{UseAdd}} 0.75 to 7 fl. oz. of this product {{0.6-6PPM}} per 1,000 gal.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,3549,4150),(6933,NULL,NULL,'d. ','Do not discharge without performing proper deactivation. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,3549,4151),(6934,NULL,NULL,'e. ','Treatment time cannot exceed 120 hours/application nor exceed 4 times per year.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,3549,4152),(6935,NULL,NULL,'f. ','Avoid oxidizers and reducing agents. Product is cationic and must not be mixed with soap or anionic surfactants',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,3549,4153),(6936,NULL,NULL,'3. Method Of Application: ','INTERMITTENT OR SLUG METHOD',NULL,'NA','Alternate Method of Application language can be used in place of Item #3 directly above.',NULL,'Y',NULL,NULL,NULL,NULL,NULL,10,NULL,3549,4154),(6937,NULL,NULL,'Initial Dose:  ','When the system is noticeably fouled, apply 0.75 to 7 fl. oz. of this product {(0.6 to 6 ppm on an active basis)} per 1,000 gal. of water based on system flow rates. The minimum treatment is 6 to 24 hours. Repeat until control is achieved. Deactivation must be conducted prior to discharge from the system by using bentonite clay at a minimum ratio of 5 ppm clay to 1 ppm product. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,11,NULL,3549,4155),(6938,NULL,NULL,'Subsequent Dose:  ','When microbial control is evident, add 0.375 to 3.75 fl. oz. of this product {(0.3 to 3 ppm on an active basis)} per 1,000 gal. of water based upon system flow rates on an as needed basis to maintain control. Frequency of feed must be tied to an in-plant monitoring program for macro cowling growth. Deactivation must be conducted prior to discharge from the system by using bentonite clay at a minimum ratio of 5 ppm clay to 1 ppm product.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,NULL,3549,4156),(6939,NULL,NULL,'OILFIELD INJECTION AND WASTE WATER',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3551,4157),(6940,NULL,NULL,'1. ','Continuous Injection: Add this product at 30 ppm {(22.5 fl. oz. of this product per 1,000 gal. of water)} when system is noticeably fouled. When microbial control is evident, add this product at 15 ppm (30 fl. oz. of this product per 1,000 gal. of water) to maintain control.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3551,4158),(6941,NULL,NULL,'2. ','Batch Treatment: Add this product at 180 ppm {(230 fl. oz. of this product per 1,000 gal. of water)} over a period of 4-6 hours one or more times per week when the system is noticeably fouled. When microbial control is evident, add this product at 90 ppm (115 fl. oz. of this product per 1,000 gal. of water) over a period of 4-6 hours one or more time per week.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,3551,4159),(6942,NULL,NULL,'Initial treatment: ','65-1,000 ppm active added to a freshly prepared fluid.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3555,4160),(6943,NULL,NULL,'Maintenance dosage: ','65-1,000 ppm active so as to maintain control.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3555,4161),(6944,NULL,NULL,NULL,'Remove {{CapSprayNozzle}} from empty container. Fill empty container with a freshly prepared use-solution. Replace {{CapSprayNozzle}}. Place correct use-dilution label on newly filled container. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3558,4162),(6945,NULL,NULL,NULL,'{{RemoveCap}} Insert cartridge into dispenser. {{SeeDispenserInstructionsForProperPlacementOfCartridge}} {{PressButtonOrTurnKnob}} to dispense {{#InsertAppropriateDilution}} of this product into a {{BucketBottleContainer}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,3558,4163),(6946,NULL,NULL,NULL,'Turn off water to connect {{UnitCartridge}}. Attach water source. Rotate control knob to fill a {{BottleBucket}}. Squeeze handle to dispense {{#AppropriateDilution}}. {{SeeDeviceInstructionManualForMoreInformation.}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,3558,4164),(6947,NULL,NULL,NUL