),(9026,NULL,NULL,NULL,'1. Turn off RO system, drain storage tank and remove membrane element and pre-filters. Put membrane element in a plastic bag so it remains wet. Do not use this product to sanitize the membrane element. Membrane element must be sterilized separately. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9025,NULL,5174),(9027,NULL,NULL,NULL,'2. Tank must be washed with a compatible detergent and rinsed with potable water before sanitizing. (Note: Use this direction only if applicable.) ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9025,NULL,5175),(9028,NULL,NULL,NULL,'3. Fill empty pre-filter housing with a solution of {{#AppropriateDilution}} {{EquivalentDilution}} of this product and turn on raw water. {{Note}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9025,NULL,5176),(9029,NULL,NULL,NULL,'4. After holding tank is full, let system stand idle for a minimum of 1 minute. Turn off water. Drain holding tank. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9025,NULL,5177),(9030,NULL,NULL,NULL,'5. Before the system is put back into service, flush system with potable water to assure sanitizing solution is rinsed thoroughly from system. Return unit{{s}} to normal operation. Follow the manufacturers directions for re-installation of new pre-filters, membrane element and post filter.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9025,NULL,5178),(9031,NULL,NULL,NULL,'1. Hold pre-mixed sanitizer solution of 1 ounce of this product per 5 gal. 4-6 inches away from sole of {{Waterproof}} {{WorkWear}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5680,5179),(9032,NULL,NULL,NULL,'2. Lightly spray sole to thoroughly wet entire surface',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,5680,5180),(9033,NULL,NULL,NULL,'3. Repeat procedure on other sole',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,5680,5181),(9034,NULL,NULL,NULL,'4. Treated surfaces must remain wet for 3 minutes',N