vel) with soap or detergent and rinse with potable water before reuse.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,5690,5190),(9043,NULL,NULL,NULL,'8. Do not return animals to the habitat until it is dry and ventilated.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,5690,5191),(9044,NULL,NULL,NULL,'9. Clean terrarium at least once weekly or more as needed. Change cloth, sponge or towels frequently to avoid redeposition of soil. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,NULL,5690,5192),(9045,NULL,NULL,NULL,'10. Prepare a fresh solution daily or more often if use solution becomes visibly soiled or dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,5690,5193),(9046,NULL,NULL,NULL,'This product is not to be used as a terminal sterilant/high-level disinfectant on any surface or instrument that (1) is introduced directly into the human body, either into or in contact with the bloodstream or normally sterile areas of the body, or, (2) contacts intact mucous membranes but which does not ordinarily penetrate the blood barrier or otherwise enter normally sterile areas of the body. {This product can be used to pre-clean or decontaminate critical or semi-critical medical devices prior to sterilization or high-level disinfection.}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5694,5194),(9047,NULL,NULL,NULL,'This product is not for use on medical device surfaces.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5695,5195),(9048,NULL,NULL,'From a Concentrate: ','Add 0.6 oz. of this product directly into the water in the toilet bowl. Brush thoroughly over exposed surfaces and under the rim with a toilet {{BrushMop}}, cloth, or sponge. Allow solution to stand for 10 minutes and flush. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5706,5196),(9049,NULL,NULL,'From a Use Solution: ','Empty water out of toilet bowl or urinal and apply 0.5 to 1 oz. use solution to exposed surfaces, including under the rim with a toilet {{BrushMop}}, cloth, or sponge, {{SprayDevices}}.  {{SprayApplications}} Brush or swab thoroughly, then allow solution to stand for 10 minutes and flush. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,5706,5197),(9050,NULL,NULL,NULL,'1. Pre-clean heavily soiled areas. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5710,5198),(9051,NULL,NULL,NULL,'2. Apply use solution of 3 oz. of this product per 5 gal. of water {{450PPM}} {{EquivalentDilution}} to floors, walls and ceilings making sure not to over spray. To disinfect, all hard, non-porous surfaces must remain wet for 10 minutes.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,5710,5199),(9052,NULL,NULL,NULL,'3. Scrub using a deck brush or other coarse material as necessary.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,5710,5200),(9053,NULL,NULL,NULL,'4. Rinse surfaces thoroughly and let air dry.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,5710,5201),(9054,NULL,NULL,NULL,'5. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,5710,5202),(9055,NULL,NULL,'Dosage: ','To eliminate odor, add 4  8 oz. of this product in a {{WavelessFree}} waterbed of 90 to 180 gal. capacity. Repeat application every 4 to 6 months. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5717,5203),(9056,NULL,NULL,'Site Preparation: ','The first step in any ongoing sanitation program must be the removal of gross contamination and debris. This may be accomplished by using a shovel, broom, or vacuum, depending on the area to be disinfected.  ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5735,5204),(9057,NULL,NULL,'Disinfection: ','For heavily soiled areas, pre-clean first. Use {{3Oz}} of this product per 5 gal. of water {{EquivalentDilution}} use solution. Wet all hard, non-porous surfaces thoroughly. Treated surfaces must remain wet for 10 minutes. Let air-dry. Prepare a fresh solution for each use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,5735,5205),(9058,NULL,NULL,'For Heavy Duty Cleaning: ','When heavy duty cleaning is desired, use 6 oz. of this product per 5 gal. of water {{1.25Oz}} {{EquivalentDilution}}. Heavily soiled areas will require repeated cleaning before treatment. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,5735,5206),(9059,NULL,NULL,'DO NOT APPLY TO THE MUSHROOM CROP, COMPOST OR CASING. ','Rinse treated surfaces with potable water before they contact the crop, compost or casing.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,5735,5207),(9060,NULL,NULL,'Preparation of Use Solution:','Apply a use solution of 0.25 oz. of this product per gal. of water {{200PPM}} {{EquivalentDilution}} to sanitize hard, non-porous exterior surfaces such as vinyl, plastic, sealed concrete, painted or sealed woodwork, and sealed stucco. Surfaces to be treated include house siding, decks, patios, walkways and driveways.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5745,5208),(9061,NULL,NULL,'Application: ','Pre-clean heavily soiled areas. Apply solution with a brush, mop, cloth, sponge, {{AutoScrubber,}} mechanical spray device, {{SprayDevices}}, or with a low-pressure {{LessThan60PSI}} airless sprayer so as to wet all surfaces thoroughly. For sprayer applications, spray 6 inches to 8 inches from surface. Treated surfaces must remain wet for 3 minutes. Wearing suitable respiratory protective equipment and protective eyewear to control exposure to spray, pressure wash surfaces to thoroughly sanitize all treated areas using a high-pressure spray. Do not breathe spray. One-half gal. of diluted product will treat 200-300 sq. ft. of surface. Prepare a fresh solution daily or when visibly dirty. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,5745,5209),(9062,NULL,NULL,'1. Dosing Location: ','This product is to be applied at a point in the system where it will be uniformly mixed, such as at the sump.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5758,5210),(9063,NULL,NULL,'2. Dosing Conditions: ','This product must be applied when the system is in jeopardy of being affected or after cleaning systems where efficiency is already impaired. Tower bleed off valves must be closed to permit a retention time of 4 hours. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,5758,5211),(9064,NULL,NULL,'3. Method of Application: ',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,5758,5212),(9065,NULL,NULL,'a. INTERMITTENT OR SLUG METHOD','Initial Dose: When the system is noticeably fouled, apply 26.25 fl. oz. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system.\r\n\r\nSubsequent Dose: When microbial control is evident, add 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water in the system weekly or as needed to maintain control. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9064,NULL,5213),(9066,NULL,NULL,'b. MODIFIED INTERMITTENT METHOD','Initial Dose: When the system is noticeably fouled, apply 26.25 fl. oz. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system. Apply half of this initial dose when half of the water in the system has been lost by blowdown.\r\n\r\nSubsequent Dose: When control of microbial growth is evident, apply 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water in the system. Apply half of this subsequent dose when half of the water in the system has been lost by blowdown.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9064,NULL,5214),(9067,NULL,NULL,'c. CONTINUOUS FEED METHOD ','Initial Dose: When the system is noticeably fouled, apply 26.25. of this product {(20 ppm on an active basis)} per 1,000 gal. of water in the system.\r\n\r\nSubsequent Dose: Maintain this treatment by starting a continuous feed of 6.65 to 19.25 fl. oz. of this product per 1,000 gal. of water lost by blowdown. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9064,NULL,5215),(9068,NULL,NULL,'1. Dosing Location:  ','This product is to be applied at a point in the system where it will be uniformly mixed, such as at the sump. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5759,5216),(9069,NULL,NULL,'2. Dosing Conditions:  ','This product must be applied when the system is in jeopardy of being affected or after cleaning systems where efficiency is already impaired.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,5759,5217),(9070,NULL,NULL,'3. Method Of Applications:',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,5759,5218),(9071,NULL,NULL,'a. ','Wear safety glasses, rubber gloves and impervious apron',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9070,NULL,5219),(9072,NULL,NULL,'b. ','To reduce foaming, mix 10 parts of water to 1 part of this product',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9070,NULL,5220),(9073,NULL,NULL,'c. ','{{UseAdd}} 0.75 to 7 fl. oz. of this product {{0.6-6PPM}} per 1,000 gal.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9070,NULL,5221),(9074,NULL,NULL,'d. ','Do not discharge without performing proper deactivation. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9070,NULL,5222),(9075,NULL,NULL,'e. ','Treatment time cannot exceed 120 hours/application nor exceed 4 times per year.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9070,NULL,5223),(9076,NULL,NULL,'f. ','Avoid oxidizers and reducing agents. Product is cationic and must not be mixed with soap or anionic surfactants',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9070,NULL,5224),(9077,NULL,NULL,'3. Method Of Application: ','INTERMITTENT OR SLUG METHOD',NULL,'NA','Alternate Method of Application language can be used in place of Item #3 directly above.',NULL,'Y',NULL,NULL,NULL,NULL,NULL,4,NULL,5759,5225),(9078,NULL,NULL,'Initial Dose:  ','When the system is noticeably fouled, apply 0.75 to 7 fl. oz. of this product {(0.6 to 6 ppm on an active basis)} per 1,000 gal. of water based on system flow rates. The minimum treatment is 6 to 24 hours. Repeat until control is achieved. Deactivation must be conducted prior to discharge from the system by using bentonite clay at a minimum ratio of 5 ppm clay to 1 ppm product. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9077,NULL,5226),(9079,NULL,NULL,'Subsequent Dose:  ','When microbial control is evident, add 0.375 to 3.75 fl. oz. of this product {(0.3 to 3 ppm on an active basis)} per 1,000 gal. of water based upon system flow rates on an as needed basis to maintain control. Frequency of feed must be tied to an in-plant monitoring program for macro cowling growth. Deactivation must be conducted prior to discharge from the system by using bentonite clay at a minimum ratio of 5 ppm clay to 1 ppm product.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9077,NULL,5227),(9080,NULL,NULL,'OILFIELD INJECTION AND WASTE WATER',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5761,5228),(9081,NULL,NULL,'1. ','Continuous Injection: Add this product at 30 ppm {(22.5 fl. oz. of this product per 1,000 gal. of water)} when system is noticeably fouled. When microbial control is evident, add this product at 15 ppm (30 fl. oz. of this product per 1,000 gal. of water) to maintain control.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9080,NULL,5229),(9082,NULL,NULL,'2. ','Batch Treatment: Add this product at 180 ppm {(230 fl. oz. of this product per 1,000 gal. of water)} over a period of 4-6 hours one or more times per week when the system is noticeably fouled. When microbial control is evident, add this product at 90 ppm (115 fl. oz. of this product per 1,000 gal. of water) over a period of 4-6 hours one or more time per week.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9080,NULL,5230),(9083,NULL,NULL,'Initial treatment: ','65-1,000 ppm active added to a freshly prepared fluid.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5765,5231),(9084,NULL,NULL,'Maintenance dosage: ','65-1,000 ppm active so as to maintain control.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,5765,5232),(9085,NULL,NULL,NULL,'Remove {{CapSprayNozzle}} from empty container. Fill empty container with a freshly prepared use-solution. Replace {{CapSprayNozzle}}. Place correct use-dilution label on newly filled container. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5768,5233),(9086,NULL,NULL,NULL,'{{RemoveCap}} Insert cartridge into dispenser. {{SeeDispenserInstructionsForProperPlacementOfCartridge}} {{PressButtonOrTurnKnob}} to dispense {{#InsertAppropriateDilution}} of this product into a {{BucketBottleContainer}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,5768,5234),(9087,NULL,NULL,NULL,'Turn off water to connect {{UnitCartridge}}. Attach water source. Rotate control knob to fill a {{BottleBucket}}. Squeeze handle to dispense {{#AppropriateDilution}}. {{SeeDeviceInstructionManualForMoreInformation.}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,5768,5235),(9088,NULL,NULL,NULL,'Attach sprayer unit to hose. Secure tightly, Check that the sprayer is in the off position. Turn on water. Turn sprayer to on position to dispense {{#AppropriateDilution}}. Spray evenly over surface. When finished turn sprayer to off position and then turn water off. Separate mixing of the concentrate or other application equipment is not required. First ensure the hose faucet is turned off',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,5768,5236),(9089,NULL,NULL,'{{HowToUsePackage}}',' This package is designed to be used with dilution control systems only. Open package and connect to {{HoseSystem}} to dispense according to directions on the box. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5769,5237),(9090,NULL,NULL,'How to Assemble Extendable Trigger',NULL,NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5771,5238)