ilution}} of this product. Immerse all utensils for at least 1 minute or for contact time specified by governing sanitary code',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,5920,5141),(9300,NULL,NULL,NULL,'5. Place sanitized utensils on a rack or drain board to air-dry.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL,5920,5142),(9301,NULL,NULL,NULL,'6. Prepare a fresh solution daily or when visibly dirty.',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,NULL,5920,5143),(9302,NULL,NULL,NULL,'{{PotableWaterRinse}}',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,5920,5144),(9303,NULL,NULL,NULL,'1. Disassemble equipment and thoroughly clean after use. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5921,5145),(9304,NULL,NULL,NULL,'2. Assemble equipment into operational position prior to sanitizing. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,5921,5146),(9305,NULL,NULL,NULL,'3. Prepare a sanitizing solution equal to 110% of the volume capacity of the equipment by diluting (Insert appropriate food contact dilution from table or list) {{EquivalentDilution}} of this product {{150400PPM}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,5921,5147),(9306,NULL,NULL,NULL,'4. Pump the solution through the system until full flow is obtained at all extremities and the system is completely filled with sanitizer and all air is removed. Surfaces must remain wet for at least 1 minute. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,NULL,5921,5148),(9307,NULL,NULL,NULL,'1. Thoroughly flush, clean and potable water rinse the system',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,5922,5149),(9308,NULL,NULL,NULL,'2. Prepare required volume of sanitizer solution needed by diluting (Insert appropriate food contact dilution from table or list)  {{EquivalentDilution}} of this product {{150-400PPM}}. ',NULL,'NA',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,NULL,5922,5150),(9309,NULL,NULL,NULL,'3. To sanitize