INSERT INTO `spld_marketingstatement` VALUES (3291,NULL,'Germicidal Detergent and Deordorant',NULL,NULL,NULL,NULL,NULL,NULL,135,3263),(3292,NULL,'For use in: {{Area Of Use}}. Disinfects, cleans, and deodorizes the following hard nonporous\r\ninanimate surfaces: {{Surface}}, etc.).',NULL,NULL,NULL,NULL,NULL,NULL,136,3264),(3293,NULL,'For use in {{Area Of Use}}.',NULL,NULL,NULL,NULL,NULL,NULL,137,3265),(3294,NULL,'A multi-purpose germicidal detergent and deodorant effective in hard waters up to 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5 % organic serum. Disinfects, cleans, and deodorizes in one labor saving step.',NULL,NULL,NULL,NULL,NULL,NULL,138,3266),(3295,NULL,'Federally inspected meat and poultry plants as a disinfectant agent for use in all departments. Food products and packaging materials must be removed from the room or carefully protected. Use product in accordance with its label. All surfaces must be thoroughly rinsed with potable water.',NULL,NULL,NULL,NULL,NULL,NULL,139,3267),(3296,NULL,'Bactericidal against the following pathogenic bacteria according to the AOAC Use-Dilution Test method, current edition, modified in the presence of 400 ppm synthetic hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum:',NULL,NULL,NULL,NULL,NULL,NULL,140,3268),(3297,NULL,'Fungicidal against {{Claims}} albicans according to the AOAC fungicidal test, modified in the presense of 400 ppm hard water (calculated as CaCO<sub>3</sub>) plus 5% organic serum.',NULL,NULL,NULL,NULL,NULL,NULL,141,3269),(3298,NULL,'Virucidal against {{Claims}} according to the virucidal qualification, modified in the presence of 400 ppm hard water (calculated as CaCO3) plus 5 % organic serum.',NULL,NULL,NULL,NULL,NULL,NULL,142,3270),(3315,NULL,'Recommended for use in {{Area Of Use}}. Disinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: {{Surface}}. Recommended for use in: Federally inspected meat and poultry plants as a disinfectant agent for 