ard water (calculated as CaCO<sub>3</sub>) plus 5 % organic serum.',NULL,NULL,NULL,NULL,NULL,NULL,28,3357),(3400,NULL,'Concentrate (Concentrated)\r\nNeutral (Neutral pH)\r\nDisinfects (Disinfectant)\r\nCleans (Cleaner)\r\nDeodorizes (Deodorizer)',NULL,NULL,NULL,NULL,NULL,1,29,3358),(3401,NULL,'A multi-purpose, neutral pH, germicidal detergent and deodorant effective in hard water up to 400 ppm (calculated as CaCO) in the presence of a moderate amount of soil (5% organic serum) according to the AOAC Use-dilution Test. Disinfects, cleans, and deodorizes in one labor-saving step.',NULL,NULL,NULL,NULL,NULL,2,30,3358),(3402,NULL,'Recommended for use in hospitals, nursing homes, schools, colleges, commercial and industrial institutions, office buildings, veterinary clinics, animal life science laboratories, zoos, federally inspected meat and poultry plants, equine farms, tack shops, pet shops, airports, kennels, hotels, motels, poultry farms, turkey farms, dairy farms, hog farms, breeding establishments, grooming establishments, funeral homes, and households. Use to clean and disinfect non-medical (i.e. industrial and fire-fighting) respirators in industrial, commercial and institutional premises.',NULL,NULL,NULL,NULL,NULL,3,31,3358),(3403,NULL,'Disinfects, cleans, and deodorizes the following hard nonporous inanimate surfaces: floors, walls, (non-medical) metal surfaces, (non-medical)stainless steel surfaces, glazed porcelain, plastic surfaces (such as polypropylene, polystyrene, etc.).',NULL,NULL,NULL,NULL,NULL,4,32,3358),(3404,NULL,'Use [on] [to clean and disinfect] nonporous athletic mats, wrestling mats, gymnastic mats, exercise equipment and training tables.',NULL,NULL,NULL,NULL,NULL,5,33,3358),(3405,NULL,'Use [on] [to clean and disinfect] nonporous personal protective safety equipment, wrestling headgear, boxing headgear, protective headgear, athletic helmets, hard hats, half mask respirators, full face breathing apparatus, gas masks, goggles, spectacles, face shie